INSERT INTO `admin_albums` (`id`, `title`, `created_at`, `updated_at`, `description`) VALUES
(5, 'Тобольск туристический.', '2014-06-30 07:19:14', '2014-08-01 06:48:28', '<p>\r\n	 Тобольск. Всего два столетия назад это был третий по значению город России после Москвы и Санкт-Петербурга. Столица Сибири, распространявшая имперское влияние на огромные территории от Урала до Тихого океана, сравнимые по площади с Америкой. Место ссылки политических узников и духовный культурный центр, город, ставший одним из последних пристанищ семьи российского императора Николая II. Тобольский Кремль — в списке самых значимых памятников России.\r\n</p>\r\n<p>\r\n	 Тем более странное, порой сюрреалистическое, но неизменно тяжелое впечатление оставляет историческая часть города Тобольска или как её называют местные — Нижний Город или Подгора.\r\n</p>\r\n<p>\r\n	 Местами его улицы напоминают декорации к фильмам про пост-Апокалипсис. Руины — самая заметная туристическая достопримечательность. Жить в Нижнем Городе у местных считается непрестижным, даже опасным — ходить там в одиночку в темное время суток не рекомендуется. Потому современный комплекс, отстроенный на месте снесенных исторических зданий, за несколько лет заселен лишь на половину.\r\n</p>\r\n<p>\r\n	 Невольно возникает диссонанс — старинный красивый городок, с богатейшей и славной историей, туристический центр Сибири и неустроенность, вопиющая нищета, трущобы. Не сходится... Неведомы и непонятны причины, которые привели к аксиоме: если от старинного дома остались только стены, да и те вот-вот рухнут, значит на нем обязательно висит табличка «Памятник архитектуры. Охраняется государством».\r\n</p>'),
(6, 'Экологическая экспедиция на остров Белый, сезон 2013.', '2014-06-30 17:22:37', '2014-07-30 06:43:35', '<p>\r\n	Что такое остров Белый?\r\n</p>\r\n<p>\r\n	Географически это остров, отделяемый небольшим проливом от полуострова Ямал, где-то на полпути от Тюмени до северного полюса. Это глубокая Арктика. Это девять месяцев зимы, две недели весны и лета, и целых два месяца белоночного полярного лета. Но лето т специфическое – в резиновых сапогах и почти всегда в штормовке от ветра и дождя.\r\n</p>\r\n<p>\r\n	Белый – священное место для народа ненцы. По их преданиях, на острове живёт верховное божество и дух Ямала Сэр Ири, Белый Дед. Ненцы не любят, когда на священной территории находятся посторонние – но в глаза этого никто не скажет. На белый нельзя приезжать женщинам, так как Сэр Ири дух-мужчина. А когда переплываешь или перелетаешь пролив Малыгина надо надеть шапку наоборот или натянуть на глаза капюшон, чтобы Белый Дед не сглазил… Жить на острове по обычаям ненцы нельзя, можно лишь посещать жертвенники.\r\n</p>\r\n<p>\r\n	На острове метеостанция, где постоянно живут три человека. А вокруг развалины военного городка и некогда большой метеостанции, горы металла, стекла, техники, бочек. Эти руины очень медленно распадаются и продолжают отравлять хрупкое природное равновесие острова. Люди ушли с Белого в девяностых, оставив после себя большую помойку. Экологическая экспедиция, которой в 2014 году исполняется третий год, призвана «помыть» Белый, освободив его от наследия 20-го века. Это сложно. Это тяжело и затратно. Но делать это надо.\r\n</p>\r\n<p>\r\n	Летом на острове остаётся много белых медведей, сколько точно никто не считал, это ещё только предстоит сделать. Медведи как люди, есть скромные, есть наглые, есть красивые, есть замарахи. Непонятно кому с кем опасней находиться рядом – человеку или медведю…  Но медведи от руки человека гибнут чаще, чем люди по вине медведя.\r\n</p>\r\n<p>\r\n	Что будет на Белом, когда его уберут?! С 2014 года на Белом уже работают учёные. Говорят, там будет постоянно действующий научный центр по изучению экосистемы Арктики. Но там есть и газ, и нефть, так что соблазны велики…\r\n</p>'),
(7, 'Коммунистическая улица. ', '2014-07-27 02:45:57', '2014-08-04 01:51:42', ''),
(11, 'Ино', '2015-03-06 17:06:02', '2015-03-06 17:06:02', '<p>Аутизм – нарушение развития, не дружественное фотокамере. Да что там, камере: людям с аутизмом вообще трудно дается взаимодействие с окружающими. И именно нам, этим окружающим, под силу стать хотя бы чуть-чуть ближе, доказать силу земного притяжения, вспомнить, наконец, пресловутую истину – человеку нужен человек. Фотовыставка «Ино» – одна из таких попыток услышать, почувствовать, понять. В выставку вошли фотографии, снятые Алиной за год работы с детьми с аутизмом.</p>'),
(12, 'Крестный ход в село Утятское', '2016-10-24 18:24:13', '2016-10-24 18:24:13', '<p>Крестный ход, это своеобразная молитва. Торжественное шествие и испытание в православном мире. Этот ритуальный акт для прихожан несет и надежду и в то же время это акт посвящения себя Богу. Так или иначе, думаю каждый по своему ощущает этот феномен.</p><p>Мои карточки сняты на крестном ходе в Курганской области. Ход идёт около 40 километров за один день - из Кургана в село Утятское.</p>');
