(5, '', 'Фотография сделана с борта вертолёта во время экологической экспедиции на остров Белый в 2013 году', 30, 'Photo', 13, 'comments', '2014-06-30 15:26:13', '2014-06-30 15:26:13'),
(6, '', '', 31, 'Photo', 13, 'comments', '2014-06-30 15:30:07', '2014-06-30 15:30:07'),
(7, '', '', 31, 'Photo', 13, 'comments', '2014-06-30 15:30:20', '2014-06-30 15:30:20'),
(8, '', 'Волонтёры экологической экспедиции убирают остров Белый', 32, 'Photo', 13, 'comments', '2014-06-30 15:33:37', '2014-06-30 15:33:37'),
(9, '', 'Остров Белый, вечер. Полярный день ещё не превратился в полноценную ночь, но солнце уже опускается за горизонт, а плотная облачность создаёт эффект заката.', 33, 'Photo', 13, 'comments', '2014-06-30 15:37:11', '2014-06-30 15:37:11'),
(10, '', 'Во время экологической экспедиции на остров Белый в 2013 году волонтёрами был спасен раненый из огнестрельного оружия белый медвежонок. Медвежонка выходили, откормили и он стал показывать настоящий "белый" характер. Новым домом медвежонка, которому дали имя Сэр Ири, стал Пермский зоопарк.', 34, 'Photo', 13, 'comments', '2014-06-30 15:43:05', '2014-06-30 15:43:05'),
(11, '', 'А где он показывается в каком разделе ? Я тут попробовал, вроде не показывается  по крайнеймере не показывается там где было задумано в последних фотографиях.', 10, 'Letter', 1, 'comments', '2014-07-03 16:39:41', '2014-07-03 16:39:41'),
(12, '', 'А, понял ... Они показываются на первой странице. Это легко можно поправить.', 10, 'Letter', 1, 'comments', '2014-07-03 16:44:09', '2014-07-03 16:44:09'),
(15, '', 'Открытие выставки по техническим причинам переносится. О новом времени и дате мы сообщим дополнительно.', 10, 'Post', 6, 'comments', '2014-07-16 13:53:40', '2014-07-16 13:53:40'),
(16, '', 'Вроде полностью исправили регистрацию, теперь почта приходит вроде всем и на все ящики. Так что после регистрации не забудте заглянуть в ваш почтовый ящик и активировать ваш аккаунт. Те, кто считают, что им мало прав дали, обращаются ко мне по почте в личном кабинете или через тикеты (а так же любым другим доступным образом).', 9, 'Post', 6, 'comments', '2014-07-19 05:51:59', '2014-07-19 05:51:59'),
(17, '', '28 июля приглашаю принять участие в развеске фотографий фотовыставки Сергея Киселева в Музейном комплексе Усадьбы Колокольниковых.', 10, 'Post', 6, 'comments', '2014-07-27 03:35:45', '2014-07-27 03:35:45'),
(18, '', 'Всё, выставка висит. Сегодня все карточки повесили. Значит скоро открытие. Следите за информацией.', 10, 'Post', 6, 'comments', '2014-07-28 08:37:49', '2014-07-28 08:37:49'),
(19, '', 'Открытие выставки состоится 1 августа в 16:30 музейном комплексе Усадьба Колокольниковых (Исторический музей).', 10, 'Post', 6, 'comments', '2014-07-30 16:07:17', '2014-07-30 16:07:17'),
