(78, '', 'Алтай... Там каждый день, каждый час чудеса!!! Нельзя произносить плохие слова, нельзя допускать дурные мысли - все сбывается...', 326, 'Photo', 114, 'comments', '2014-11-30 08:34:43', '2014-11-30 08:34:43'),
(79, '', 'Монголы - замечательные люди! Они всегда приходят на помощь, если просишь. Этот мальчик (сын шиномонтажника) знает о машинах больше, чем иной профессиональный автослесарь. Монголия!', 327, 'Photo', 114, 'comments', '2014-11-30 08:38:01', '2014-11-30 08:38:01'),
(80, '', 'Снег выпал 11 августа!!! Бывает.', 328, 'Photo', 114, 'comments', '2014-11-30 08:38:47', '2014-11-30 08:38:47'),
(81, '', 'Озеро труднодоступно - нужно на машинах форсировать несколько горных рек. Не каждому и не всегда это удается. Нам повезло!!!', 329, 'Photo', 114, 'comments', '2014-11-30 08:40:25', '2014-11-30 08:40:25'),
