(180, '', 'Зима, летят хлопья снега, у приоткрытых ворот сидит кот.  \r\nНа дорожке,  запорошенные снегом, следы ушедших людей . ', 638, 'Photo', 35, 'comments', '2014-12-23 18:22:10', '2014-12-23 18:22:10'),
(181, '', 'Старый заброшенный дом, он стоит на этом месте может быть целый век, а мимо проходят люди...\r\nШло время, люди рождались, взрослели и старились, уходили и снова рождались.  Он запечатлел все до нюансов и устал от людской суеты.  Углубившись в себя он всё ещё наблюдает внутренним взором,  источая тепло и покой  на бегущих мимо людей.', 640, 'Photo', 35, 'comments', '2014-12-23 18:49:56', '2014-12-23 18:49:56'),
(182, '', 'Театральный макет наполняется удивительным смыслом, когда вдруг через  проёмы дверей и  окон просматриваются люди. Кто-то заглядывает, кто-то просто стоит в отдалении,а  в миниатюрной комнате висит лампочка и блестят половицы, и силуэт кукольного человека промелькнул в глубине...', 639, 'Photo', 35, 'comments', '2014-12-23 19:08:13', '2014-12-23 19:08:13'),
