(6, 'Пилотный конкурс "Пейзаж"', '<h4>Положение конкурса "<strong>Пилотный конкурс "Пейзаж"</strong></h4><p>Цели и задачи конкурса:</p><p>- популяризация фотографии, в частности в г. Тюмени.</p><p>- стимулирование участия в работе фотоклуба постоянных членов клуба и фотолюбителей, изредка посещающих заседания клуба.</p><p>- <strong>обкатка работы сайта, в частности работы конкурсной части сайта, подготовка сайта к конкурсу FIAP.</strong></p><p>- популяризация сайта Тюменского дома фотографии, привлечение новых пользователей и их фоторабот на страницы нашего сайта.</p><p><strong>К участию в пилотном, закрытом конкурсе "Пейзаж"</strong>, проводимого фотоклубом "ФотоРегион", приглашаются &nbsp;члены клуба "ФотоРегион" и сочувствующие фотоклубному движению фотографы города Тюмени. Участие предусматривает только индивидуальное участие фотографа с подачей заявки и размещения фоторабот в электронном виде через сайт Тюменского дома фотографии: <a href="http://domfoto72.ru">http://domfoto72.ru</a> </p><p>К участию в конкурс допускаются только зарегистрированные пользователи сайта Тюменского дома фотографии, так что просим всех, кто еще не зарегистрировался пройти не сложную процедуру регистрации.&nbsp;</p><p>Фотоработы должны быть загружены с помощью системы самого сайта, инструкция участия в конкурсе находится в разделе "Статьи" сайта: "<a href="http://domfoto72.ru/ru/articles/uchastie-v-foto-konkursah-na-nashem-sayte-poryadok-i-instruktsiya">Участие в фото-конкурсах на нашем сайте. Порядок и инструкция.</a>"</p><p>Просьба загружать изображения (фотоработы) размером от 800 до 1200 точек по длинной стороне. Изображения не должны содержать рамок, логотипов и других впечатанных букв и символов.</p><p>Фотографии на конкурс принимаются не прошедшие серьезного изменения фоторедакторами. Без коллажей и монтажа. Допускается обработка, которая не меняет (не удаляет и не добавляет, не меняет форму и расположение) объектов на исходной фотографии. Допускается любое манипулирование с цветом, контрастом и яркостью. Не допускается внедрение в изображение источников или лучей света, которых не было в исходном кадре. Не допускаются к участию кадры не отвечающие теме "Пейзаж". Не допускаются кадры снятые третьими лицами, только авторские работы зарегистрированного пользователя.</p><p>Создано две номинации в конкурсе: "природный пейзаж" и "городской пейзаж", с допустимым числом единичных работ - до 3х включительно.</p><p>Работы на конкурс принимаются до 19.10.2014 года (не включая это число).</p><p>Результаты голосования жюри будет объявлено и доступно для просмотра через сайт 23.10.2014.</p><hr id="horizontalrule"><p>В жюри принимают участие:</p><p>председатель жюри - Игорь Ковалев</p><p>Николай Сульженко</p><p>Светлана Еремина</p><p>Виталий Нестеренко</p><p>Приз победителям конкурса - всеобщее уважение, и тортик. :)</p><p>Добро пожаловать!</p>', '2014-10-19', '2014-10-14 17:34:59', '2015-01-28 04:35:44', 1, 0, '2014-10-21', 'pilotnyy-konkurs-peyzazh', 10, '2014-10-12', '2014-10-20'),
(7, '1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP', '<p>\r\n	<a href="#engl"><strong>English terms</strong></a><strong>&nbsp;</strong></p><p>\r\n	<img src="/system/redactor_assets/pictures/22/FIAP-1-2014.jpg" style="width: 271px;"></p><p>\r\n	1.«Iй Международный Фотоконкурс» (далее Конкурс) является открытым конкурсом, в котором может принять любой профессиональный фотограф или фотограф любитель, из любой страны мира, оплативший взнос за участие и принимающий условия конкурса.</p><p>\r\n	1.1.Организатором конкурса является Тюменский дом фотографии.</p><p>\r\n	1.2.Организатор для реализации целей и задач Конкурса привлекает партнеров.</p><p>\r\n	2.Участники подтверждают собственное авторство присланных работ, а Организатор не несет ответственности за претензии третьих лиц.</p><p>\r\n	2.1. Организаторы оставляют за собой право использовать присланные работы для некоммерческого использования в рекламе конкурса.</p><p>\r\n	3.В Конкурсе 2014 года устанавливаются следующие номинации:</p><li>Свободная тема (черно-белая фотография); цифра (A)</li><li>Свободная тема (цветная фотография); цифра (B)</li><li>Мой любимый город. Виды городов. Приз им. К.Н. Высоцкого (черно-белая фотография); цифра (C)</li><li>Мой любимый город. Виды городов. Приз им. К.Н. Высоцкого (цветная фотография); цифра (D)</li><li>Классическая фотография на свободную тему. Приз им. Д. И. Менделеева (черно-белая фотография); бумага (F)</li>	3.1.Принимается не более 4х работ в каждую номинацию. Каждый участник может принимать участие во всех номинациях при условии оплаты взносов за все номинации.\r\n<p>\r\n	3.2.Запрещается представлять одинаковые работы в разные номинации</p><p>\r\n	3.3.Серии не принимаются.</p><p>\r\n	4.Присланные работы и их оформление должны соответствовать:</p><p>\r\n	4.1.требованиям FIAP: Черно-белые работы от очень темно-серого (черного) до очень светло-серого (белого) оттенка, представляют собой монохромные работы с различными оттенками серого. Черно-белые работы, тонированные полностью в один цвет, остаются монохромными работами и в состоянии участвовать в черно-белой категории.</p><p>\r\n	4.2. техническим требованиям оргкомитета:</p><p>\r\n	   обязательная регистрация участников на сайте \r\n	<a href="http://domfoto72.ru">http://domfoto72.ru</a> и заполнить Анкету.</p><li>публикация цифровых копий фотографии в раздел конкурса на указанном выше сайте.</li><li>Формат публикуемых файлов  JPG, качество 11 или 12;</li><li>ширина по большой стороне кадра: &nbsp;800 - 1000 пикселей;</li><li>черно-белые фотографии и цветные в RGB;</li><li>название файлов могут быть на любом языке, только латинскими буквами, в названии файла должно быть указано: код страны по ISO 3166 (Ru-Россия и т.д.), Имя автора и Описание на английском или русском языках, но только латинскими буквами, название работы на английском,  номинация, в общей сложности до 47 символов, пробелы заменять подчеркиванием. Например, для работы «Утро на реке» в  номинации «Свободная тема, цветная, цифра»: Ru_Ivan_Ivanov_Morning_on_the_river_B.jpg .</li><li>для бумажных работ: размер: минимальный 20 см х 30см, максимум 30см х 45см, если снимок наклеен на картон, общая толщина работы не должна превышать 1мм. Репродукцию карточки (скан или качественное фото) опубликовать на сайте по нормам цифровых изображений указанных выше.</li><li>В случае возникновения сложностей с загрузкой отправьте письмо по адресу support@domfoto72.ru&nbsp;с темой «проблема загрузки». Укажите ваше Имя и телефон для связи. (или по телефону +79829183344)</li><li>Правила публикации фоторабот на сайте можно найти по адресу: <a href="http://domfoto72.ru/ru/articles/uchastie-v-foto-konkursah-na-nashem-sayte-poryadok-i-instruktsiya">на русском</a> <a href="http://domfoto72.ru/ru/articles/the-instructions-for-fiap-contest-participation-managed-by-the-tyumen-house-of-photography">на английском</a></li>	5. Вступительный взнос является обязательным для всех участников и составляет:\r\n<p>\r\n	730 рублей за одну номинацию</p><p>\r\n	975 рублей за две номинации</p><p>\r\n	1465 рублей за три номинации</p><p>\r\n	1950 рублей за четыре номинации</p><p>\r\n	2190 рублей за пять номинаций</p><p>\r\n	5.1.для участников, присылающих работы на бумажном носителе дополнительно 400 рублей на почтовые расходы.</p><p>\r\n	5.2.Обратный адрес для отправки работы участник указывает в «Анкете участника».</p><p><strong>\r\n	5.3.Возможные варианты оплаты:</strong></p><li><strong>PayPal fotoexpo72@mail.ru</strong></li><li><strong>Денежный экспресс перевод через отделение Сбербанка «Колибри» или Почта России «Форсаж» Фирцеву Сергею Валерьевичу (получатель)</strong></li><li><strong>Экспресс перевод через систему «Золотая Корона» Фирцеву Сергею Валерьевичу (получатель)</strong></li><li><strong>Для оплаты в рублях MasterCard 5203 7378 0095 9794 № счета 40817810551004891199 Фирцев Сергей Валерьевич (получатель)</strong></li><li><strong>QIWI кошелек: +79044998755</strong></li><em>		Для сообщений кодов и данных отправителя сообщить в Оргкомитет</em>\r\n<p><em>\r\n	по телефону: +7 9044 99 87 55 или по e-mail&nbsp;fotoexpo72@mail.ru</em></p><p>\r\n	6.Награждение осуществляется по каждой из пяти номинаций. В каждой номинации присуждаются Золотая медаль FIAP. Итого 5 медалей. В каждой номинации жюри отмечает работы Специальными призами (в т.ч. денежными). Итого 10 Специальных призов (по 2 в каждой номинации). Кроме того, Генеральный партнер Конкурса наградит персонально одного или нескольких авторов собственными призами (в т.ч. денежными). Утвержден Специальный приз «Дебют» Для молодых фотографов (до 25 лет). Все награды имеют медали и дипломы.</p><p>\r\n	7.Состав жюри:</p><p>\r\n	Хаджи Миодраг Миладинович – АFIAP, Сербия, председатель</p><p>\r\n	Сергей Киселев – Россия, со-председатель</p><p>\r\n	Игорь Ковалев – Россия, со-председатель</p><p>\r\n	Анатолий Пашук – Россия, золотая медаль FIAP</p><p>\r\n	Николай Сульженко – Россия, золотая медаль FIAP</p><p>\r\n	Александр Романов – Россия, золотая медаль FIAP</p><p>\r\n	Валерий Дыба – Россия</p><p>\r\n	Сергей Шаповал – Россия</p><p>\r\n	8.&nbsp;\r\n	<strong style="background-color: initial;">Прием работ начинается 15 ноября и заканчивается 15 января 2015 года</strong>.&nbsp;</p><p>\r\n	Работа жюри до 25/01/2015</p><p>\r\n	Уведомление (открытие результатов) 01/02/2015</p><p>\r\n	Время экспонирование результирующей фотовыставки: с 5 февраля 2015 года.</p><p>\r\n	Председатель оргкомитета Сергей В. Фирцев</p><p>\r\n	P.S..&nbsp;</p><p>\r\n	Не забывайте в своем электронном письме следующую информацию:</p><p>\r\n	Фамилия:</p><p>\r\n	Имя:</p><p>\r\n	Дата рождения</p><p>\r\n	Звание FIAP:</p><p>\r\n	Обратный адрес&nbsp;(печатными буквами):</p><p>\r\n	Название фото-клуба (если таковые имеются):</p><p>\r\n	Телефон:</p><p>\r\n	Электронная почта:</p><p>\r\n	Категория № A B C D F название</p><p>\r\n	Пошлите эту информацию по электронной почте: fotoexpo72@mail .ru</p><p>\r\n	NB! Для Назначения «F» Посылают печатные издания и анкеты к:</p><p>\r\n	625003 РОССИИ,</p><p>\r\n	Тюмень,</p><p>\r\n	ул. Респпублики, 26 офисов 303&nbsp;«Академия фотографии»</p><p>\r\n	Пожалуйста, сообщите нам, через что был выполнен платеж за участие в конкурсе: PayPal, Карту, и т.д..</p><p>\r\n	Удачи, друзья!</p><p>\r\n	<a id="engl"></a></p><hr>\r\n<br>\r\n<br>\r\n<strong>1st International Photo Contest in <st1>Tyumen"Fixage''2014" (<st1><st1>Russia) FIAP</st1></st1></st1></strong>\r\n<p>\r\n	1. The First International Photo Contest in \r\n	<st1>Tyumen\r\n(\r\n	<st1><st1>Russia),\r\n(further referred to as the Contest) is open for any professional or amateur\r\nphotographer from all over the world who has paid the entry fee and accepted\r\nthe Contest’s provisions.\r\n	<br>\r\n1.1. The Contest is being organized by the Tyumen Photography House.\r\n	<br>\r\n1.2. To fulfill Contest’s goals the Organizer invites sponsoring parties.\r\n	</st1></st1></st1></p><p>\r\n	2. Participants of the Contest provide copyrights for their submissions.\r\nThe organizer is not liable for third parties claims.\r\n	<br>\r\n2.1. The Organizer has the right for non-commercial use of the submitted\r\nphotographs to promote the Contest.</p><p>\r\n	3. Sections of the Contest:\r\n	<br>\r\n• Free theme – black&white digital photography (A)\r\n	<br>\r\n• Free theme – color digital photography (B)\r\n	<br>\r\n• My favorite city. Views of the cities. Special prize in the name of\r\nK.N.Vysotsky – black&white digital photography (C)\r\n	<br>\r\n• My favorite city. Views of the cities. Special prize in the name of\r\nK.N.Vysotsky – color digital photography (D)\r\n	<br>\r\n• Free theme classic analog photography. Special prize in the name of\r\nD.I.Mendeleev. Prints (F)\r\n	<br>\r\n3.1. Participants can have only 4 submissions for a single section.\r\nParticipants can submit for any number of sections as long as they are paid\r\naccordingly.\r\n	<br>\r\n3.2. Participants can’t submit the same photographs for different sections.\r\n	<br>\r\n3.3 Series of photographs are not allowed.</p><p>\r\n	4. Submissions must meet the following requirements:\r\n	<br>\r\n4.1. FIAP guidelines: black&white photographs containing the whole range of\r\ngrey tones from dark (black) to light (white) are deemed to be monochromatic\r\nimages. Black&white photographs toned into one color are deemed to be\r\nmonochromatic images and thus eligible for black&white sections.</p><p>\r\n	4.2. Submission rules: \r\n	<br>\r\nAll entrants need to be signed up at the \r\n	<a href="http://domfoto72.ru/">http://domfoto72.ru</a> web site. The application form\r\nneeds to be fully filled at the web site.\r\n	<br>\r\n	<br>\r\nDigital photo requirements:\r\n	<br>\r\nFile format: JPEG (quality 11 or 12), \r\n	<br>\r\nImage size: not more or less than 800-1000\r\npixels on the longest side,\r\n	<br>\r\nColor space for black and white and color\r\nimages: RGB,\r\n	<br>\r\nFile names: \r\n	<br>\r\neach digital photo file must be named in\r\naccordance with the following system:\r\n	<br>\r\n- country code in ISO 3166 (for example “Ru”\r\nfor Russia), \r\n	<br>\r\n- next character : Underscore (“_”), \r\n	<br>\r\n- photographer’s name and family name in\r\nLatin, separated by underscore,\r\n	<br>\r\n- next character : Underscore (“_”), \r\n	<br>\r\n- photo title in English,\r\n	<br>\r\n- next character : Underscore (“_”), \r\n	<br>\r\n- category letter.\r\n	<br>\r\n	<br>\r\nThe total length of the file name shouldn’t\r\nexceed 47 characters.\r\n	<br>\r\n	<br>\r\nExample:\r\n	<br>\r\nRu_Ivan_Ivanov_Morning_on_the_river_B.jpg\r\n	<br>\r\n	<br>\r\nPrinted photo requirements:\r\n	<br>\r\nPhoto size: min 20x30cm, max 30x45cm, should\r\nthe photo be glued upon the cardboard, the total paper thickness shouldn’t\r\nexceed 1mm.\r\n	<br>\r\nThe digital copy of the printed photo should\r\nbe published on the web site in accordance with the digital photo requirements\r\ndescribed above.</p><p>\r\n	<a href="http://domfoto72.ru/ru/articles/the-instructions-for-fiap-contest-participation-managed-by-the-tyumen-house-of-photography">Submission guidelines</a><br>\r\n	<br>\r\nIn case of any difficulties with the upload\r\nplease feel free to contact us at: support@domfoto72.ru with the subject\r\n«uploading error».</p><p>\r\n	<br>\r\n5. Entrance fee is mandatory for every participant as follows:\r\n	<br>\r\n• 1 section – 15 euro;\r\n	<br>\r\n• 2 sections – 20 euro;\r\n	<br>\r\n• 3 sections – 30 euro;\r\n	<br>\r\n• 4 sections – 40 euro;\r\n	<br>\r\n• 5 sections – 45 euro.\r\n	<br>\r\n5.1. For participants submitting prints additional 8 euro fee is required for\r\nmailing.\r\n	<br>\r\n5.2. The return mailing address can be noted in the entry form.\r\n	<br><strong><em>\r\n5.3. Payments can be made as follows:\r\n	<br>\r\n• PayPal fotoexpo72@mail.ru;\r\n	<br>\r\n• QIWI Visa wallet: +79044998755;\r\n	<br>\r\nWire transfer (account info will be provided by e-mail with Entry form);</em></strong></p><p><em>Please inform the organizing committe on the payment details via telephone +7 9044 99 87 55 or email fotoexpo72@mail.ru</em></p><p>\r\n	6. Every section has an award of golden FIAP medal, total 5 medals.\r\nThe jury will award a participant with a Special Prize in every section,\r\ntotal 10 Special Prize (including financial)& medals. Out of this General\r\nPartner will award one (or couple) author(s) by own brand Award&medal and\r\ntwo more «Debut» Awards&medals for young photographer (under 18 year, and\r\nunder 25 years old)\r\n	<br>\r\n7. Judging\r\n	<br>\r\nHadzi Miodrag Miladinovich – АFIAP, \r\n	<st1>Serbia,\r\nchairman\r\n	<br>\r\nSergey Kiselyov – \r\n	<st1>Russia,\r\nco-chairman\r\n	<br>\r\nIgor Kovalyov – \r\n	<st1>Russia,\r\nco-chairman\r\n	<br>\r\nAnatoliy Pashuk – \r\n	<st1>Russia<br>\r\nNikolay Sulzhenko – \r\n	<st1>Russia<br>\r\nAleksandr Romanov – Russia\r\n	<br>\r\nValery Dyba – \r\n	<st1>Russia<br>\r\nSergey Shapoval – \r\n	<st1><st1>Russia</st1></st1></st1></st1></st1></st1></st1></st1></p><p><st1><st1><st1><st1><st1><st1><st1><st1><br>\r\n8. Registration and submissions are accepted from&nbsp;\r\n	</st1></st1></st1></st1></st1></st1></st1></st1>november 15, 2014&nbsp;until&nbsp;january 15, 2015</p><p>\r\n	Judging deadline:&nbsp;january&nbsp;25, 2015&nbsp;</p><p>\r\nNotification:&nbsp;Feb&nbsp;01, 2015&nbsp;</p><p>\r\nExhibition date(s) Feb 05, 2015</p><p>\r\n	Chairman of Organizing Committee Sergey V. Firtsev</p><p>\r\n	p.s. Don''t forget in your e-mail the following info</p><p>\r\n	Family Name:\r\n	<br>\r\nFirst Name:\r\n	<br>\r\nDate of birth\r\n	<br>\r\nFIAP honor:\r\n	<br>\r\nReturn address\r\n	<br>\r\n(in block letters):\r\n	<br>\r\nPhoto club name (if any):\r\n	<br>\r\nPhone:\r\n	<br>\r\nE-mail:\r\n	<br>\r\nCategory № A B C D F Title</p><p>\r\n	Send this info by e-mail: fotoexpo72@mail.ru</p><p>\r\n	NB! For Section «F» Send prints and application forms to:</p><p>\r\n	625003 \r\n	<st1>RUSSIA,<br>\r\n	<st1><st1>Tyumen,<br>\r\n	<st1><st1>Respubliki Street,\r\n26 offices 303\r\n	<br>\r\n«Academy of photography»\r\n	</st1></st1></st1></st1></st1></p><p>\r\n	Please inform us that payment of entry fees is made through PayPal,\r\nCard, ect.</p><p>\r\n	Good Luck, Friends!</p>', '2015-01-15', '2014-10-22 17:29:35', '2015-03-27 14:49:41', 1, 1, '2015-02-01', 'iy-mezhdunarodnyy-fotokonkurs-tyumen-2014', 10, '2014-11-15', '2015-01-27'),
(10, 'Березовая зарубка.', '<p>Фотографы и любители фотографии Тюмени, России и Мира. Благодаря Саше Тарасову в голове Александра Зесекина родилась идея "Берёзовой бойни". Главной её темой должна стать берёза, всё остальное (жанры, способы съёмки, обработка) на полнейшее усмотрение авторов.  Собственно клуб ФОтоРегион инициирует данное начинение как фотоконкурс.  Правила простые.  Конкурс открытый, количество фотографий наверное ограничим до 10. даты указаны в параметрах конкурса. Надо понять кто будет жюрить и что будет в результате. Но это мы чуть позже определим.</p>', '2016-06-01', '2015-03-19 06:58:39', '2016-06-02 10:09:33', 0, 0, '2016-06-02', 'berezovaya-zarubka', 10, '2015-03-18', '2016-06-02'),
(11, 'Color.  Bodø Photoclub. Norway.', '<p>Выбрать 3 лучшие фотографии путем обычного голосования.</p>', '2015-06-01', '2015-05-31 04:27:55', '2015-06-04 18:38:48', 1, 0, '2015-06-05', 'arctic-island', 10, '2015-05-31', '2015-06-04'),
(12, 'ФотоФиниш № 50 и 1/3.', '<h2>Временные правила блиц-конкурса фотографии «ФотоФиниш».</h2> <p><strong>1.Общие положения</strong>.</p> <p>Настоящие правила используются в переходный период. </p><p>Блиц-конкурс «ФотоФиниш» инициирован и проводится тюменским фотоклубом «ФотоРегион» (далее фотоклуб). Курируется настоящий проект председателем правления и инициативной группой худсовета фотокуба.</p><p>ФотоФиниш – это конкурс фотографов, поэтому каждый выступает индивидуально и только от своего лица. Заочное и удалённое исполнение конкурсного задания не допускается.</p><p>ФотоФиниш – это конкурс фотографии с ограничением по тематике, времени съёмки и количеству фотографий. Все эти ограничения жестко регламентируются в настоящих правилах.</p><p>Фотоклуб, проводя блиц-конкурс «ФотоФиниш» преследует следующие цели: </p><p>- Организация активного интеллектуального отдыха; </p><p>- Увеличение интереса к фотографии; </p><p>- Развитие творческих способностей участников; </p><p>- Популяризация и развитие нового вида творческих соревнований; </p><p>- Обмен опытом между участниками. </p><p><strong>2.Участие в блиц-конкурсе «ФотоФиниш».</strong></p><p>Участие в блиц-конкурсе ФотоФиниш -  бесплатное. </p><p>К участью в конкурсе допускается любой желающий фотограф любого возраста и пола, на добровольной основе, независимо от его мастерства. Обязательным условием участия является наличие интереса к фотоделу и наличие фотокамеры.</p><p>Участник ФотоФиниша обязан надлежащим образом зарегистрироваться, после чего он допускается к участию в конкурсе. Для этого участник должен зарегистрироваться на сайте <a href="http://domfoto72.ru/">http://domfoto72.ru/</a> (далее сайт) до 15:00 27 марта (желательно сделать это не позже 26 марта), и подать заявку на участие в фотоконкурсе, согласно <a href="http://domfoto72.ru/ru/articles/instruktsiya-po-registratsii-i-uchastiyu-v-blits-konkurse-fotofinish" target="_blank">инструкции по регистрации</a> .</p><p>Участие возможно с любыми моделями фотоаппаратов (цифровыми и аналоговыми). Наличие фотокамеры - обязательно.</p><p>Все расходы, связанные с участием в ФотоФинише несут участники соревнования.</p><p>Организаторы оставляют за собой право не допустить до соревнований (снять с конкурса) любую кандидатуру по следующим причинам: </p><p>- нетрезвое состояние; </p><p>- нарушение правил проведения соревнований; </p><p>- неуважительное отношение к организаторам, спонсорам, другим участникам; </p><p>- другие причины. </p><p><strong>3.Условия и общие правила блиц-конкурса «ФотоФиниш»</strong></p><p>На старте, 27 марта в 10 часов утра в ТЦ "Галерея - Вояж", после регистрации, каждый участник получает задание. Ответственность за получение задания возлагается на самого участника.</p><p>Использование заготовок и кадров сделанных ранее категорически запрещено.</p><p>Порядок и способ выполнения задания, а равно и маршрут передвижения участника свободные и организаторами не регламентируется.</p><p>Количество сделанных кадров не регламентируется. Количество фотографий, выставляемых на конкурс: от 1 до 3х. Фотографии одиночные и не должны составлять серию. Размер отпечатков, предоставляемых участником на финише - не менее 20х30 см. Печать допускается любым способом.</p><p>Допускается обработка фотографий только следующего характера: цветокоррекция (с доведением цветности близкой к естественной), усиление или понижение контраста изображения, Увеличение или уменьшение резкости изображения. Изменение яркости изображения. Перевод цветного изображения в монохром. Кадрирование, но не более 30% от исходного. Остальные манипуляции запрещены. Организаторы вправе потребовать исходные изображения для контроля наличия обработки представленного на конкурс отпечатка.</p><p>Участник должен выполнить условия, указанные в задании, и прийти на финиш, уложившись в контрольное время.</p><p>На финише участник должен предоставить отпечатанные кадры исполненных заданий (размер отпечатка не менее 20х30 см).</p><p>Тема задания заранее не известна Участнику и определяется только на старте.</p><p>На финише участникам отводится 30 минутный интервал времени для выставления своих работ. Работы участников не уложившихся в данный интервал времени в конкурсе не участвуют.</p><p>Сразу после 30 минутного интервала, отведенного на размещение фоторабот участникам, начинается устное обсуждение каждой работы. Устное обсуждение предполагает критику фотографий, разбор недостатков и достоинств конкретной работы. Обсуждение проводится коллективно. Курирует обсуждение представитель худсовета фотоклуба. При обсуждении работ автор остаётся не известным. При обсуждении фотографий участники должны использовать конструктивную критику и воздерживаться от общих фраз.</p><p>После завершения экспозиции, каждый автор самостоятельно снимает свои работы. И не допускает остатков мусора или других следов крепления экспозиции.</p><p>До 28 марта (включительно) участники обязуются разместить электронные версии своих конкурсных фоторабот на указанный выше сайт в раздел конкурса фотофиниша (инструкция на сайте), а так же проголосовать за все фотоработы других участников (29 марта). 30 марта на сайте будут опубликованы результаты голосования.</p><p>У каждой работы, участвовавшей в блиц-конкурсе ФотоФиниш, в результате голосования на сайте будет две итоговых оценки - 1) оценка народного голосования (средняя оценка участников) ;  2) оценка худсовета фотоклуба. Места будут определяться следующим образом: Первое место будет определено по максимальной оценке худсовета Клуба, второе и третье место определяется максимальными оценками участников фотофиниша.</p><p>Контактные данные организаторов конкурса: Телефон: +7 9222 615141  E-mail:  <a href="mailto:support@domfoto72.ru">support@domfoto72.ru</a></p><p><strong>Читайте: </strong><a href="http://domfoto72.ru/ru/articles/instruktsiya-po-registratsii-i-uchastiyu-v-blits-konkurse-fotofinish"><strong>Инструкция по регистрации на сайте и регистрации на конкурсе ФотоФиниш</strong></a></p>', '2016-03-29', '2016-03-20 18:54:27', '2016-03-30 04:37:00', 1, 2, '2016-03-30', 'fotofinish-50-i-1-4', 10, '2016-03-20', '2016-03-30'),
(13, 'ФотоФиниш № 51 х3', '<h2>Правила блиц-конкурса фотографии «ФотоФиниш» 51 х3.</h2><p><strong>1.Общие положения</strong>.</p><p>Настоящие правила регламентируют участие в блиц-конкурсе фотографии "ФотоФиниш 51 х3", проводимый одновременно в трёх городах: Тюмень, Курган и Тобольск.</p><p>Блиц-конкурс «ФотоФиниш» инициирован и проводится тюменским фотоклубом «ФотоРегион» (далее фотоклуб). Курируется настоящий проект председателем правления и инициативной группой худсовета фотокуба.</p><p>ФотоФиниш – это конкурс фотографов, поэтому каждый выступает индивидуально и только от своего лица. Заочное и удалённое исполнение конкурсного задания не допускается.</p><p>ФотоФиниш – это конкурс фотографии с ограничением по тематике, времени съёмки и количеству фотографий. Все эти ограничения жестко регламентируются в настоящих правилах.</p><p>Фотоклуб, проводя блиц-конкурс «ФотоФиниш» преследует следующие цели:</p><p>- Организация активного интеллектуального отдыха;</p><p>- Увеличение интереса к фотографии;</p><p>- Развитие творческих способностей участников;</p><p>- Популяризация и развитие нового вида творческих соревнований;</p><p>- Обмен опытом между участниками.</p><p><strong>2.Участие в блиц-конкурсе «ФотоФиниш».</strong></p><p>Участие в блиц-конкурсе ФотоФиниш - бесплатное.</p><p>К участью в конкурсе допускается любой желающий фотограф любого возраста и пола, на добровольной основе, независимо от его мастерства. Обязательным условием участия является наличие интереса к фотоделу и наличие фотокамеры.</p><p>Участник ФотоФиниша обязан надлежащим образом зарегистрироваться, после чего он допускается к участию в конкурсе. Для этого участник должен зарегистрироваться на сайте <a href="http://domfoto72.ru/">http://domfoto72.ru/</a> (далее сайт) до 15:00 28 октября, и подать заявку на участие в фотоконкурсе, согласно <a href="http://domfoto72.ru/ru/articles/instruktsiya-po-registratsii-i-uchastiyu-v-blits-konkurse-fotofinish" target="_blank">инструкции по регистрации</a> .</p><p>Участие возможно с любыми моделями фотоаппаратов (цифровыми и аналоговыми). Наличие фотокамеры - обязательно.</p><p>Все расходы, связанные с участием в ФотоФинише несут участники соревнования.</p><p>Организаторы оставляют за собой право не допустить до соревнований (снять с конкурса) любую кандидатуру по следующим причинам:</p><p>- нетрезвое состояние;</p><p>- нарушение правил проведения соревнований;</p><p>- неуважительное отношение к организаторам, спонсорам, другим участникам;</p><p>- другие причины.</p><p><strong>3.Условия и общие правила блиц-конкурса «ФотоФиниш»</strong></p><p>На старте, 29 октября в 10 часов утра, после регистрации, каждый участник получает задание. Ответственность за получение задания возлагается на самого участника. Старт в каждом из городов проведения конкурса проходит одновременно, с указанных в настоящем Положении месте.</p><p>Места старта по городам:</p><p>Тюмень: от ТРЦ "Галерея Вояж", возле выхода на ул. Герцена.<br>Курган:   от Областного культурно-выставочного центра (ул. Гоголя, 30).<br>Тобольск: ТРЦ "Жемчужина Сибири" у фонтана (7-й микрорайон, 30)</p><p>Использование заготовок и кадров сделанных ранее категорически запрещено.</p><p>Порядок и способ выполнения задания, а равно и маршрут передвижения участника свободные и организаторами не регламентируется.</p><p>Количество сделанных кадров не регламентируется. Количество фотографий, выставляемых на конкурс: от 1 до 3х. Фотографии одиночные и не должны составлять серию. Размер отпечатков, предоставляемых участником на финише - не менее 20х30 см. Печать допускается любым способом.</p><p>Допускается обработка фотографий только следующего характера: цветокоррекция (с доведением цветности близкой к естественной), усиление или понижение контраста изображения, Увеличение или уменьшение резкости изображения. Изменение яркости изображения. Перевод цветного изображения в монохром. Кадрирование, но не более 30% от исходного. Остальные манипуляции запрещены. Организаторы вправе потребовать исходные изображения для контроля наличия обработки представленного на конкурс отпечатка.</p><p>Участник должен выполнить условия, указанные в задании, и прийти на финиш, уложившись в контрольное время.</p><p>На финише участник должен предоставить отпечатанные кадры исполненных заданий (размер отпечатка не менее 20х30 см).</p><p>Тема задания заранее не известна Участнику и определяется только на старте. Сообщается организатором в каждом из городов.</p><p>На финише участникам отводится 30 минутный интервал времени для выставления своих работ. Работы участников не уложившихся в данный интервал времени в конкурсе не участвуют.</p><p>Сразу после 30 минутного интервала, отведенного на размещение фоторабот участникам, начинается устное обсуждение каждой работы. Устное обсуждение предполагает критику фотографий, разбор недостатков и достоинств конкретной работы. Обсуждение проводится коллективно. Курирует обсуждение представитель фотоклуба. При обсуждении работ автор остаётся не известным. При обсуждении фотографий участники должны использовать конструктивную критику и воздерживаться от общих фраз.</p><p>После завершения экспозиции, каждый автор самостоятельно снимает свои работы. И не допускает остатков мусора или других следов крепления экспозиции.</p><p>До 30 октября (включительно) участники обязуются разместить электронные версии своих конкурсных фоторабот на указанный выше сайт в раздел конкурса фотофиниша (инструкция на сайте), а так же проголосовать за все фотоработы других участников (31 октября). 1 ноября на сайте будут опубликованы результаты голосования.</p><p>У каждой работы, участвовавшей в блиц-конкурсе ФотоФиниш, в результате голосования на сайте будет две итоговых оценки - 1) оценка народного голосования (средняя оценка участников) ; 2) оценка худсовета фотоклуба. Места будут определяться следующим образом: Первое место будет определено по максимальной оценке худсовета Клуба, второе и третье место определяется максимальными оценками участников фотофиниша.</p><p>Контактные данные организаторов конкурса: </p><p>Тюмень: Александр Тарасов  <u>+79129919602</u></p><p>Тобольск: Александр Рябцев  <u>+79058251698</u></p><p>Курган: Александр Алпаткин  <u>+79128391837</u></p><p>Куратор проекта: Николай Сульженко  +79044912880 </p><p><strong>Читайте: </strong><a href="http://domfoto72.ru/ru/articles/instruktsiya-po-registratsii-i-uchastiyu-v-blits-konkurse-fotofinish"><strong>Инструкция по регистрации на сайте и регистрации на конкурсе ФотоФиниш</strong></a></p>', '2016-10-30', '2016-10-23 21:06:23', '2016-10-31 19:33:13', 1, 2, '2016-10-31', 'fotofinish-51-h3', 10, '2016-10-24', '2016-10-31');
