INSERT INTO `documents` (`id`, `title`, `content`, `status`, `created_at`, `updated_at`, `creation_date`) VALUES
(1, 'Устав  фотоклуба «ФотоРегион»,  г. Тюмень.', '<p>1.\r\nЗАДАЧИ ФОТОКЛУБА</p><p><br>1.1.\r\nКлуб объединяет любителей фотоискусства.<br>1.2.\r\nКлуб создан для повышения художественного\r\nуровня, творческого мастерства членов\r\nклуба и пропаганды фотографии как вида\r\nизобразительного искусства.<br><br>2.\r\nДЕЯТЕЛЬНОСТЬ ФОТОКЛУБА<br>2.1.\r\nДля проведения в жизнь Задач\r\nфото-клуб:<br>а)\r\nорганизует лекции, доклады по теории и\r\nистории фотографии и других видов\r\nискусств;<br>б)\r\nорганизует творческие встречи с мастерами\r\nфотографии и других видов искусств;<br>в)\r\nпроводит консультации по теории и\r\nпрактике фотографии;<br>г)\r\nорганизует фотовыставки и фотоконкурсы;<br>д)\r\nорганизует обмен фотовыставками с\r\nдругими фото-клубами;<br>е)\r\nучаствует в городских, областных,\r\nвсероссийских и международных\r\nвыставках;<br>ж)\r\nподдерживает работу сайта <a href="http://www.photoregion.ru/">http://domfoto72.ru</a>в\r\nИнтернете.</p><p>з)\r\nв качестве постоянного партнера\r\nподдерживает мероприятия Тюменского\r\nдома фотографии.</p><p>2.2.\r\nОснова деятельности клуба составляется\r\nиз:</p><p>а)\r\nэнтузиазма участников клуба, с их\r\nфото-работами, личным временем, умениями\r\nи возможностями, которые они посчитают\r\nвозможным использовать в деятельности\r\nклуба.</p><p>б)\r\nвозможностей привлеченных на безвозмездной\r\nили платной основе третьих лиц.</p><p>в)\r\nразовых или цикличных денежных взносов\r\nучастников клуба, согласно Положению\r\nо взносах.</p><p>г)\r\nдобровольных пожертвований.</p><p>д)\r\nпрочие источники, не противоречащие\r\nЗакону РФ и настоящему Уставу.<br><br>3.\r\nПРИЁМ В ЧЛЕНЫ КЛУБА<br>3.1.\r\nКандидатом\r\nв\r\nчлены клуба принимаются лица, достигшие\r\n16-ти летнего возраста, владеющие\r\nфотографической техникой, желающие\r\nсовершенствоваться в области фотоискусства\r\nи активно участвовать в работе клуба.\r\nУсловиями, для принятия желающего в\r\nкандидаты, являются: присутствие минимум\r\nна трёх собраниях фотоклуба, рекомендация\r\nодного из членов фотоклуба, устная\r\nзаявка на желание вступить в фотоклуб,\r\nозвученная лично на общем собрании\r\nфотоклуба, простое большинство голосов\r\n «ЗА» на общем собрании клуба. После\r\nрешения о приёме кандидат обязан\r\nзарегистрироваться на сайте\r\n<a href="http://www.photoregion.ru/">http://domfoto72.ru</a>\r\nи полностью заполнить анкету персональных\r\nданных. Кандидатский стаж - 6 месяцев.</p><p>3.2.\r\nРешение о переводе из кандидатов в\r\nдействительный члены фотоклуба принимает\r\nправление фотоклуба, на основании\r\nактивного участия кандидата в делах\r\nфотоклуба и положительного решения\r\nхудсовета. Вступающий обязан представить\r\nне менее 10-ти фото-работ, выполненных\r\nна высоком художественном и техническом\r\nуровне. При положительной оценке\r\nрассмотренных работ художественный\r\nсовет вносит предложение в правление\r\nо его приёме кандидата в члены клуба.\r\nПрисутствие вступающего в члены клуба\r\nобязательно на рассмотрении работ\r\nхудсоветом. </p><p>3.3.\r\nВ члены клуба может быть принят так же\r\nжелающий не являющимся фотографом, но\r\nлюбящий фотографию, как искусство. В\r\nтаком случае решение о его принятии в\r\nкандидаты формируется по его вкладу в\r\nфотодвижение, а так же после подготовки\r\nи проведения им двухчасовой лекции на\r\nтему связанную с фотографией.  Решение\r\nо приеме в кандидаты фотоклуба — на\r\nобщих основаниях (п. 3.1), решение по\r\nпереводу из кандидатов в члены фотоклуба\r\nвыносит общее собрание по представлению\r\nправления клуба.</p><p>3.4.\r\nВ исключительных случаях, по представлению\r\nхудожественного совета или правления\r\nклуба, общее собрание может принять\r\nкандидата в члены клуба без кандидатского\r\nстажа.</p><p>3.5.\r\nПринятый в клуб уплачивает вступительный\r\nвзнос, размер которого определяется на\r\nкаждый год общим собранием.<br>3.6. Принятому\r\nв клуб вручается членский билет клуба,\r\nпосле выплаты им вступительного\r\nвзноса.<br><br>4.\r\nОБЯЗАННОСТИ ЧЛЕНОВ И КАНДИДАТОВ В ЧЛЕНЫ\r\nКЛУБА<br>4.1.\r\nПовышать свой художественный уровень,\r\nсовершенствовать фотографическое\r\nмастерство, стремиться своими работами\r\nсодействовать выполнению творческих\r\nзадач фотоклуба.</p><p>4.2.\r\nПринимать участие в работе и жизни\r\nфотоклуба, содействовать его целям и\r\nзадачам.<br>4.2.\r\nАккуратно уплачивать членские взносы.\r\nКандидаты в члены клуба от членских\r\nвзносов освобождаются.<br><br>5.\r\nПРАВА ЧЛЕНОВ, ПОЧЁТНЫХ ЧЛЕНОВ И КАНДИДАТОВ\r\nВ ЧЛЕНЫ КЛУБА<br>5.1.\r\nИмеют право решающего голоса на собраниях\r\nчленов клуба. Кандидаты в члены клуба\r\nимеют право совещательного голоса.<br>5.2.\r\nИзбирать и быть избранными (кроме\r\nкандидатов в члены клуба) в состав\r\nправления и художественного совета\r\nклуба.<br>5.3.\r\nУчаствовать во всех мероприятиях\r\nфотоклуба.<br>5.4.\r\nВыступать с творческими отчётами и\r\nперсональными выставками.<br>5.5.\r\nЛица, активно помогающие клубу в его\r\nработе и имеющие заслуги в развитии\r\nфотографии, могут быть приняты, в почётные\r\nчлены клуба. Почётные члены клуба от\r\nуплаты членских взносов освобождаются.<br><br>6.\r\nИСКЛЮЧЕНИЕ ИЗ КЛУБА<br>6.1.\r\nЧлен клуба может быть исключен за\r\nневыполнение настоящего устава, за\r\nотсутствие активности в работе фотоклуба,\r\nнеуплату членских взносов, а также за\r\nпоступки и поведение, порочащие звание\r\nчлена клуба.<br>6.2.\r\nВопрос об исключении решает общее\r\nсобрание клуба по представлению\r\nправления.</p><p>6.3.\r\nЧлен клуба может быть исключен по\r\nсобственному желанию, заявив об этом\r\nперед собранием фотоклуба.</p><p>7.\r\nОБЩЕЕ СОБРАНИЕ<br>Высшим\r\nорганом фото-клуба является общее\r\nсобрание, которое:<br>7.1.\r\nСозывается не реже одного раза в год.<br>7.2.\r\nПравомочно при наличии не менее половины\r\nчленов клуба.<br>7.3.\r\nДля проведения повседневного\r\nорганизационного, художественного и\r\nметодического руководства работой\r\nклуба избирает открытым голосованием\r\nпо большинству голосов правление и\r\nхудожественный совет клуба со сроком\r\nполномочий на 3 года.<br>7.4.\r\nЗаслушивает и утверждает отчёты\r\nправления.<br>7.5.\r\nУстанавливает размер вступительных,\r\nразовых и циклических членских\r\nвзносов.<br>7.6.\r\nС целью улучшения работы клуба может\r\nизменять и дополнять отдельные пункты\r\nустава.</p><p>7.7.\r\nВыбирает из числа правления — председателя.</p><p>7.8.\r\nВыбирает из числа членов клуба\r\nхудожественный совет клуба.<br><br>8.\r\nПРАВЛЕНИЕ ФОТОКЛУБА<br>8.1.\r\nПравление состоит из трех участников\r\nфотоклуба, выбранных общим собранием.<br>8.2.\r\nРазрабатывает месячные планы работы\r\nклуба.<br>8.3.\r\nОрганизует методическую, учебную,\r\nтворческую и массовую работу.<br>8.4.\r\nРасходует финансовые средства клуба.\r\nИ отчитывается перед общим собранием\r\nза финансовые операции не реже одного\r\nраза в год, а так же по первому требованию\r\nобщего собрания.<br>8.5.\r\nОрганизует внутриклубные выставки и\r\nконкурсы, а также общеклубные отчётные\r\nвыставки, открытые для общего показа.<br>8.7.\r\nВедёт переписку по обмену опытом с\r\nфото-клубами и фотолюбителями.<br>8.8.\r\nПроводит свои заседания.<br>8.9.\r\nСозывает общее очередные и внеочередные\r\nсобрание членов клуба.<br>8.10.\r\nНа общем собрании представляет на\r\nголосование вывод из своего состава\r\nотдельных членов правления.</p><p>8.11.\r\nПринимает решение о переводе из кандидатов\r\nв действительные члены фотоклуба, а так\r\nже представляет на решение общего\r\nсобрания кандидатов на досрочное\r\nвключение в действительные члены\r\nфотоклуба, а так же кандидатов из числа\r\nдействительных члкнов клуба в почетные\r\nчлены клуба.</p><p>9.\r\nПРЕДСЕДАТЕЛЬ ПРАВЛЕНИЯ ФОТОКЛУБА</p><p>9.1.\r\nПредставляет интересы клуба перед\r\nтретьими лицами и организациями, либо\r\nпередоверяет это одному из членов\r\nправления.</p><p>9.2.\r\n Распределяет\r\nобязанности среди членов правления.</p><p>9.3.\r\nРазрабатывает стратегическое планирование\r\nдеятельности клуба и правления.</p><p>9.4.\r\nВ периоды между общими собраниями\r\nутверждает вопросы привлечения и\r\nрасходования ресурсов, требующих\r\nсрочного решения.</p><p>9.5.\r\nОтчитывается на очередных или внеочередных\r\nобщих собраниях о деятельности правления\r\nи своих решениях.</p><p>9.6.\r\nМожет досрочно сложить с себя полномочия\r\nизвестив об этом общему собранию не\r\nменее чем за две недели до ухода,\r\nсвоевременно передав все дела и контакты\r\nдоверенному члену правления.</p><p>10.\r\nХУДОЖЕСТВЕННЫЙ СОВЕТ КЛУБА</p><p>10.1.\r\nСостоит из пяти членов фотоклуба,\r\nвыбранных общим собранием, до перевыборов\r\n(бессрочно).</p><p>10.2.\r\nНесет ответственность за творческую\r\nчасть деятельности и фото-клуба.<br>10.3.\r\nПроизводит отбор работ членов и кандидатов\r\nв члены фото-клуба для участия в выставках,\r\nконкурсах, творческих обменах и т.п.<br>10.4.\r\nПроизводит оценку и решает о принятии\r\nпретендентов в кандидаты членов клуба,\r\nсоглавно настоящего Устава.<br>10.5.\r\nФормирует жюри.<br>10.6.\r\nОпределяет тематику конкурсов, выставок\r\nи других мероприятий на год.<br><br>11.\r\nКЛУБ НЕ УЧАСТВУЕТ В МЕРОПРИЯТИЯХ\r\nПОЛИТИЧЕСКОГО, РЕЛИГИОЗНОГО, ЭКСТРЕМИСТСКОГО\r\nХАРАКТЕРА.</p>', 4, '2015-04-24 11:46:35', '2015-05-18 07:24:08', '2015-04-11'),
(2, 'Положение о взносах членов клуба «ФотоРегион»', '<p>1.\r\nНастоящим положением регламентируется\r\nпорядок сбора взносов членов клуба\r\nФотоРегион (далее Клуб). По решению\r\nобщего собрания Клуба, принято, что\r\nвзносы обязательны для всех членов\r\nклуба, неуплата взносов является поводом\r\nдля исключения из состава Клуба.</p><p>2.\r\nВиды взносов, их очередность, сроки и\r\nих размер.</p><p>2.1.\r\nВступительный взнос вносится единоразово\r\nчленом Клуба в течении одного месяца\r\nпосле вступления в Клуб. Размервступительного\r\nвзноса устанавливается в размере 150\r\nруб.</p><p>2.3.\r\nЕжегодный взнос члена клуба собирается\r\nв период с 15 января по 15 апреля каждого\r\nгода авансовым платежом. Сумма ежегодного\r\nвзноса устанавливается в размере 500\r\nруб. При вступлении в члены клуба после\r\n15 апреля член Клуба вносит годовой взнос\r\nсовместно с вступительным, при этом\r\nсумма годового взноса корректируется,\r\nуменьшаясь на 50 руб от бощей суммы\r\nгодового взноса умноженное на количество\r\nмесяцев, прошедших с апреля.</p><p>2.4.\r\nЕдиноразовые, целевые взносы. Данный\r\nвид взносов назначается общим собранием,\r\nдля финансирования целевых программ и\r\nпокупок, необходимых Клубу. Сумма и срок\r\nоплаты, обязательность внесения, так\r\nже определяется общим собранием.</p><p>3.\r\nОсвобождение от членских взносов.</p><p>3.1.\r\nОт всех видов взносов освобождаются\r\nпочетные члены Клуба.</p><p>3.2.\r\nПо просьбе члена клуба, и наличии у него\r\nуважительных причин, общее собрание\r\nКлуба может освободить его от взносов\r\nвременно или постоянно.</p><p>4.\r\nДобровольные пожертвования.</p><p>4.1.\r\nКлуб принимает добровольные пожертвования\r\nот любых членов Клуба или третьих лиц\r\nи организаций.</p><p>5.\r\nПрием членских взносов осуществляет\r\nказначей Клуба, назначенный Председателем\r\nиз числа правления клуба. На казначея\r\nвозлагаются обязанности сбора и хранения,\r\nа так же целевого расходования собранных\r\nсредств исходя из решений общего собрания\r\nи правления Клуба.</p>', 2, '2015-04-24 11:50:05', '2015-04-24 11:50:05', '2015-04-11'),
(3, '​Положение о проведении клубных фотовыставок фотоклуба «ФотоРегион».', '<p>1. Клубными фотовыставками являются выставки фотографий, организуемые клубом «ФотоРегион», в которых участвуют два или более фотографа, входящих в клуб.</p><p>2. Инициировать организацию клубной фотовыставки может любой член клуба, предложив это на собрании клуба.</p><p>3.Обязательные условия проведения клубной фотовыставки: </p><p><em>- Наличие собственно инициации выставки;</em></p><p><em>- Решение общего собрания или правления фотоклуба;</em></p><p><em>- Добровольное решение одного из членов худсовета на курирование фотовыставки;</em></p><p><em>- Добровольное решение одного из членов фотоклуба на помощь в организации фотовыставки;</em></p><p><em>- Наличие площадки для реализации выставки с необходимыми критериями для конкретной фотовыставки;</em></p><p><em>- Наличие достаточного временного ресурса для реализации выставки.</em></p><p>4. Куратор и его помощник, а так же каждый автор, пожелавший участвовать в устроении клубной фотовыставки, берут на себя ответственность по организации выставки, вплоть до её деинсталляции. Обязуются выполнить все этапы организации выставки: разработка концепции выставки, отбор работ, персонализация и подготовка к печати, печать, сбор работ и их установка в рамы, развеска рам в выделенное выставочное пространство, деинсталляция работ. </p><p>5. Правление клуба берет на себя функции в отношении клубных выставок: – поиск и договор с выставочными площадками, общую координацию и связь с участниками фотовыставки, освещение этапов выставки на интернет-ресурсах клуба, приглашение СМИ и прочих, необходимых для проведения выставки, специалистов, привлечение худсовета (при необходимости), привлечение дополнительных ресурсов и резервов (при их наличии и доступности), оповещение членов клуба об этапах выставки, решение административных вопросов, и работа с государственными структурами (по необходимости). Приглашение членов клуба и прочих сочувствующих фотографии зрителей на открытие фотовыставки, помощь куратору в разработке логистики. Правление клуба не несет ответственности за срыв фотовыставки или за не надлежащее представление фотовыставки, поскольку выполняет лишь вспомогательную роль в организации. Правление клуба вправе прекратить формирование фотовыставки на любом этапе, если продолжение грозит дискредитацией отдельных членов клуба или всего клуба в целом, если продолжение обустройства фотовыставки может нанести урон отношению к клубу организаций, зрителей или государственных структур. </p><p>6. Финансирование клубной фотовыставки обеспечивается за счет личных средств авторов, участвующих в экспозиции, а так же, по решению общего собрания клуба, могут быть использованы финансовые средства клуба.</p><p>7. Участники фотовыставки, не выполнившие своих обязательств в отношении устройства своей части фотовыставки несут ответственность перед общим собранием фотоклуба, вплоть до временного отстранения от участия в выставках клуба, а в особых случаях - исключения из членов клуба (решение общего собрание клуба). </p><p>8. За помощь в устройстве фотовыставки отличившимся членам клуба правление выносит благодарность, а за особые заслуги может представить к награде дополнительными льготами или бонусами, прочими доступными видами поощрений, не противоречащими Уставу клуба.</p>', 2, '2015-05-15 20:18:26', '2015-05-19 10:34:23', '2015-05-16');
