INSERT INTO `letters` (`id`, `title`, `content`, `user_id`, `created_at`, `updated_at`, `seen`, `comments_count`) VALUES
(1, 'Что такое облако?', 'В профиле пользователя появилась новая ссылка - облако... Напомни мне плиз что это такое?', 6, '2014-04-20 16:09:27', '2014-04-20 16:09:56', 1, NULL),
(4, 'Обратный порядок.', 'Оказалось, что последние фотографии так же нуждаются в обратном порядке. Так же нужно в администрировании пользователей везде выводить помимо имени еще и фамилию. Сообщи каким нить способом, что прочитал. Продублирую в Вибер.', 6, '2014-06-29 17:28:28', '2014-07-03 08:51:33', 1, NULL),
(5, 'Еще проблемы', 'Так же время не верно отображается - не тот часовой пояс.\r\nЕще проблема, до многих письма подтверждения не доходят.... видимо причина в корявом обратном адресе. точно не приходят на mail.ru и на bk.ru', 6, '2014-06-29 18:29:33', '2014-06-29 18:30:34', 1, NULL),
(6, 'Глюк', 'Это конечно круто что можно редактировать отправленные сообщения. Только наверное нужно ограничить возможность до прочтения. Глюк же в том, что после самостоятельного просмотра или его редактирования исходящего сообщения оно становится прочитанным.', 6, '2014-06-29 18:34:52', '2014-06-29 18:36:00', 1, NULL),
(7, 'активация', 'надо сделать активацию пользователя администратором.', 6, '2014-06-29 19:00:16', '2014-07-03 08:50:27', 1, NULL),
(8, 'Галереи', 'Надо все таки что бы не путаться переименовать Альбомы в Галереи, где это возможно. Второе к Галерее помимо название нужно добавить описание,  обязательно, его сильно не хватает. Еще Крайне не удобно отмечать фотокарточки плюсиком добавляя их в ту или иную галерею.. это не срочно но блин если там будет херова туча кадров это убиться веников надо, тем более что не видно какие уже там (а галерее) а какие еще не отметил.  Еще нужно придумать что бы была возможность к некоторым галереям прикрепить автора (не того кто создал, а производного)', 6, '2014-07-03 08:48:39', '2014-07-03 08:49:52', 1, NULL),
(9, 'Про написание писем', 'Когда в поле адресаты пишешь автора... в общем надо бы сканировать по трем полям (помимо имени, как это сейчас делается, еще и фамилия и никнейм.', 6, '2014-07-03 08:49:43', '2014-07-03 16:35:35', 1, NULL),
(10, 'Про модерацию фотографий.', 'Что-то глазик не работает.. т.е. выкалываю его.. а кадр все равно показывается всем. Единственное изменение - у фотографии у которой глаз выкалываю - она в списке модерации показывается самой верхней.', 6, '2014-07-03 09:14:22', '2014-07-03 16:44:09', 1, NULL),
(11, 'Какая то херь с письмами...', 'Письма блин странным образом то снанвятся прочитанными, то нет... более того вот сейчас херь вообще случилась.. они изменили свои даты написания.. как то странно.', 6, '2014-07-03 09:16:42', '2014-07-03 16:03:54', 1, NULL),
(12, 'Про права доступа', 'но вот какая херь выяснилась.. после регистрации и соответственно входа обычного пользователя. я решил проверить что ему доступно.. жмакнул на фото на первой странице сайта - открылась.. там автор, перешел по ссылке автора в его портфолио.. открыл фотографии.. виден список фотографий. но нажимая на любую из них перебрасывает на первую страницу сайта.. какой то глюк не хороший.', 6, '2014-07-04 06:49:41', '2014-07-04 06:59:46', 1, NULL),
(13, 'Коменты', 'Починил', 1, '2014-07-16 09:03:53', '2014-07-17 17:57:24', 1, NULL),
(15, 'Что тестировал то?', 'Странным образом мне пришло письмо "Тест" от тебя. я попробовал написать коммент к нему - вышла ошибка и письмо стало не от тебя а от меня внезапно.. как то странно. :)', 1, '2014-09-05 16:17:12', '2014-09-06 04:03:44', 1, NULL),
(16, 'Тестирую отправку писем из профиля другого пользователя', '', 1, '2014-09-06 09:46:37', '2014-10-09 07:33:58', 1, NULL),
(17, 'Про дату рождения', 'Миша, привет еще раз. Вижу зарегистрировался.  На сайте реализована система возрастных ограничений, согласно законам РФ, поэтому увы вынуждены в самом движке предусмотреть такую закарюку. В связи с этим, что бы видеть все что свыше 14+ нужно указать свою дату рождения, хоть она и не обязательна. :)', 6, '2014-10-11 13:42:08', '2014-10-11 15:37:57', 1, NULL),
