INSERT INTO `mailboxer_notifications` (`id`, `type`, `body`, `subject`, `sender_id`, `sender_type`, `conversation_id`, `draft`, `notification_code`, `notified_object_id`, `notified_object_type`, `attachment`, `updated_at`, `created_at`, `global`, `expires`) VALUES
(65, 'Mailboxer::Message', 'В профиле пользователя появилась новая ссылка - облако... Напомни мне плиз что это такое?', 'Что такое облако?', 6, 'User', 61, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(66, 'Mailboxer::Message', 'Оказалось, что последние фотографии так же нуждаются в обратном порядке. Так же нужно в администрировании пользователей везде выводить помимо имени еще и фамилию. Сообщи каким нить способом, что прочитал. Продублирую в Вибер.', 'Обратный порядок.', 6, 'User', 62, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(67, 'Mailboxer::Message', 'Так же время не верно отображается - не тот часовой пояс.\r\nЕще проблема, до многих письма подтверждения не доходят.... видимо причина в корявом обратном адресе. точно не приходят на mail.ru и на bk.ru', 'Еще проблемы', 6, 'User', 63, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(68, 'Mailboxer::Message', 'Это конечно круто что можно редактировать отправленные сообщения. Только наверное нужно ограничить возможность до прочтения. Глюк же в том, что после самостоятельного просмотра или его редактирования исходящего сообщения оно становится прочитанным.', 'Глюк', 6, 'User', 64, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(69, 'Mailboxer::Message', 'надо сделать активацию пользователя администратором.', 'активация', 6, 'User', 65, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(70, 'Mailboxer::Message', 'Надо все таки что бы не путаться переименовать Альбомы в Галереи, где это возможно. Второе к Галерее помимо название нужно добавить описание,  обязательно, его сильно не хватает. Еще Крайне не удобно отмечать фотокарточки плюсиком добавляя их в ту или иную галерею.. это не срочно но блин если там будет херова туча кадров это убиться веников надо, тем более что не видно какие уже там (а галерее) а какие еще не отметил.  Еще нужно придумать что бы была возможность к некоторым галереям прикрепить автора (не того кто создал, а производного)', 'Галереи', 6, 'User', 66, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(71, 'Mailboxer::Message', 'Когда в поле адресаты пишешь автора... в общем надо бы сканировать по трем полям (помимо имени, как это сейчас делается, еще и фамилия и никнейм.', 'Про написание писем', 6, 'User', 67, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(72, 'Mailboxer::Message', 'Что-то глазик не работает.. т.е. выкалываю его.. а кадр все равно показывается всем. Единственное изменение - у фотографии у которой глаз выкалываю - она в списке модерации показывается самой верхней.', 'Про модерацию фотографий.', 6, 'User', 68, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(73, 'Mailboxer::Message', 'А где он показывается в каком разделе ? Я тут попробовал, вроде не показывается  по крайнеймере не показывается там где было задумано в последних фотографиях.', 'Про модерацию фотографий.', 1, 'User', 68, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(74, 'Mailboxer::Message', 'А, понял ... Они показываются на первой странице. Это легко можно поправить.', 'Про модерацию фотографий.', 1, 'User', 68, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(75, 'Mailboxer::Message', 'Письма блин странным образом то снанвятся прочитанными, то нет... более того вот сейчас херь вообще случилась.. они изменили свои даты написания.. как то странно.', 'Какая то херь с письмами...', 6, 'User', 69, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(76, 'Mailboxer::Message', 'но вот какая херь выяснилась.. после регистрации и соответственно входа обычного пользователя. я решил проверить что ему доступно.. жмакнул на фото на первой странице сайта - открылась.. там автор, перешел по ссылке автора в его портфолио.. открыл фотографии.. виден список фотографий. но нажимая на любую из них перебрасывает на первую страницу сайта.. какой то глюк не хороший.', 'Про права доступа', 6, 'User', 70, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:35', '2014-12-05 03:52:35', 0, NULL),
(77, 'Mailboxer::Message', 'Починил', 'Коменты', 1, 'User', 71, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:36', '2014-12-05 03:52:36', 0, NULL),
(78, 'Mailboxer::Message', 'Странным образом мне пришло письмо "Тест" от тебя. я попробовал написать коммент к нему - вышла ошибка и письмо стало не от тебя а от меня внезапно.. как то странно. :)', 'Что тестировал то?', 1, 'User', 72, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:36', '2014-12-05 03:52:36', 0, NULL),
(79, 'Mailboxer::Message', '...', 'Тестирую отправку писем из профиля другого пользователя', 1, 'User', 73, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:36', '2014-12-05 03:52:36', 0, NULL),
(80, 'Mailboxer::Message', 'Тестовый комментарий', 'Тестирую отправку писем из профиля другого пользователя', 1, 'User', 73, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:36', '2014-12-05 03:52:36', 0, NULL),
(81, 'Mailboxer::Message', 'Миша, привет еще раз. Вижу зарегистрировался.  На сайте реализована система возрастных ограничений, согласно законам РФ, поэтому увы вынуждены в самом движке предусмотреть такую закарюку. В связи с этим, что бы видеть все что свыше 14+ нужно указать свою дату рождения, хоть она и не обязательна. :)', 'Про дату рождения', 6, 'User', 74, 0, NULL, NULL, NULL, NULL, '2014-12-05 03:52:36', '2014-12-05 03:52:36', 0, NULL),
