(376, 'Mailboxer::Message', 'Привет. Слушай, а ведь не все отпечатки мы видели по номинации принтов.  Не было точно отпечатков Куратова, и еще кто-то там разместил цианотипию... Как вообще поступим - будем их еще раз смотреть или так - отжюрим по сканам?', 'Номинация отпечатков', 6, 'User', 313, 0, NULL, NULL, NULL, NULL, '2015-01-20 10:48:59', '2015-01-20 10:48:59', 0, NULL),
