(381, 'Mailboxer::Message', 'Изменение статуса заявки: Заявка утверждена..  ', 'Специальный конкурс «Дебют» Для молодых фотографов', 6, 'User', 315, 0, NULL, NULL, NULL, NULL, '2015-01-27 21:50:03', '2015-01-27 21:50:03', 0, NULL),
(382, 'Mailboxer::Message', '10 февраля 2015 года, в тюменском музее ИЗО состоится грандиознейшее событие - открытие итоговой выставки по результатам международного фотоконкурса под эгидой ФИАП, который впервые был проведён в Тюмени! Открытие в 16:30. Вход свободный. Выставка будет экспонироваться до 1 марта 2015 года.\r\n\r\nТак же завтра будут вручены призы победителям фотоконкурса.', 'Открытие фотовыставки "1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP".', 6, 'User', 316, 0, NULL, NULL, NULL, NULL, '2015-02-09 16:53:50', '2015-02-09 16:53:50', 0, NULL),
(383, 'Mailboxer::Message', 'Николай, здравствуйте!\r\nПодскажите пожалуйста, сегодня 10 февраля будет открытие выставки "1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP", где также (по вашему комментарию) будут вручены награды победителям фотовыставки. Такой вопрос, а как будут обстоять дела с награждением иногородних участников? В частности моя работа была  отмечена жюри специальным призом 1ой степени. К сожалению, никакой информации об награждении я не нашел.\r\n\r\nБлагодарен заранее за помощь, Николай!\r\n', 'вопрос по поводу награждения', 146, 'User', 317, 0, NULL, NULL, NULL, NULL, '2015-02-10 13:28:14', '2015-02-10 13:28:14', 0, NULL),
(384, 'Mailboxer::Message', 'Здравствуйте, Дмитрий. Награждение выделено специальным мероприятием с датой 20 февраля. Связано это с длительностью - мы посчитали, что награждение займет около 40 минут, поэтому решили не совмещать открытие выставки с награждением, ибо пришлось бы затянуть мероприятие.', 'вопрос по поводу награждения', 6, 'User', 317, 0, NULL, NULL, NULL, NULL, '2015-02-10 17:48:56', '2015-02-10 17:48:56', 0, NULL),
(385, 'Mailboxer::Message', 'Огромное спасибо за информацию, Николай!', 'вопрос по поводу награждения', 146, 'User', 317, 0, NULL, NULL, NULL, NULL, '2015-02-11 11:53:57', '2015-02-11 11:53:57', 0, NULL),
(386, 'Mailboxer::Message', 'Здравствуйте! К сожалению не удастся побывать на выставке. Скажите, пожалуйста, возможно ли как-нибудь получить диплом?', '1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP', 161, 'User', 202, 0, NULL, NULL, NULL, NULL, '2015-03-02 16:08:05', '2015-03-02 16:08:05', 0, NULL),
(387, 'Mailboxer::Message', 'Да, конечно. Позвоните по телефону: +7 3452 998755. все решится.', '1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP', 6, 'User', 202, 0, NULL, NULL, NULL, NULL, '2015-03-02 16:45:08', '2015-03-02 16:45:08', 0, NULL),
(388, 'Mailboxer::Message', 'тест', 'тест', 146, 'User', 318, 0, NULL, NULL, NULL, NULL, '2015-03-04 11:04:06', '2015-03-04 11:04:06', 0, NULL),
(389, 'Mailboxer::Message', 'Здравствуйте, Сергей Валерьевич!\r\n\r\nВо-первых хочу поблагодарить Вас за отличную организацию  и великолепное проведение столь значимого конкурса в нашей стране!\r\n\r\nИ у меня есть следующий вопрос:\r\n\r\nКак я знаю, из переписки с Николаем Сульженко, награждение участников было уже проведено 20 февраля.\r\n\r\nВ числе отмеченных работ, есть моя фотография, которая получила от жюри специальный приз 1ой степени (работа "Березы в городе").\r\n\r\nТак вот, сам вопрос. Как и  будет ли проходит процедура награждения иногородних участников? (если конечно подразумевается какая-либо награда за получение  спецприза 1ой степени.) В частности я проживаю в городе  Подольске, Московская область.\r\n\r\nЕсли в решении данного вопроса мне поможет другой человек, пожалуйста, подскажите его контакты.\r\n\r\nБлагодарен заранее за помощь, Сергей Валерьевич!\r\n\r\n(это сообщение я дублировал на fotoexpo72@mail.ru)\r\n\r\n', 'награждение fixage''2014', 146, 'User', 319, 0, NULL, NULL, NULL, NULL, '2015-03-04 11:26:27', '2015-03-04 11:26:27', 0, NULL),
(390, 'Mailboxer::Message', 'Изменение статуса заявки: Заявка утверждена..  ', 'ФотоФиниш 50Test', 6, 'User', 320, 0, NULL, NULL, NULL, NULL, '2015-03-04 19:44:27', '2015-03-04 19:44:27', 0, NULL),
