(534, 'Mailboxer::Message', 'То есть в том, что в Кургане, на лошади едет негр, снятый на одном кадре одним фотоаппаратом, а во втором кадре на другую камеру сделан кадр и при этом в заголовке скачек указан веб сервис для картинок это не наводит никаких мыслей ? Больше того - данный сервис уже ребрендирован в Google Photo далеко не в день фотофиниша... Не люблю плохо думать о других, но данная картинка намекает что он не новая и слита с внешнего веб ресурса...', 'фф', 407, 'User', 445, 0, NULL, NULL, NULL, NULL, '2016-11-05 05:30:44', '2016-11-05 05:30:44', 0, NULL),
(535, 'Mailboxer::Message', 'Сергей... Я вот сейчас не пойму вообще о чём вы????  В заголовке кадра чего указано? Какой сервис? В EXIF в поле "автор" указано "Picasa" и что? Если автор так себя сам называет... Что за бред вообще вы пишите? Даже если бы это было указано в поле Application, то представьте себе, что до сих пор у некоторых на компах установлена эта программа. И что? Что из этого следует? И причём тут негр? ', 'фф', 6, 'User', 445, 0, NULL, NULL, NULL, NULL, '2016-11-05 17:59:21', '2016-11-05 17:59:21', 0, NULL);
