(1, 'Проблема при загрузке', 'Нет сообщения о том, что заявка одобрена, в графе "Я учачтвую" не появляется галочка. Что я делаю не так?', 190, '2015-01-08 06:59:43', '2015-01-08 15:36:01', 1, 2),
(2, 'FIAP', 'подскажите, поданы ли теперь мои 8 работ в двух номинациях, видно ли их?\r\nспасибо.', 185, '2015-01-14 07:39:44', '2015-01-14 11:02:33', 2, 2),
(3, 'удалить фотографии', 'Здравствуйте! Конкурс давно прошел. А фотографии удлаить не могу. Сообщение: "Это фото удалить нельзя, оно участвует в конкурсе" Прошу удалить все мои фотографии из портфолио .т.к. это неактуальная информация', 181, '2016-05-24 14:25:15', '2016-05-24 14:25:15', 1, 0),
(4, 'Удалить профиль', 'Здравствуйте, хочу удалить профиль со всеми фотографиями. Как это сделать?', 181, '2016-05-24 14:26:59', '2016-05-24 14:26:59', 1, 0);
