INSERT INTO `posts` (`id`, `title`, `content`, `published`, `user_id`, `digest`, `created_at`, `updated_at`, `type`, `age_policy_id`, `slug`) VALUES
(1, 'Современная система классификации информационного контента возрастного ограничения', '<p style="text-align: center;">\r\n</p>\r\n<p>\r\n	 <em><br />\r\n	 </em>\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/11/90195.jpg" style="width: 279px;">\r\n</p>\r\n<p>\r\n	 <em>(взято из Википедии)</em>\r\n</p>\r\n<p>\r\n	      С 1 сентября 2012 года, после вступления в силу <a href="http://ru.wikipedia.org/wiki/%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%BA%D0%BE%D0%BD_%C2%AB%D0%9E_%D0%B7%D0%B0%D1%89%D0%B8%D1%82%D0%B5_%D0%B4%D0%B5%D1%82%D0%B5%D0%B9_%D0%BE%D1%82_%D0%B8%D0%BD%D1%84%D0%BE%D1%80%D0%BC%D0%B0%D1%86%D0%B8%D0%B8,_%D0%BF%D1%80%D0%B8%D1%87%D0%B8%D0%BD%D1%8F%D1%8E%D1%89%D0%B5%D0%B9_%D0%B2%D1%80%D0%B5%D0%B4_%D0%B8%D1%85_%D0%B7%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D1%8C%D1%8E_%D0%B8_%D1%80%D0%B0%D0%B7%D0%B2%D0%B8%D1%82%D0%B8%D1%8E%C2%BB">федерального закона «О защите детей от информации, причиняющей вред их здоровью и развитию»</a> в России введена следующая возрастная классификация информационной продукции:\r\n</p>\r\n<h3>Информационная продукция для детей, не достигших возраста шести лет (0+)</h3>\r\n<p>\r\n	      К информационной продукции для детей, не достигших возраста шести лет, может быть отнесена информационная продукция, содержащая информацию, не причиняющую вреда здоровью и (или) развитию детей (в том числе информационная продукция, содержащая оправданные её жанром и (или) сюжетом эпизодические ненатуралистические изображение или описание физического и (или) психического насилия (за исключением сексуального насилия) при условии торжества добра над злом и выражения сострадания к жертве насилия и (или) осуждения насилия).\r\n</p>\r\n<h3>Информационная продукция для детей, достигших возраста шести лет (6+)</h3>\r\n<p>\r\n	      К допускаемой к обороту информационной продукции для детей, достигших возраста шести лет, может быть отнесена информационная продукция, предусмотренная статьей 7 настоящего Федерального закона, а также информационная продукция, содержащая оправданные её жанром и (или) сюжетом:\r\n</p>\r\n<p>\r\n	      1) кратковременные и ненатуралистические изображение или описание <a href="http://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%B1%D0%BE%D0%BB%D0%B5%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5">заболеваний</a> человека (за исключением тяжелых заболеваний) и (или) их последствий в форме, не унижающей человеческого <a href="http://ru.wikipedia.org/wiki/%D0%94%D0%BE%D1%81%D1%82%D0%BE%D0%B8%D0%BD%D1%81%D1%82%D0%B2%D0%BE">достоинства</a>;\r\n</p>\r\n<p>\r\n	      2) ненатуралистические изображение или описание <a href="http://ru.wikipedia.org/wiki/%D0%9D%D0%B5%D1%81%D1%87%D0%B0%D1%81%D1%82%D0%BD%D1%8B%D0%B9_%D1%81%D0%BB%D1%83%D1%87%D0%B0%D0%B9">несчастного случая</a>, <a href="http://ru.wikipedia.org/wiki/%D0%90%D0%B2%D0%B0%D1%80%D0%B8%D1%8F">аварии</a>, <a href="http://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0">катастрофы</a> либо <a href="http://ru.wikipedia.org/wiki/%D0%9D%D0%B5%D0%BD%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%81%D0%BC%D0%B5%D1%80%D1%82%D1%8C">ненасильственной смерти</a> без демонстрации их последствий, которые могут вызывать у детей страх, ужас или панику;\r\n</p>\r\n<p>\r\n	      3) не побуждающие к совершению антиобщественных действий и (или) преступлений эпизодические изображение или описание этих действий и (или) преступлений при условии, что не обосновывается и не оправдывается их допустимость и выражается отрицательное, осуждающее отношение к лицам, их совершающим.\r\n</p>\r\n<h3>Информационная продукция для детей, достигших возраста двенадцати лет (12+)</h3>\r\n<p>\r\n	      К допускаемой к обороту информационной продукции для детей, достигших возраста двенадцати лет, может быть отнесена информационная продукция, предусмотренная статьей 8 настоящего Федерального закона, а также информационная продукция, содержащая оправданные её жанром и (или) сюжетом:\r\n</p>\r\n<p>\r\n	      1) эпизодические изображение или описание жестокости и (или) насилия (за исключением сексуального насилия) без натуралистического показа процесса лишения жизни или нанесения увечий при условии, что выражается сострадание к жертве и (или) отрицательное, осуждающее отношение к жестокости, насилию (за исключением насилия, применяемого в случаях защиты прав граждан и охраняемых законом интересов общества или государства);\r\n</p>\r\n<p>\r\n	      2) изображение или описание, не побуждающие к совершению антиобщественных действий (в том числе к потреблению алкогольной и спиртосодержащей продукции, пива и напитков, изготавливаемых на его основе, участию в азартных играх, занятию бродяжничеством или попрошайничеством), эпизодическое упоминание (без демонстрации) наркотических средств, психотропных и (или) одурманивающих веществ, табачных изделий при условии, что не обосновывается и не оправдывается допустимость антиобщественных действий, выражается отрицательное, осуждающее отношение к ним и содержится указание на опасность потребления указанных продукции, средств, веществ, изделий;\r\n</p>\r\n<p>\r\n	      3) не эксплуатирующие интереса к сексу и не носящие возбуждающего или оскорбительного характера эпизодические ненатуралистические изображение или описание половых отношений между мужчиной и женщиной, за исключением изображения или описания действий сексуального характера.\r\n</p>\r\n<h3>Информационная продукция для детей, достигших возраста шестнадцати лет (16+)</h3>\r\n<p>\r\n	      К допускаемой к обороту информационной продукции для детей, достигших возраста шестнадцати лет, может быть отнесена информационная продукция, предусмотренная статьей 9 настоящего Федерального закона, а также информационная продукция, содержащая оправданные её жанром и (или) сюжетом:\r\n</p>\r\n<p>\r\n	      1) изображение или описание несчастного случая, аварии, катастрофы, заболевания, смерти без натуралистического показа их последствий, которые могут вызывать у детей страх, ужас или панику;\r\n</p>\r\n<p>\r\n	      2) изображение или описание жестокости и (или) насилия (за исключением сексуального насилия) без натуралистического показа процесса лишения жизни или нанесения увечий при условии, что выражается сострадание к жертве и (или) отрицательное, осуждающее отношение к жестокости, насилию (за исключением насилия, применяемого в случаях защиты прав граждан и охраняемых законом интересов общества или государства);\r\n</p>\r\n<p>\r\n	      3) информация о наркотических средствах или о психотропных и (или) об одурманивающих веществах (без их демонстрации), об опасных последствиях их потребления с демонстрацией таких случаев при условии, что выражается отрицательное или осуждающее отношение к потреблению таких средств или веществ и содержится указание на опасность их потребления;\r\n</p>\r\n<p>\r\n	      4) отдельные бранные слова и (или) выражения, не относящиеся к нецензурной брани;\r\n</p>\r\n<p>\r\n	      5) не эксплуатирующие интереса к сексу и не носящие оскорбительного характера изображение или описание половых отношений между мужчиной и женщиной, за исключением изображения или описания действий сексуального характера.\r\n</p>\r\n<h3>Информация, запрещённая для распространения среди детей (18+)</h3>\r\n<p>\r\n	      1) побуждающая детей к совершению действий, представляющих угрозу их жизни и (или) здоровью, в том числе к причинению вреда своему здоровью, самоубийству;\r\n</p>\r\n<p>\r\n	      2) способная вызвать у детей желание употребить наркотические средства, психотропные и (или) одурманивающие вещества, табачные изделия, алкогольную и спиртосодержащую продукцию, пиво и напитки, изготавливаемые на его основе, принять участие в азартных играх, заниматься проституцией, бродяжничеством или попрошайничеством;\r\n</p>\r\n<p>\r\n	      3) обосновывающая или оправдывающая допустимость насилия и (или) жестокости либо побуждающая осуществлять насильственные действия по отношению к людям или животным, за исключением случаев, предусмотренных настоящим Федеральным законом;\r\n</p>\r\n<p>\r\n	      4) отрицающая <a href="http://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BC%D0%B5%D0%B9%D0%BD%D1%8B%D0%B5_%D1%86%D0%B5%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D0%B8">семейные ценности</a> и формирующая неуважение к родителям и (или) другим членам семьи;\r\n</p>\r\n<p>\r\n	      5) оправдывающая противоправное поведение;\r\n</p>\r\n<p>\r\n	      6) содержащая нецензурную брань;\r\n</p>\r\n<p>\r\n	      7) содержащая информацию порнографического характера.\r\n</p>', NULL, 6, '<p>\r\n	      Классификация возрастного ограниячения, принятая в РФ с 1 сентября 2012 года.\r\n</p>', '2014-04-28 08:25:06', '2014-07-28 12:54:23', 'Article', 5, 'sovremennaya-sistema-klassifikatsii-informatsionnogo-kontenta-vozrastnogo-ogranicheniya'),
(4, 'Начало деятельности Тюменского дома фотографии', '<p><span style="background-color: initial;"><br></span></p><p><img src="/system/redactor_assets/pictures/13/UalQm1IRJeU.jpg"></p><p>\r\n	 <span style="background-color: initial;">Точкой отсчета в деятельности Тюменского дома фотографии можно с уверенностью считать 21 августа 2012 года, когда Тюменская областная организация Союза фотохудожников России, Арт-проект «Naked ambient», Клуб любителей фотографии «ФотоРегион» и «Гильдия фотографов» в Отеле Best Western Plus «Спасская» провела пресс-конференцию для СМИ, представителей органов власти и общественных организаций. Тема встречи – создание в городе музея фотографии и выставочного мультимедийного центра. </span></p><p>\r\n	 Безусловно, в одночасье столь масштабные проекты не реализуются. Полностью все подразделения Тюменского дома фотографии должны быть созданы и приступить к работе во II квартале 2013 года. Среди них школа фотографии для любителей разных возрастов и уровней, фотостудия, центр фотоуслуг, конференц-зал. О деятельности отделов, мы будем информировать Вас по мере их введения в строй, равно как и о том, кто работает над этим проектом и других новостях.<br>\r\n	 Однако уже сейчас мы рады представить Вашему вниманию актуальную информацию и пригласить к сотрудничеству. Добро пожаловать в Тюменский дом фотографии!</p>', NULL, 6, '<p>\r\n	 <span style="background-color: initial;">Точкой отсчета в деятельности Тюменского дома фотографии можно с уверенностью считать 21 августа 2012 года,</span></p>', '2014-06-29 03:13:06', '2014-08-30 07:37:12', 'Article', 3, 'nachalo-deyatelnosti-tyumenskogo-doma-fotografii'),
(5, 'Предстоит очередная "сушка" фотографий в июле!', '<p>\r\n	 <span style="background-color: initial;">20 июля 2014 г. в 12:00 На аллее кошек случится "фото сушка". «Сушка» – международная акция по обмену фотографиями, придуманная и впервые реализованная в Санкт-Петербурге в 2010г. С тех пор Сушка прошла в более чем 100 городах России и мира и собрала более 45 000 участников. Официальная группа проекта: </span><a href="http://vk.com/fotosushka">vk.com/fotosushka</a> . <span style="background-color: initial;">Приносите фотографии размером от 10Х15 см и более, и ещё бельевые прищепки, на которые вы сможете их прикрепить.</span>\r\n</p>\r\n<p>\r\n	 <span style="background-color: initial;"><br />\r\n	 </span>\r\n</p>', NULL, 6, '<p>\r\n	 <span style="background-color: initial;">20 июля 2014 г. в 12:00 На аллее кошек случится "фото сушка".</span>\r\n</p>', '2014-06-29 03:29:57', '2014-07-28 12:55:33', 'Novelty', 3, 'predstoit-ocherednaya-sushka-fotografiy-v-iyule'),
(6, 'Фотоклуб уходит на каникулы', '<ul>\r\n	<li><span style="background-color: initial;">Тюменский ф</span><span style="background-color: initial;">отоклуб "ФотоРегион" уходит на каникулы до сентября. Собрания фотоклуба возобновятся осенью, надеемся что по уже привычному расписанию. О расписании и тематике встреч  в новом сезоне мы сообщим дополнительно.</span></li>\r\n</ul>', NULL, 6, '', '2014-06-29 05:34:45', '2014-06-29 05:34:45', 'Novelty', 3, 'fotoklub-uhodit-na-kanikuly'),
(7, 'Открытие мультимедийного проекта «Тюмень: город, события, люди. Профессиональная и любительская фотография 80х – начала 90х годов', '<p>\r\n	 <strong style="background-color: initial;">Уважаемые господа!</strong>\r\n</p>\r\n<p>\r\n	 <strong></strong>\r\n</p>\r\n<p>\r\n	     В рамках программы празднования 70-летия Тюменской области <strong>26 июля</strong> (в День города), в Музее изобразительных искусств состоится открытие мультимедийного проекта <strong>«Тюмень: город, события, люди. Профессиональная и любительская фотография 80х – начала 90х годов».</strong>\r\n</p>\r\n<p>\r\n	     Организаторами выступает Тюменский дом фотографии (ТДФ), Тюменская региональная организация Союза фотохудожников России при поддержке <strong>Правительства Тюменской области и Администрации города Тюмени</strong>. Экспонаты, многие из которых будут представлены впервые, поступят из фондов Музейного комплекса им. И.Я. Словцова, Музея истории науки и техники Зауралья, Некоммерческого фонда «Культурное наследие Западной Сибири», частных архивов и коллекций.\r\n</p>\r\n<p>\r\n	     Хотелось бы подчеркнуть, что, во-первых, данное мероприятие не просто статичная фотовыставка, а «живая» экспозиция, погружающая нас в эпоху указанного периода (Программа прилагается). Во-вторых, ее увидят не только горожане, гости города, но и жители Тюменской области, в города которой она будет вывозиться.\r\n</p>\r\n<p>\r\n	     Для каждого поколения есть свой исторический отрезок, который вспоминается с особым чувством, и каждый из нас, вне зависимости от профессионализма в области фотодела, сам по себе является частью истории родного города. Поэтому отдельный раздел будет посвящен материалам из семейных фотоархивов.\r\n</p>\r\n<p>\r\n	     В этой связи обращаемся к руководителям предприятий, организаций, общественных объединений с просьбой откликнуться. Оргкомитет принимает фотоматериалы периода 1980-1992 гг. из архивов организаций и частных лиц. Условия приема можно уточнить по указанным координатам.\r\n</p>\r\n<p>\r\n	     В любом случае мы приглашаем Вас на открытие и всегда рады сотрудничеству.\r\n</p>\r\n<p>\r\n	 <strong>Место</strong>\r\n</p>\r\n<p>\r\n	 Тюменский областной музей изобразительных искусств<strong></strong>\r\n</p>\r\n<p>\r\n	 <strong>Дата</strong>\r\n</p>\r\n<p>\r\n	 С 26 июля по 28 августа, торжественное открытие <strong>26 июля 2014, в День Города</strong>\r\n</p>\r\n<p>\r\n	 <strong>В программе:</strong>\r\n</p>\r\n<p>\r\n	 <strong></strong>\r\n</p>\r\n<ul>\r\n	<li>Выставка работ лучших фотографов, работавших в      указанный период;</li>\r\n	<li>Фото из музейных и частных архивов жителей города,      области;</li>\r\n	<li>Мультимедиа инсталляция фотоснимков, видео- и      кинохроники, в т.ч. с использованием техники прошлых лет;</li>\r\n	<li>Интерьерные инсталляции; Экспозиция авто 80х-90х      гг. (перед зданием музея)</li>\r\n	<li>Экспозиция фототехники 80х-90х гг.</li>\r\n	<li>Демонстрация процесса «живой» фотопечати (до- и      после печатная обработка);</li>\r\n</ul>\r\n<p>\r\n	<em>   С наилучшими пожеланиями успехов и процветания,<br />\r\n	 <span style="background-color: initial;">Председатель координационного совета ТДФ</span></em>\r\n</p>\r\n<p>\r\n	 <span style="background-color: initial;"><em>Сергей Фирцев</em></span>\r\n</p>\r\n<p>\r\n	 <strong></strong>\r\n</p>', NULL, 6, '<p>\r\n	 <span style="background-color: initial;">В рамках программы празднования 70-летия Тюменской области </span><strong style="background-color: initial;">26 июля</strong><span style="background-color: initial;"> (в День города), в Музее изобразительных искусств состоится открытие мультимедийного проекта </span><strong style="background-color: initial;">«Тюмень: город, события, люди. Профессиональная и любительская фотография 80х – начала 90х годов».</strong>\r\n</p>', '2014-06-29 07:44:35', '2014-06-29 07:55:33', 'Novelty', 4, 'otkrytie-multimediynogo-proekta-tyumen-gorod-sobytiya-lyudi-professionalnaya-i-lyubitelskaya-fotografiya-80h-nachala-90h-godov'),
(9, 'Идет обкатка и заполнение нашего нового сайта.', '<p>\r\n	   Всем привет!\r\n</p>\r\n<p>\r\n	   Хочу поделиться с вами радостной новостью, наконец то мы сподобились запустить сайт Тюменского дома фотографии, совместно этот сайт будет решать и задачи фотоклуба ФотоРегион и даже на базе этого сайта возможно проведение фотоконкурсов с привлечением в том числе и сторонних участников в жюри. Регистрация на сайте свободная. По началу прошу сообщать мне о вашем присоединении, что бы я мог назначить вам правильные роли, ведь некоторые из вас, как я надеюсь, пополнят контент сайта не только своими замечательными фотографиями, но и интересными мыслями. О всех неисправностях и недоработках прошу сообщать мне в личку или через "тикеты". Конечно очень многое еще остается на сайте сырым и не доделанным, некоторые функции не реализованы полностью, некоторые виды отображения совершенно в черновом варианте, прошу сильно за это не ругать, всё со временем будет достойно реализовано. Пока сложности с сериями фотографий и с фотоисториями, но это решится однажды, а пока можете объединять такие фотографии общими тэгами.  Для тех , кому открыт доступ к публикации статей - буду рад видеть от вас интересные рассказы и популярные статьи!\r\n</p>\r\n<p>\r\n	   Для тех, кто еще не зарегистрировался, прошу присоединяться к нашему сообществу!\r\n</p>\r\n<p>\r\n	   С наилучшими пожеланиями и надеждой, Николай.\r\n</p>\r\n<p>\r\n	  PS\r\n</p>\r\n<p>\r\n	  к сожалению письма с кодом подтверждения регистрации доходят не на все почтовые сервера.. Прошу сообщить мне, кому после регистрации не пришло письмо с подтверждением.\r\n</p>\r\n<p>\r\n	 Установлено что на почтовые ящики @mail.ru и @bk.ru  письма не доходят. Проверено, что письма доходят на адреса @gmail.com @yandex.ru и некоторые другие.\r\n</p>\r\n<p>\r\n	 К сожалению быстро решить эту проблему не смогу. Буду активировать по вашему запросу "в ручную".\r\n</p>', NULL, 6, '<p>\r\n	   Первичная регистрация участников ресурса, заполнение контента, виртуальные выставки, статьи, новости, все это уже доступно или вскоре появится.\r\n</p>', '2014-06-29 17:43:12', '2014-07-19 05:51:59', 'Novelty', 4, 'idet-obkatka-i-zapolnenie-nashego-novogo-sayta'),
(10, 'Открытие фотовыставки Сергея Киселева «ЗАЛ ОЖИДАНИЯ»', '<p>\r\n	 <strong>О выставке <span style="background-color: initial;">«ЗАЛ ОЖИДАНИЯ»</span></strong>\r\n</p>\r\n<p>\r\n	 <img src="/system/redactor_assets/pictures/6/10293552_693810044005941_7961261964061959695_o.jpg" style="width: 410px;">\r\n</p>\r\n<p>\r\n	 <img src="http://domfoto72.ru/system/redactor_assets/pictures/10/10518913_693829380670674_641150905_n.jpg" style="width: 321px;"> <img src="http://domfoto72.ru/system/redactor_assets/pictures/9/10501389_693829300670682_360624267_n.jpg" style="width: 320px;">\r\n</p>\r\n<p>\r\n	      «Что наша жизнь – игра!...» – восклицал классик. Борьба за существование, любовь к деньгам, борьба с весом, бессмысленная борьба со временем, печаль, веселье, труд, бессонница, алкоголь, творчество, времена года, любовь, предательство, болезни, взлеты и падения, морщины в разных частях тела, вера в лучшее… Пока верил – жизнь пролетела, как миг. Жизнь – странный зал ожидания поезда, и мы все пассажиры. Одни едут в купе с чистыми занавесками, другие в плацкартном вагоне, дыша пятками соседа, третьи – на крыше… Станция приезда у всех одна – время разное…\r\n</p>\r\n<p>\r\n	 <img src="/system/redactor_assets/pictures/8/10302228_693815194005426_4183751509837360622_n.jpg" style="width: 383px;">\r\n</p>\r\n<p>\r\n	 <strong>Об авторе, точнее, А<span style="background-color: initial;">втор о себе:</span></strong>\r\n</p>\r\n<p>\r\n	      Я прожил длинную жизнь, которая пролетела как миг. Начинал рабочим в полевой геолого-разведочной партии, был водителем троллейбуса, возил на мазе-молоковозе молоко в Тюмень из районов Тюменской области, работал слесарем, компрессорщиком на заводе. Фотоаппарат взял в руки в 32 года, решив сфотографировать новорожденного сына. И этот момент изменил мою жизнь.<br />\r\n	      Через два года участвовал в международных выставках (ФИАП), закончил Московский заочный университет искусств (кинофотофакультет) с отличием – был такой. На волне перестройки пришел в газету и оказался востребован.<br />\r\n	      Награды? Первое место на первом конкурсе репортажной фотографии памяти Александра Ефремова, тюменского фотографа, погибшего в Чечне, моего хорошего товарища. Был отмечен на фестивале тюменской прессы как «Фотокор года», не спрашивайте в каком году – не помню. Но и не лгу…<br />\r\n	      В 2003 году получил звание лауреата на всероссийской выставке «Россия – отчий дом». К наградам, впрочем, как и ко многому отношусь философски. Для меня настоящая фотография, как хорошая литература, должна быть с подтекстом…\r\n</p>\r\n<p>\r\n	      Сергей Киселев, родился в 1946 году. Редактор отдела иллюстраций, фотограф газеты «Тюменские известия». <br />\r\n	      Член Международной ассоциации журналистов, <br />\r\n	      член Союза фотохудожников России.\r\n</p>\r\n<hr id="horizontalrule">\r\n<p>\r\n	      Итак, открытие выставки: 01.08.2014г.\r\n</p>\r\n<p>\r\n	   Усадьба Колокольниковых (<span style="background-color: initial;">Исторический музей</span>)\r\n</p>\r\n<p>\r\n	   улица Республики, 20, Тюмень\r\n</p>', NULL, 6, '<p>\r\n	 <span style="background-color: initial;">Тюменский дом фотографии и </span><span style="background-color: initial;">Музейный комплекс Тюменской области </span>\r\n</p>\r\n<p>\r\n	     приглашают на выставку фотографа Сергея Киселева, <span style="background-color: initial;">01.08.2014 в 16:30.</span>\r\n</p>', '2014-07-11 17:19:25', '2014-07-30 16:09:14', 'Novelty', 5, 'otkrytie-fotovystavki-sergeya-kiseleva-zal-ozhidaniya'),
(11, 'Приглашаем поучаствовать в новом конкурсе цифровой фотографии.', '<p>\r\n	 <span style="background-color: initial;"><strong>П</strong>риглашаем жителей Тюменской области принять участие в конкурсе графических работ в цифровом формате, представляющих Тюменскую область глазами её жителей.</span>\r\n</p>\r\n<p>\r\n	 <br />\r\n	 <strong>Н</strong>а конкурс принимаются изображения в электронном формате, созданные с применением различных средств и техник фотосъемки, компьютерной обработки изображений, компьютерной графики, художественных и дизайнерских приемов, а также соответствующие тематике конкурса.\r\n</p>\r\n<p>\r\n	<strong>Т</strong>ематика конкурсных работ – Тюменская область: прошлое, настоящее и будущее региона, достижения и положительные тенденции в различных сферах деятельности, события, люди, населенные пункты, архитектурные объекты, природа и т.д.<br />\r\n	 Работы необходимо направлять на официальный адрес электронной почты конкурса – <strong>digital@72to.ru</strong>\r\n</p>\r\n<p>\r\n	<strong>П</strong>рием работ осуществляется <strong>по 31 августа 2014 года</strong> (включительно).\r\n</p>\r\n<p>\r\n	<strong>О</strong>фициальная церемония награждения финалистов конкурса состоится в сентябре 2014 года в рамках 7-го ежегодного всероссийского форума «Электронное правительство — современный механизм управления регионом» и специализированной выставки ««ИНФОТЕХ-2014».\r\n</p>\r\n<p>\r\n	Телефон для справок (3452) <strong>556-031</strong>\r\n</p>\r\n<p>\r\n	 <img src="/system/redactor_assets/pictures/12/y_c6395d11.jpg">\r\n</p>\r\n<p>\r\n	 <em>фото Игоря Ковалева</em>\r\n</p>', NULL, 6, '<p>\r\n	 <span style="background-color: initial;">Приглашаем жителей Тюменской области принять участие в</span><span style="background-color: initial;"> конкурсе графических работ в цифровом формате «Тюменская область в цифре», посвященном 70-летию со дня образования Тюменской области</span><span style="background-color: initial;"></span>\r\n</p>', '2014-07-28 15:24:52', '2014-07-28 15:29:11', 'Novelty', 4, 'priglashaem-pouchastvovat-v-novom-konkurse-tsifrovoy-fotografii'),
(13, 'Приглашаем на открыие выставки "Тюмень: город, события, люди. Профессиональная и любительская фотография 80х - начала 90х гг."', '<p>В рамках программы празднования 70-летия Тюменской области в Музее изобразительных искусств состоится открытие мультимедийного проекта «Тюмень: город, события, люди. Профессиональная и любительская фотография 80х – начала 90х годов».</p><p>Организаторами выступает Тюменский дом фотографии (ТДФ), Тюменская региональная организация Союза фотохудожников России при поддержке Правительства Тюменской области и Администрации города Тюмени. Экспонаты, многие из которых будут представлены впервые, поступят из фондов Музейного комплекса им. И.Я. Словцова, Музея истории науки и техники Зауралья, частных коллекций.</p><p>Для каждого поколения есть свой исторический отрезок, который вспоминается с особым чувством, и каждый из нас, вне зависимости от профессионализма в области фотодела, сам по себе является частью истории родного города.</p><p><img src="http://domfoto72.ru/system/redactor_assets/pictures/14/reclama_tmn_city_events_peoples.jpg" style="background-color: initial;"></p><p>.</p><p><strong>Выставка откроется 09.09.2014 года. в 15:00, в Тюменском Областном музее Изобразительных Искусств по адресу: улица Орджоникидзе, 47</strong></p>', NULL, 6, '<p>Выставка откроется 09.09.2014 года. в 15:00, в Тюменском Областном музее Изобразительных Искусств по адресу: улица Орджоникидзе, 47</p>', '2014-09-09 01:16:01', '2014-09-09 01:19:02', 'Novelty', 4, 'priglashaem-na-otkryie-vystavki-tyumen-gorod-sobytiya-lyudi-professionalnaya-i-lyubitelskaya-fotografiya-80h-nachala-90h-gg'),
(14, 'Фотоклуб вернулся с летних каникул 2014.', '<p><img src="/system/redactor_assets/pictures/15/IMG_7198-bw-crop_sm.jpg" style="width: 772px;"></p><p>Внимание! В субботу, 11.10.2014 фотоклуб возобновляет новую сессию встреч.</p><p>В этот раз заседание фотоклуба будет проходить тематической.&nbsp;Тема: "Как я провел это лето".&nbsp;</p><p>Приносите фотографии в электронном или бумажном виде!</p><p><br>Не забываем, в конце заседания будет ФотоМена!!!</p><p>Как всегда, встреча начнется в 15:00 в Центральной областной библиотеке имени Менделеева (Орджоникидзе, 59).</p>', NULL, 6, '<p>В субботу, 11 октября 2014 состоится долгожданное заседание нашего фотоклуба.</p>', '2014-10-10 04:06:27', '2014-10-15 10:42:10', 'Novelty', 4, 'fotoklub-vernulsya-s-kanikul');
INSERT INTO `posts` (`id`, `title`, `content`, `published`, `user_id`, `digest`, `created_at`, `updated_at`, `type`, `age_policy_id`, `slug`) VALUES
(15, 'Участие в фото-конкурсах на нашем сайте.  Порядок и инструкция.', '<p><img src="/system/redactor_assets/pictures/57/___________________________.jpg" style="width: 671px;"></p><p>Рады сообщить вам, что Тюменский дом фотографии совместно с фотоклубом "ФотоРегион" (г.Тюмень) начинают новую страницу в организации фотоконкурсов. Отрадно заметить что теперь конкурсы будут иметь не только местное значение, но так же часть конкурсов будут иметь статус международных.&nbsp;</p><p>Все конкурсы будут делиться на открытые и закрытые конкурсы, а так же будет особый статус конкурса (закрытого) - конкурс FIAP (пока под эгидой этой организации, с их одобрения).</p><p>В открытых конкурсах нет модерации заявок на участие, и любой зарегистрированный пользователь нашего сайта сможет сразу же разместить фотографии в раздел такого конкурса, конечно согласно положения конкурса.</p><p>В закрытых же конкурсах, и в том числе в конкурсах FIAP заявки будут проходить модерацию, и при соблюдении особых правил конкретного конкурса заявка будет ободрена, однако часть заявок может быть отклонена с указанием причины отклонения, о чем вам обязательно придет почтовое сообщение и в самой системе нашего сайта, и на указанный вам при регистрации электронный ящик.</p><p>Для конкурса FIAP дополнительное требование - все поля регистрационной формы должны быть обязательно заполнены.</p><p>Подавая заявку на участие в любом из проводимых конкурсов, а равно и размещая фотографии в него, вы тем самым полностью соглашаетесь и с правилами сайта и с правилами (положениями) конкурса.</p><p>Для участия в заявленном на нашем сайте фотоконкурсе необходимо зарегистрироваться на нашем сайте, заполнив необходимые поля формы.</p><p>После регистрации необходимо загрузить фотографии, которые вы хотите разместить на конкурс в портфолио вашего профиля (см рисунок ниже)</p><p><img src="/system/redactor_assets/pictures/16/fotos-prophile.jpg" style="width: 762px;"></p><p>После регистрации, вы должны войти на сайт с выбранным вами именем и паролем, затем перейти в ваш профиль (правый пункт верхнего меню навигации сайта), далее - выбрать пункт "Фотографии" слева из вертикального меню профиля и нажав на кнопку "новая фотография" загрузить необходимое количество фотографий для конкурса. Прочитайте внимательно требования к фотографиям конкурса который вас заинтересовал, следуйте его правилам.</p><p>После того как вы загрузите фотографии для конкурса (или если эти фотографии вы уже ранее размещали для вашего портфолио), то вы можете переходить к созданию заявки-запроса на участие в конкурсе (в случае если конкурс закрытый, если же конкурс открытый вы можете пропустить пункт подачи заявки).</p><p>Далее вам необходимо перейти в раздел Конкурсов:</p><p><img src="/system/redactor_assets/pictures/17/men-konkurs.jpg" style="width: 380px;"></p><p>Вы попадаете в раздел с таблицей конкурсов (часть из них может быть уже закрыты). Вам будут доступны конкурсы где дата окончания приёма работ еще не наступила.</p><p><img src="/system/redactor_assets/pictures/18/tab-konkurs.jpg" style="width: 717px;"></p><p>В таблице слева - название конкурса, далее его тип (открытый или закрытый), далее даты окончания приема работ и дата открытия результатов голосования жюри. Следующая колонка показывает участвуете ли вы в этом конкурсе (если поле пустое - то вы еще не подавали заявку или она не прошла).</p><p>Для подачи заявки на конкурс необходимо нажать на иконку в строке конкурса в виде конверта. Нажав на эту иконку вы инициируете подачу заявки на конкурс и одновременно подтверждаете свое согласие с правилами сайта и с условиями и положением конкурса.</p><p>Ответ на рассмотрение заявки на закрытый конкурс вам придет письма как на внутренний ящик сайта в вашем профиле, так и на ваш электронный ящик. Ответ будет содержать сообщение либо о положительном рассмотрении заявки, либо об отрицательном с указанием причины.</p><p>В случае если конкурс открытый или ваша заявка была одобрена, вы вернувшись к списку конкурсов увидите, что в графе "Я участвую?" появится галочка, а справа от нее вместо иконки конверта появится иконка с изображением фотографии. Теперь вы можете разместить ваши фотоработы непосредственно на выбранный вами конкурс. Для этого вам следует нажать на иконку с изображением фотографии (подписанной как "загрузить фотографии".&nbsp;После выйдет диалоговое окно с кнопкой "Загрузите фотографии" (см. рис. ниже)</p><p><img src="/system/redactor_assets/pictures/21/add-foto-konkurs.jpg" style="width: 519px;"></p><p>Нажав на которую у вас откроется страница "Выбор фотографий для конкурса" , где вы сможете выбрать номинацию и разместить в соответствии с ее звучанием и правилами конкурса фотографии, нажав на ссылку 2 (см рис. ниже), поверх откроется еще одно окошко со списком ваших фотографий загруженных в портфолио (см рисунок ниже):</p><p><img src="/system/redactor_assets/pictures/19/add-foto-konkurs-2.jpg" style="width: 686px;"></p><p>Кликая на фотографии из списка вы тем самым выбираете их в данную номинацию. Они соответственно будут появляться на странице под списком. Окончив выбор фотографий необходимо нажать сперва кнопку "Сохранить", окошко верхнее тут же закроется, следом необходимо нажать на кнопку "сохранить выбор" для окончательного размещения фотографий в номинацию. (см. рис. ниже)</p><p><img src="/system/redactor_assets/pictures/20/add-foto-konkurs-3.jpg" style="width: 661px;"></p><p>С этого момента ваши фоографии начинают участвовать в фотоконкурсе проводимом &nbsp;на нашем сайте, останется лишь дождаться результатов голосования жюри и получить награды, озвученные в положении к конкурсу.</p><p>При появлении технических проблем на любом из этапов подачи фотографий на конкурс, вы можете написать администратору сайта через профиль в разделе "Тикеты", создав новое сообщение в службу поддержки. При не согласии или апелляции по решению о вашей заявке или удалению вашей фотоработы из конкурса вы можете написать письмо в системе сайта через раздел "Messages - Исходящие" добавив там новое сообщение любому из модераторов или администраторов сайта лично.</p>', NULL, 6, '<p>Подробная инструкция и правила размещения ваших фоторабот, на фотоконкурсы проводимые на нашем сайте.</p>', '2014-10-14 17:09:10', '2014-12-11 11:15:15', 'Article', 4, 'uchastie-v-foto-konkursah-na-nashem-sayte-poryadok-i-instruktsiya'),
(17, 'Пресс-конференция I Международного Фотоконкурса в Тюмени "Fixage’ 2014"', '<p><strong style="background-color: initial;"><em><br></em></strong></p><p><img src="/system/redactor_assets/pictures/53/FIAP_339061031_n.jpg"></p><p><strong style="background-color: initial;"><em>Уважаемые господа!</em></strong></p><p>  Сообщаем Вам, что Тюменский дом фотографии\r\n(ТДФ) получил право проведения международного фотоконкурса <strong>The First International Photo Contest</strong> <strong>in Tyumen (с 10.10.2014 по 31.12.2014) </strong>под Эгидой Международной\r\nфедерации фотографического искусства <strong>FIAP.</strong>\r\nК итоговой выставке будет приурочен <strong>I Открытый форум молодых фотографов\r\nТюменской области (январь-февраль 2015).</strong></p><p>  Данный факт свидетельствует о том, что\r\nуровень развития фотографии, а также деятельность ТДФ и известного в Европе тюменского\r\nклуба ФотоРегион представляет собой необходимые и достаточные условия для проведения\r\nконкурса международного уровня. Хотелось бы подчеркнуть, что на территории РФ\r\nмы станем всего третьим конкурсом из действующих, имеющий статус FIAP Auspices\r\nor Patronage (под патронажем/эгидой FIAP).</p><p>  Безусловно, в Тюменской области богатая история\r\nфотодела, однако данный конкурс – это еще и возможность рассказать на\r\nмеждународном уровне о нашем городе, регионе не только с точки зрения развития\r\nфотоискусства. Поэтому нам представляется, что к организации данного конкурса\r\nдолжны быть привлечены не только творческие сообщества, но также бизнес-сообщество.\r\nВ этой связи обращаемся ко всем заинтересованным предприятиям и организациям,\r\nчастным лицам с просьбой поддержать проведение конкурса и оказать содействие.\r\nДетали взаимодействия, полагаю, можно уточнить в рабочем порядке в Оргкомитете.\r\nВ случае необходимости готовы представить дополнительную информацию.</p><p> \r\n На сегодняшний день конкурс\r\nподдержали:</p><p>Правительство Тюменской области и\r\nАдминистрация г. Тюмени, Союз Фотохудожников России, НП «Тюменский деловой\r\nклуб», Академия Фотографии (г. Тюмень), Российское Географическое общество.\r\nСтратегический партнер – журнал «TMN». </p><p>  Пользуясь случаем, приглашаем Вас на\r\nпресс-конференцию, которая состоится <strong>29.10\r\nв 11.00, в областном Доме журналистов</strong>, организованная при содействии\r\nДепартамента информационной политики Тюменской области. На встречу заявлены\r\nспикеры:</p><p>Голоус А.В., Заместитель\r\nглавы администрации г. Тюмени (комментарии от руководителей департаментов\r\nАдминистрации);</p><p>Шакурская Ю.В., Директор\r\nдепартамента Культуры Тюменской области (согласование);</p><p>Сергей Фирцев, Председатель\r\nкоординационного совета Тюменского дома фотографии;</p><p>Ковалев Игорь, Председатель\r\nрегиональной организации Союза фотохудожников России;</p><p>Ларин Сергей Иванович,\r\nПредседатель областного отделения Русского Географического общества;</p><p>Шатохин С.М., Председатель НП\r\n«Тюменский деловой клуб».</p><p>Председатель координационного\r\nсовета </p><p>Тюменского дома фотографии&nbsp;</p><p><img src="/system/redactor_assets/pictures/23/_____________.jpg" style="width: 103px;"></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Сергей Фирцев</p><p><em>Исполнитель С.В. Манулов&nbsp;</em></p><p><em>координаты для связи</em></p><p><em>fotoexpo72@mail.ru</em></p><p style="margin-left: 20px;"><em>&nbsp; +7(3452) 99 87 55&nbsp;</em></p>', NULL, 59, '<p>Тюменский дом фотографии (ТДФ) получил право проведения международного фотоконкурса <strong style="background-color: initial;">The First International Photographic Contest</strong> <strong style="background-color: initial;">in Tyumen (с 10.10.2014 по 31.12.2014) </strong>под Эгидой Международной федерации фотографического искусства <strong style="background-color: initial;">FIAP.</strong> К итоговой выставке будет приурочен <strong style="background-color: initial;">I Открытый форум молодых фотографов Тюменской области (январь-февраль 2015).</strong></p><p>Подробности<strong>&nbsp;</strong>на пресс-конференцию, которая состоится <strong style="background-color: initial;">29.10 в 11.00, в областном Доме журналистов</strong>,</p>', '2014-10-23 15:55:57', '2014-11-21 16:28:38', 'Novelty', 4, 'press-konferentsiya-i-mezhdunarodnogo-fotokonkursa-v-tyumeni-fixage-2014'),
(18, 'The instructions for FIAP contest participation managed by the Tyumen House of Photography.', '<p><img src="/system/redactor_assets/pictures/55/article__1.jpg" style="width: 218px;"></p><p>Greetings, dear visitors!</p><p>We thank you for your being interested in our contest and hope that your participation will extend your photography skills and bring up the whole new level of imagination.</p><p><strong>Find below the instructions for FIAP contest participation managed by the Tyumen House of Photography.</strong></p><p>The photo contest under FIAP supervision is held on this site on a half closed basis because applications of the contestants may be either accepted or rejected. For the application to be accepted you have to meet all the requirements (outlined in the Terms of the Contest). Also an applicant must register on this site by filling all the fields the profile form (including "<strong>Edit profile</strong>") and pay the participation fee.</p><p>To register on our site please select “<strong>Sign up</strong>” in the top menu.&nbsp;</p><p><img src="/system/redactor_assets/pictures/30/Sign-up.jpg"></p><p>When the proper window opens fill out all fields of the form and confirm your awareness of the site’s rules.&nbsp;</p><p><img src="/system/redactor_assets/pictures/31/Sign-up-form.jpg"></p><p>You will then be emailed with your account’s activation info. Upon receiving the message (you may find it marked as spam and placed in the Spam folder of your e-mail client) click the activation link. If you’re unable to get the activation, please report it to support@domfoto72.ru</p><p>After the activation of your account succeeded, sign in by selecting “<strong>Sign in</strong>” in the top menu and entering your e-mail and password.</p><p><img src="/system/redactor_assets/pictures/32/Sign-in.jpg"></p><p>After authorization open your profile through the upper menu. Click “<strong>Edit profile</strong>” and fill in the blanks. Save it.</p><p>Enter “<strong>Photos</strong>” section of the profile.&nbsp;</p><p><img src="/system/redactor_assets/pictures/33/profile.jpg"></p><p>Add your photos following the hints of the form loaded after clicking “<strong>New photography</strong>” button.</p><p>This is how you submit photographs to participate in the Contest. Size of the images is outlined the Terms of the Contest. Please, read carefully the requirements of the Contest.</p><p>When all your photos are uploaded you may apply for the Contest. It’s strongly suggested that you pay the participation fee before application. Payments after application are also accepted. (Please inform the organizing committe on the payment details via telephone +7 9044 99 87 55 or email fotoexpo72@mail.ru)</p><p>To apply for the Contest enter “<strong>Contests</strong>” section in the top menu. Find the current FIAP Contest. You’ll also find a letter icon in the end of the contest’s title (image of the icon).&nbsp;</p><p><img src="/system/redactor_assets/pictures/35/Contesta.jpg"></p><p>By clicking the icon you apply for the Contest and agree to the rules of this site as well as the Terms of the Contest.</p><p>Under “Participate” section of the profile there will be a question mark beside the title of Contest you’ve just applied.&nbsp;</p><p><img src="/system/redactor_assets/pictures/41/Request-status-Awaiting.jpg"></p><p>The applications results will be sent both to your e-mail and your profile’s inbox. Your application will be either accepted or rejected; the cause for rejection will be explained. If accepted you may start submitting your photos for the Contest. If rejected (the question mark will be replaced by the stop sign icon at the end of the contest’s title) read carefully the cause and eliminate the discrepancies. Alternatively, you may contact the Contest’s administration through e-mail or tickets and appeal for reconsideration.</p><p><img src="/system/redactor_assets/pictures/42/Request-status-Stop.jpg"></p><p>After your application has been approved the letter icon will be replaced by the image icon. The question mark will removed from the Content''s title. The "Participation" field will remain empty until submission of the photos.</p><p><img src="/system/redactor_assets/pictures/43/Request-status-Ok.jpg"></p><p>When the image icon is clicked you will be prompted to the upload section.&nbsp;Press the "<strong>Load photos</strong>" button.&nbsp;</p><p><img src="/system/redactor_assets/pictures/44/Load-fotos-start.jpg"></p><p>At the next screen select a nomination (1) and click the link (2) to choose a photo. Only the photos from your portfolio are eligible for submission.</p><p><img src="/system/redactor_assets/pictures/46/choose-photos.jpg"></p><p> The next screen will display your portfolio photos; you choose submission photos by selecting them.&nbsp;</p><p><img src="/system/redactor_assets/pictures/50/choose-photos-clixk.jpg"></p><p>The selection will also appear at the bottom of the screen. When finished click "<strong>Save</strong>". The screen will close. Click "<strong>Save choosen</strong>" to finalize submission.</p><p><img src="/system/redactor_assets/pictures/51/Save-Choosen.jpg"></p><p>This procedure applies for all nominations. The number of nominations depends on your payment.</p><p>After submitting your photos the "Participate" section will have a check sign meaning you''re now a Contest''s participant.</p><p><img src="/system/redactor_assets/pictures/52/Request-status-Yes.jpg"></p><p>If you have any problem submitting your photos please contact us through "Tickets" section of the profile by sending a message to technical support.</p>', NULL, 6, '<p>Submission guidelines.&nbsp;</p>', '2014-11-15 09:04:03', '2014-12-24 06:14:05', 'Article', 3, 'the-instructions-for-fiap-contest-participation-managed-by-the-tyumen-house-of-photography'),
(19, 'The 1st International Photography Contest Fixage''2014 is open!', '<p>\r\n	<img src="/system/redactor_assets/pictures/25/FIAP-1-2014.jpg"></p><p>\r\n	Dear Colleagues!</p><p>\r\n	The Organizing Committee of the Ist International Photography&nbsp;Contest "Fixage''2014". FIAP, welcomes all connoisseurs and admirers of photography. After the press-conference, final preparations have now been completed. Now everything is up to you! We invite you to register in order to participate in the Contest.</p><p>\r\n	Considering that this is the first&nbsp;Contest, we have tried to keep the nomiations simple and easily understandable. Nontheless, strict jury will be making sure that the level of submissions is high and will score them in an objective manner. At the same time, we would like to remind young photographers, that a special Debut prize has been introduced. Please, read the&nbsp;Contest&nbsp;Rules to learn about this and about other important details. In case of any questions, please, feel free to send them to the Organizing Committee.</p><p>\r\n	Good luck to everyone!!</p><p>\r\n	<a href="http://domfoto72.ru/en/competitions/iy-mezhdunarodnyy-fotokonkurs-tyumen-2014#engl">Contest&nbsp;rules</a> &nbsp;&nbsp;<a href="http://domfoto72.ru/en/users/sign_up">Sign up</a> &nbsp;&nbsp;<a href="http://domfoto72.ru/en/articles/the-instructions-for-fiap-contest-participation-managed-by-the-tyumen-house-of-photography">Submission guidelines</a> &nbsp;<a href="http://patronages.fiap.net/auspices-2014.html">FIAP link</a></p><hr>\r\n<p>\r\n	Уважаемые коллеги!</p><p>\r\n	Оргкомитет I Международного фотоконкурса "Fixage’2014", под эгидой FIAP, приветствует всех любителей\r\nи поклонников фотографии. С момента проведения пресс-конференции закончены\r\nпоследние приготовления. Сейчас слово за Вами! Приглашаем пройти регистрацию\r\nдля участия в конкурсе. Учитывая, что конкурс первый, мы постарались, чтобы\r\nноминации были просты и понятны. Но строгое жюри будет следить за высоким\r\nуровнем работ и объективно их оценивать. Вместе с тем, обращаем внимание, что\r\nдля молодых фотографов введен специальный приз «Дебют». Об этом и другие подробности\r\nчитайте в Положении о конкурсе на сайте. По всем вопросам обращайтесь в\r\nОргкомитет.</p><p>\r\n	Удачи Всем!</p><p><a href="http://domfoto72.ru/ru/competitions/iy-mezhdunarodnyy-fotokonkurs-tyumen-2014">Положение о конкурсе</a><br><a href="http://domfoto72.ru/ru/users/sign_up">Регистрация на сайте</a><br><a href="http://domfoto72.ru/ru/articles/instruktsiya-po-uchastiyu-v-konkurse-fiap-provodimom-tyumenskim-domom-fotografii">Правила размещения работ на конкурс</a></p>', NULL, 6, '<p>1й Международный фотоконкурс Fixage’2014 открыт!</p>', '2014-11-15 09:34:35', '2014-12-18 13:50:42', 'Novelty', 4, 'i-mezhdunarodnyy-fotokonkurs-fixage-2014-otkryt'),
(20, 'Инструкция: порядок действий для регистрации на конкурс FIXAGE''2014 под эгидой FIAP', '<p>Мы рады приветствовать Вас на страницах нашего сайта.&nbsp;</p><p><strong>Ниже приведены простые инструкции для участия в конкурсе FIAP, проводимого Тюменским домом фотографии.</strong><br>Благодарим вас за интерес к нашему конкурсу! Надеемся на то, что участие в нашем конкурсе даст вам заряд на дальнейшее развитие вашего мастерства и откроет новые уровни вашего вдохновения!<br><br>Фотоконкурс под эгидой FIAP проводится на нашем сайте в условно закрытом режиме. Связано это с тем, что заявки конкурсантов будут рассматриваться и одобряться или же отклоняться. Для одобрения заявки необходимо выполнить все пункты условия участия в конкурсе (опубликованные в положении о конкурсе), обязательно зарегистрироваться на нашем сайте, заполнить все поля в разделе &nbsp;"<strong>Личные данные</strong>" и оплатить участие.<br><br>Для регистрации на нашем сайте в верхнем меню выберите пункт «<strong>Регистрация</strong>».&nbsp;</p><p><img src="/system/redactor_assets/pictures/26/Sign-up-RU.jpg"></p><p>В открывшемся окне — заполните все поля и соглашаетесь с правилами сайта.</p><p><img src="/system/redactor_assets/pictures/27/Sign-up-form-RU.jpg"></p><p><br>После вам на электронную почту будет выслано письмо с активацией вашей учетной записи на сайте. Пожалуйста откройте это письмо (возможно оно будет лежать в почте в разделе «Спам») и перейдите по указанной там ссылке для активации. Если вы прошли полностью регистрацию, но письма не получили, то пожалуйста, напишите нам об этом на адрес: <a href="mailto:support@domfoto72.ru">support@domfoto72.ru</a><br><br>После активации вашего аккаунта — авторизуйтесь на сайте зайдя в пункт «<strong>Войти</strong>» верхнего меню сайта. Для входа введите в указанные поля ваш электронный адрес и пароль.</p><p><img src="/system/redactor_assets/pictures/28/Sign-in-RU.jpg"></p><p><br>После авторизации зайдите в свой профиль, нажав на соответствующий пункт верхнего меню. В профиле выберите раздел «<strong style="background-color: initial;">Личные данные</strong>» и заполните там все пустые поля формы. Сохраните.</p><p><br>Далее перейдите в профиле в раздел «<strong>Фотографии</strong>».&nbsp;</p><p><img src="/system/redactor_assets/pictures/29/profile-RU.jpg"></p><p>Добавьте нужно вам количество фотоизображений следуя подсказкам формы, которая появляется после нажатия кнопки «<strong>Новая фотография</strong>». Таким образом вы загрузите на сайт все изображения которые собираетесь отправлять на наш конкурс. Размер изображений указан в положении о конкурсе. Пожалуйста в точности соблюдайте требования конкурса.<br><br>После того, как вы загрузите все изображения в свой профиль, можете подать заявку на участие в конкурсе. Важно, что оплату участия оптимальнее сделать до подачи заявки на сайте, хоть допустим и обратный порядок. <br><br>Для размещения заявки на конкурс перейдите в раздел «<strong>Конкурсы</strong>» в верхнем меню. <br>Среди конкурсов в таблице найдите текущий конкурс FIAP.&nbsp;</p><p>В конце строки с конкурсом вы найдете иконку в виде конвертика размещения заявки — нажмите его (см. рисунок).&nbsp;</p><p><img src="/system/redactor_assets/pictures/36/Contesta-RU.jpg"></p><p> Нажав на эту иконку вы инициируете подачу заявки на конкурс и одновременно подтверждаете свое согласие с правилами сайта и с условиями и положением конкурса.&nbsp;</p><p>В таблице конкурсов в графе «Участие», в строке конкурса, появится значок с вопросительным знаком.&nbsp;</p><p><img src="/system/redactor_assets/pictures/37/Request-status-Awaiting-RU.jpg"></p><p>Ответ на рассмотрение заявки на закрытый конкурс вам придет письма как на внутренний ящик сайта в вашем профиле, так и на ваш электронный ящик. Ответ будет содержать сообщение либо о положительном рассмотрении заявки, либо об отрицательном с указанием причины.  Получив такие сообщения, в случае положительного рассмотрения, вы можете начать размещение фотоизображений на конкурс.&nbsp;</p><p>Если вам отказано в регистрации — прочитайте причину, и по возможности постарайтесь ее исправить. Вместо значка с вопросительным знаком появится значок «проезд запрещен». Либо свяжитесь через тикеты или по электронной почте с администрацией конкурса для апелляции. Убедитесь, что конкурс вами оплачен и что вы сообщили об этом на указанный в положении адрес, указав все реквизиты платежа.</p><p><img src="/system/redactor_assets/pictures/38/Request-status-Stop-RU.jpg"></p><p>После одобрения вашей заявки вместо иконки с конвертом появится иконка с изображением фотографии. Значок с вопросительным знаком исчезнет из строки конкурса и до размещения фотографий, поле в графе «Участие» будет оставаться пустым.&nbsp;</p><p><img src="/system/redactor_assets/pictures/39/Request-status-Ok-RU.jpg"></p><p>Нажав на иконку с изображением фотографии вы попадете на страницу загрузки фотографий (см. рисунок).</p><p>На этой страничке вы видите кнопку «<strong>Загрузить фотографии</strong>», нажмите ее.&nbsp;</p><p><img src="/system/redactor_assets/pictures/40/Load-fotos-start-RU.jpg"></p><p>В следующем окне выберите номинацию, в которую вы хотите загрузить фотографии и нажмите ссылку "Выберите фотографии".&nbsp;</p><p><img src="/system/redactor_assets/pictures/45/choose-photos-RU.jpg"></p><p>Фотографии для размещения в конкурсе будут выбираться только из вашего портфолио. откроется еще одно окошко со списком ваших фотографий загруженных в портфолио (см рисунок).</p><p><img src="/system/redactor_assets/pictures/47/choose-photos-clixk-RU.jpg"></p><p>Кликая на фотографии из списка вы тем самым выбираете их в данную номинацию. Они соответственно будут появляться на странице под списком.&nbsp;</p><p>Окончив выбор фотографий необходимо нажать сперва кнопку "<strong>Сохранить</strong>", окошко верхнее тут же закроется, следом необходимо нажать на кнопку "<strong>сохранить выбор</strong>" для окончательного размещения фотографий в номинацию. (см. рис.) </p><p><img src="/system/redactor_assets/pictures/48/Save-Choosen-RU.jpg"></p><p>Так же проделайте для всех тех номинаций в которых вы решили участвовать. </p><p>Количество номинаций доступных вам для загрузки фотографий вы выбираете оплачивая участие в конкурсе.</p><p>После размещения фотографий на конкурс, в графе «Участие» появится галочка — с этого момента вы участвуете на конкурсе.</p><p><img src="/system/redactor_assets/pictures/49/Request-status-Yes-RU.jpg"></p><p>При появлении технических проблем на любом из этапов подачи фотографий на конкурс, вы можете написать администратору сайта через профиль в разделе "Тикеты", создав новое сообщение в службу поддержки.&nbsp;</p>', NULL, 6, '<p>Простые инструкции для участия в конкурсе FIAP</p>', '2014-11-15 09:50:41', '2014-12-24 06:18:30', 'Article', 3, 'instruktsiya-po-uchastiyu-v-konkurse-fiap-provodimom-tyumenskim-domom-fotografii'),
(21, 'У нашего фотоконкурса появился новый партнер - журнал Foto&Video', '<p>\r\n	Уважаемые господа, Оргкомитет рад приветствовать нового Партнера нашего конкурса!</p><p>\r\n	Журнал Foto&Video является единственным ежемесячным печатным журналом о фотографии в России. Издается с 1997 года московским издательским домом «КАТМАТ». C 1998 года Foto&Video состоит в ассоциации европейских журналов EISA (European Imaging and Sound Association), которая называет «модели года» — фото-, видео- и аудиотехнику с выдающимися характеристиками. Аудитория журнала — продвинутые фотолюбители. В публикациях Foto&Video сбалансированно представлены технический, творческий и практический аспекты фотографии. Номера журнала выходят как в печатной, так и в электронной форме. Сайт Foto&Video:&nbsp;<a href="http://www.foto-video.ru">www.foto-video.ru</a></p><p>\r\n	 Foto&Video is the only Russian monthly printed magazine about photography and photo techniques. KATMAT Publishing House from Moscow has been publishing Foto&Video since 1997. Foto&Video is a member of EISA (European Imaging and Sound Association) since 1998. Every year EISA representatives define the best models in photo, video and audio equipment. The readers of the magazine are advanced photo amateurs. The content of Foto&Video is balanced with technical, art and practical information. The issues of the magazine have as offline as online versions. The website of Foto&Video:&nbsp;<a href="http://www.foto-video.ru">www.foto-video.ru</a></p><p><img src="/system/redactor_assets/pictures/54/image_FOTO_VIDEO.jpg"></p>', NULL, 6, '<p>Оргкомитет рад приветствовать нового Партнера нашего конкурса!</p>', '2014-12-11 10:59:26', '2014-12-11 10:59:26', 'Novelty', 3, 'u-nashego-fotokonkursa-poyavilsya-novyy-partner-zhurnal-foto-video'),
(22, 'Изменение сроков подачи заявок на конкурс 1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP', '<p><img src="/system/redactor_assets/pictures/58/FIAP-1-2014.jpg" style="width: 214px;">&nbsp;</p><p>Внимание!&nbsp;Изменение сроков подачи заявок на конкурс&nbsp;<strong>1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP</strong>! Оргкомитет конкурса по согласованию с FIAP объявляет о продлении приема работ к участию до 15 января 2015 года включительно.</p>', NULL, 6, '<p>Внимание! Изменение сроков подачи заявок! Оргкомитет конкурса по согласованию с FIAP объявляет о продлении приема работ к участию до 15 января 2015 года включительно.</p>', '2014-12-23 17:02:45', '2014-12-23 17:02:45', 'Novelty', 3, 'izmenenie-srokov-podachi-zayavok-na-konkurs-1st-international-photography-contest-in-tyumen-fixage-2014-fiap'),
(23, 'We are changing deadline for applications of the1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP!', '<p><img src="/system/redactor_assets/pictures/59/FIAP-1-2014.jpg" style="width: 214px;"></p><p>Attention! We are changing deadline for applications of the1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP!&nbsp;The&nbsp;contest`s&nbsp;Organising Committee&nbsp;in coordination with the FIAP announce the extension of the reception of works to participate until January 15, 2015.</p>', NULL, 6, '<p>Attention! The contest`sOrganising Committee in coordination with the FIAP announce the extension of the reception of works to participate until January 15, 2015.</p>', '2014-12-23 17:31:23', '2014-12-23 17:32:38', 'Novelty', 3, 'we-are-changing-deadline-for-applications-of-the1st-international-photography-contest-in-tyumen-fixage-2014-fiap'),
(24, 'КОНКУРС «МОЛОДЫЕ ФОТОГРАФЫ РОССИИ-2015»', '<p><img src="/system/redactor_assets/pictures/60/N_1418032528.jpg" style="width: 131px;"></p><p><strong>Союз фотохудожников России объявляет о начале нового конкурса «Молодые фотографы России-2015» и приглашает авторов в возрасте до 35 лет стать его участниками. </strong></p><p>К участию в конкурсе приглашаются профессиональные фотографы и фотолюбители - ГРАЖДАНЕ РОССИЙСКОЙ ФЕДЕРАЦИИ! Возраст участников – от 18 до 35 лет включительно.</p><p><a href="http://www.photounion.ru/Show_News.php?nnum=943" target="_blank">Подробнее читайте здесь</a></p>', NULL, 6, '<p><strong style="background-color: initial;">Союз фотохудожников России объявляет о начале нового конкурса «Молодые фотографы России-2015»</strong></p>', '2014-12-24 09:31:24', '2015-01-15 19:24:24', 'Novelty', 3, 'konkurs-molodye-fotografy-rossii-2015'),
(25, 'Закрыт прием работ на конкурс фотографии  Ist International Photography Contest "Fixage''2014". FIAP', '<p><img src="/system/redactor_assets/pictures/61/FIAP-1-2014.jpg" style="width: 327px;"></p><p>Уважаемые дамы и господа, коллеги!</p><p>Поздравляем всех участников I Международного фотоконкурса в Тюмени FixAge''2014 под эгидой FIAP.<br>Желаем Всем удачи. А беспристрастное жюри проголосует за тех, кто в этот раз оказался лучше. До встречи на итоговой выставке, которая состоится 05 февраля в Музее Изо в г.Тюмени. Следите за анонсами.</p><p>До скорой встречи.</p><p>Председатель Оргкомитета,&nbsp;Сергей Фирцев</p>', NULL, 59, '<p>Поздравляем всех участников I Международного фотоконкурса в Тюмени FixAge''2014 под эгидой FIAP.</p>', '2015-01-15 19:09:50', '2015-01-15 19:13:11', 'Novelty', 3, 'zakryt-priem-rabot-na-konkurs-fotografii-ist-international-photography-contest-fixage-2014-fiap'),
(26, 'Приглашаем на Форум молодых фотографов Сибири и Южного Урала.', '<p><img src="/system/redactor_assets/pictures/62/Campus_n.jpg" style="width: 367px; background-color: initial;"></p><p>Форум молодых фотографов открывается в день итоговой выставки 1 Международного конкурса в Тюмени под Эгидой FIAP.</p><p>Событие намечено на январь-февраль 2015 года.</p><p>Форум проводится при поддержке городской администрации и включит в себя выставки, мастер-классыпо фотографии, дискуссии, показы фильмов по искусству.&nbsp;</p><p>Следите за нашими новостями!</p>', NULL, 6, '<p>Событие намечено на январь-февраль 2015 года.</p>', '2015-01-15 19:22:46', '2015-02-04 09:14:34', 'Novelty', 3, 'priglashaem-na-forum-molodyh-fotografov-sibiri-i-yuzhnogo-urala'),
(27, 'Приглашаем пройти курс творческой фотографии.', '<p>Глубокое погружение в фотографию! Приглашаем 27 января в 19:00 в группу 2-го курса "Композиция в творческой фотографии. Теория и практика". В основе курса - теория композиции. Искусство фотографии в примерах различных жанров. Успевайте присоединиться к нам! Телефон 788-555. Сайт: <a href="http://vk.com/away.php?to=http%3A%2F%2Fshkola.gf72.ru%2Fpub.php%3Fid%3D373&post=105388652_3183">http://shkola.gf72.ru/pub.php?id=373</a></p><p><img src="/system/redactor_assets/pictures/63/GF_style4.jpg" style="width: 97px;"></p>', NULL, 6, '<p>27 января в 19:00 стартует группа 2-го курса "Композиция в творческой фотографии. Теория и практика". Присоединяйтесь!</p>', '2015-01-16 08:04:45', '2015-01-16 08:05:30', 'Novelty', 5, 'priglashaem-proyti-kurs-tvorcheskoy-fotografii');
INSERT INTO `posts` (`id`, `title`, `content`, `published`, `user_id`, `digest`, `created_at`, `updated_at`, `type`, `age_policy_id`, `slug`) VALUES
(28, 'Определены победители конкурса "1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP"', '<p>\r\n	<img src="/system/redactor_assets/pictures/69/FIAP-1-2014.jpg" style="width: 319px;">\r\n</p>\r\n<p>\r\n	Вот и подошел к концу наш первый международный конкурс "1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP".&nbsp;\r\n</p>\r\n<p>\r\n	С чувством удовлетворения могу сказать, что конкурс удался. Да, это был наш первый, дебютный, конкурс, под эгидой FIAP. И мы справились, хоть были моменты когда казалось, что мы опростоволосимся, но всё хорошо закончилось и мы рады, что мы смогли собрать такие замечательные работы, смотреть и оценивать которые было весьма приятно.\r\n</p>\r\n<p>\r\n	С благодарностью поздравляю победителей нашего конкурса! И теперь позвольте их вам представить.\r\n</p>\r\n<p>\r\n	<strong>Золото FIAP:</strong>\r\n</p>\r\n<p>\r\n	<strong>За первое место в номинации "Свободная тема (черно-белая фотография); цифра (A)</strong><strong>"</strong>\r\n</p>\r\n<p>\r\n	<strong>Оля Елесина </strong>с фотоработой "Утро в деревне"\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/64/normal_Ru_Olga_Elesina_Morning_in_the_village_A.jpg" style="width: 413px;">\r\n</p>\r\n<p>\r\n	<strong>За первое место в номинации "Свободная тема (цветная фотография); цифра (B)"</strong>\r\n</p>\r\n<p>\r\n	<strong>Лялин Дмитрий</strong> с фотоработой "Человек"\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/65/normal_Ru_Dmitry_Lyalin_A__Man_B.jpg" style="width: 415px;">\r\n</p>\r\n<p>\r\n	<strong>За первое место в номинации "Мой любимый город. Виды городов. ЧБ; цифра (C)"</strong>\r\n</p>\r\n<p>\r\n	<strong>Ajuriaguerra Saiz Pedro Luis</strong> с фотоработой "Niemeyer 26-ABN"\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/66/normal_Es_Pedro_Luis_Ajuriaguerra_Niemeyer_26-ABN_C.jpg" style="width: 414px;">\r\n</p>\r\n<p>\r\n	<strong>За первое место в номинации "Мой любимый город. Виды городов. Цвет; цифра (D)</strong><strong>"</strong>\r\n</p>\r\n<p>\r\n	<strong>Грачёв Оле</strong>г&nbsp;с фотоработой "Morning in Bagan"\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/67/normal_RU_OLEG_GRACHEV_MORNING_-IN_-BAGAN._D.jpg" style="width: 406px;">\r\n</p>\r\n<p>\r\n	<strong>За первое место в номинации "Классическая фотография на свободную тему.&nbsp;Бумага. (F)"</strong>\r\n</p>\r\n<p>\r\n	<strong>Виталий Нестеренко</strong> с фотоработой "Boats"\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/68/normal_Ru_Vitaliy_Nesterenko_Boats.jpg" style="width: 406px;">\r\n</p>\r\n<p>\r\n	Подробнее результаты голосования можно посмотреть по этому адресу:&nbsp;\r\n	<a href="http://domfoto72.ru/ru/competitions/iy-mezhdunarodnyy-fotokonkurs-tyumen-2014/results_nominations">Результаты голосования</a>\r\n</p>\r\n<hr>\r\n<p>\r\n	Дополнительно учреждены специальные призы в перечисленных номинациях 1й и 2й степени.\r\n</p>\r\n<p>\r\n	<strong><br>\r\n	</strong>\r\n</p>\r\n<p>\r\n	<strong>"Свободная тема (черно-белая фотография); цифра (A)</strong><strong>"</strong>\r\n</p>\r\n<p>\r\n	<strong>1я степень: Алина Киселева&nbsp;</strong>с фотоработой "Линии"\r\n</p>\r\n<p>\r\n	<strong>2я степень:&nbsp;</strong><strong>PADILLA GONZALO</strong><strong style="background-color: initial;">&nbsp;</strong>с фотоработой "TENAUM"\r\n</p>\r\n<p>\r\n	<strong><br>\r\n	</strong>\r\n</p>\r\n<p>\r\n	<strong>"Свободная тема (цветная фотография); цифра (B)"</strong>\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">1я степень: Кирилл Сыропятов&nbsp;</strong>с фотоработой "Два фронта"\r\n</p>\r\n<p>\r\n	<strong>2я степень:&nbsp;</strong><strong>Milovanovic Borislav</strong><strong style="background-color: initial;">&nbsp;</strong>с фотоработой "Lost in Mist"\r\n</p>\r\n<p>\r\n	<strong><br>\r\n	</strong>\r\n</p>\r\n<p>\r\n	<strong>"Мой любимый город. Виды городов. ЧБ; цифра (C)"</strong>\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">1я степень:&nbsp;</strong><strong>Milovanovic Borislav</strong><strong style="background-color: initial;">&nbsp;</strong>с фотоработой "Smelting Plant 31"\r\n</p>\r\n<p>\r\n	<strong>2я степень:&nbsp;</strong><strong style="background-color: initial;">Milovanovic Borislav</strong><strong style="background-color: initial;">&nbsp;</strong>с фотоработой "Uncle Rasa"\r\n</p>\r\n<p>\r\n	<strong><br>\r\n	</strong>\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">"Мой любимый город. Виды городов. Цвет; цифра (D)</strong><strong style="background-color: initial;">"</strong>\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">1я степень: Дмитрий Ильин&nbsp;</strong>с фотоработой "Береза в городе"\r\n</p>\r\n<p>\r\n	<strong>2я степень: Бочкарев Михаил&nbsp;</strong>с фотоработой "Настроение города"\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;"><br>\r\n	</strong>\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">"Классическая фотография на свободную тему. Бумага. (F)"</strong>\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">1я степень: Молодкин Александр&nbsp;</strong>с фотоработой без названия\r\n</p>\r\n<p>\r\n	<strong>2я степень:&nbsp;</strong><strong style="background-color: initial;">Молодкин Александр</strong><strong style="background-color: initial;">&nbsp;</strong>с фотоработой без названия\r\n</p>', NULL, 6, '<p>Завершен конкурс фотографии "1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP". Поздравляем призеров с их достойной победой!</p>', '2015-02-01 17:08:45', '2015-04-01 14:46:13', 'Novelty', 3, 'opredeleny-pobediteli-konkursa-1st-international-photography-contest-in-tyumen-fixage-2014-fiap'),
(29, 'The winners of the contest "1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP"', '<p>\r\n	<img src="/system/redactor_assets/pictures/75/FIAP-1-2014.jpg" style="width: 303px;">\r\n</p>\r\n<p>\r\n	That came to an end of our first international competition "1st International Photography Contest in Tyumen" Fixage ''2014 ". FIAP".\r\n</p>\r\n<p>\r\n	With a feeling of satisfaction I can say that the competition was a success. Yes, it was our first debut, competition, under the auspices of FIAP. And we did, even though there were moments when it seemed that we goof, but all ended well and we are pleased that we were able to collect such wonderful work, watch and evaluate which was very nice.\r\n</p>\r\n<p>\r\n	With thanks to congratulate the winners of our contest! And now let me introduce them to you.\r\n</p>\r\n<p>\r\n	<strong>Gold medal FIAP:</strong>\r\n</p>\r\n<p>\r\n	<strong>&nbsp;</strong>\r\n</p>\r\n<p>\r\n	<strong>For first place in the Section "Free theme – black&white digital photography (A)"</strong>\r\n</p>\r\n<p>\r\n	<strong>Olya Elesina</strong> with Photo "Morning in the village"\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/70/normal_Ru_Olga_Elesina_Morning_in_the_village_A.jpg" style="width: 381px;">\r\n</p>\r\n<p>\r\n	<strong>For first place in the Section "Free theme – color digital photography (B)"</strong>\r\n</p>\r\n<p>\r\n	<strong>Dmitry Lialin</strong>&nbsp;with Photo "Man"\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/71/normal_Ru_Dmitry_Lyalin_A__Man_B.jpg" style="width: 376px;">\r\n</p>\r\n<p>\r\n	<strong>For first place in the Section "</strong><strong>My favorite city. Views of the cities</strong><strong style="background-color: initial;">&nbsp;– black&white digital photography (C)"</strong>\r\n</p>\r\n<p>\r\n	<strong>Ajuriaguerra Saiz Pedro Luis</strong> with Photo "Niemeyer 26-ABN"\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/72/normal_Es_Pedro_Luis_Ajuriaguerra_Niemeyer_26-ABN_C.jpg" style="width: 374px;">\r\n</p>\r\n<p>\r\n	<strong>For first place in the Section "</strong><strong style="background-color: initial;">My favorite city. Views of the cities</strong><strong style="background-color: initial;">&nbsp;– color digital photography (D)"</strong>\r\n</p>\r\n<p>\r\n	<strong>Oleg Grachev</strong> with Photo "Morning in Bagan"\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/73/normal_RU_OLEG_GRACHEV_MORNING_-IN_-BAGAN._D.jpg" style="width: 372px;">\r\n</p>\r\n<p>\r\n	<strong>For first place in the Section "</strong><strong>Free theme classic analog photography&nbsp;</strong><strong style="background-color: initial;">– black&white print photography</strong><strong>&nbsp;</strong><strong style="background-color: initial;">(F)"</strong>\r\n</p>\r\n<p>\r\n	<strong>Vitaliy Nesterenko</strong> with Photo "Boats"\r\n</p>\r\n<p>\r\n	<img src="/system/redactor_assets/pictures/74/normal_Ru_Vitaliy_Nesterenko_Boats.jpg" style="width: 375px;">\r\n</p>\r\n<p>\r\n	More voting results can be found at this link:&nbsp;<a href="http://domfoto72.ru/en/competitions/iy-mezhdunarodnyy-fotokonkurs-tyumen-2014/results_nominations">Voting results</a>\r\n</p>\r\n<hr>\r\n<p>\r\n	Additionally, special prizes in these sections 1st and 2nd degree.\r\n</p>\r\n<p>\r\n	<strong>"</strong><strong style="background-color: initial;">Free theme – black&white digital photography (A)</strong><strong style="background-color: initial;">"</strong>\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">1st degree</strong><strong>: Alina Kiseleva&nbsp;</strong>with Photo&nbsp;"Lines"\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">2st degree</strong><strong>: </strong><strong>PADILLA GONZALO&nbsp;</strong>with Photo&nbsp;"TENAUM"\r\n</p>\r\n<p>\r\n	<strong><br>\r\n	</strong>\r\n</p>\r\n<p>\r\n	<strong>"</strong><strong style="background-color: initial;">For first place in the Section "Free theme – color digital photography (B)</strong><strong style="background-color: initial;">"</strong>\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">1st degree</strong><strong>:&nbsp;</strong><strong>Cyril Syropyatov</strong> with Photo "Two fronts"\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">2st degree</strong><strong>: </strong><strong>Milovanovic Borislav&nbsp;</strong>with Photo&nbsp;"Lost in Mist"\r\n</p>\r\n<p>\r\n	<strong><br>\r\n	</strong>\r\n</p>\r\n<p>\r\n	<strong>"</strong><strong style="background-color: initial;">My favorite city. Views of the cities</strong><strong style="background-color: initial;"> – black&white digital photography (C)</strong><strong style="background-color: initial;">"</strong>\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">1st degree</strong><strong>: </strong><strong>Milovanovic Borislav&nbsp;</strong>with Photo&nbsp;"Smelting Plant 31"\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">2st degree</strong><strong>: </strong><strong>Milovanovic Borislav&nbsp;</strong>with Photo&nbsp;"Uncle Rasa"\r\n</p>\r\n<p>\r\n	<strong><br>\r\n	</strong>\r\n</p>\r\n<p>\r\n	<strong>"</strong><strong style="background-color: initial;">My favorite city. Views of the cities</strong><strong style="background-color: initial;"> – color digital photography (D)</strong><strong style="background-color: initial;">"</strong>\r\n</p>\r\n<p>\r\n	<strong>1я степень:&nbsp;</strong><strong>Dmitry Ilyin</strong> with Photo "Birch in the city"\r\n</p>\r\n<p>\r\n	<strong style="background-color: initial;">2st degree</strong><strong>:&nbsp;</strong><strong>Mikhail Bochkarev</strong> with Photo "The mood of the city"\r\n</p>\r\n<p>\r\n	<strong><br>\r\n	</strong>\r\n</p>\r\n<p>\r\n	<strong>"</strong><strong style="background-color: initial;">Free theme classic analog photography </strong><strong style="background-color: initial;">– black&white print photography</strong><strong style="background-color: initial;">(F)</strong><strong style="background-color: initial;">"</strong>\r\n</p>\r\n<p>\r\n	<strong>1st degree: Alexander Molodkin</strong> with Photo: untitled\r\n</p>\r\n<p>\r\n	<strong>2st degree: Alexander Molodkin</strong> with Photo: untitled\r\n</p>', NULL, 6, '<p>Completed Photography Contest "1st International Photography Contest in Tyumen" Fixage ''2014 ". FIAP". Congratulations to winners of their decent victory!</p>', '2015-02-01 18:46:29', '2015-02-01 18:52:22', 'Novelty', 3, 'the-winners-of-the-contest-1st-international-photography-contest-in-tyumen-fixage-2014-fiap'),
(30, 'Открытие фотовыставки "1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP".', '<p>10 февраля 2015 года, в тюменском музее ИЗО состоится грандиознейшее событие - открытие итоговой выставки по результатам международного фотоконкурса под эгидой ФИАП, который впервые был проведён в Тюмени! Открытие в 16:30. Вход свободный. Выставка будет экспонироваться до 1 марта 2015 года.</p><p>Внимание, награждение будет проведено отдельным мероприятием, назначенным на 20 февраля. Мы дополнительно оповестим о точном времени и месте награждения на страницах нашего сайта.</p><p><img src="/system/redactor_assets/pictures/76/10978638_1592867204261665_8926123885355008359_n.jpg"></p><p><em>фото Александра Засекина</em></p><p><em><br></em></p><p><em><br></em></p><p><img src="/system/redactor_assets/pictures/77/10010560_798537013533243_4041952331366419142_o.jpg" style="width: 657px;"></p>', NULL, 6, '<p>10 февраля состоится открытие итоговой фотовыставки&nbsp;"1st International Photography Contest in Tyumen "Fixage’ 2014". FIAP".&nbsp;</p>', '2015-02-09 16:50:57', '2015-02-10 17:50:59', 'Novelty', 3, 'otkrytie-fotovystavki-1st-international-photography-contest-in-tyumen-fixage-2014-fiap'),
(31, 'Программа 1го открытого форума молодых фотографов Тюменской области PhotoCampus in Tyumen Fixage’2015', '<p><img src="/system/redactor_assets/pictures/78/Campus_n.jpg" style="width: 600px;"></p><p>Форум молодых фотографов продолжает цикл мероприятий Тюменского дома фотографии, организованных под эгидой FIAP</p><p><a href="https://vk.com/event86418724">Группа в Контакте</a></p><h3>Программа</h3><p>Тюмень, Червишевский\r\nтракт, 15/1, Городская юношеская библиотека</p><table>\r\n <tbody><tr>\r\n  <td><strong>Дата/время</strong></td>\r\n  <td><strong>Мероприятие</strong></td>\r\n  <td><strong>Место/ комментрии</strong></td>\r\n </tr>\r\n <tr>\r\n  <td><strong>20.02.2015</strong>\r\n  <p>09.00-10.00</p></td>\r\n  <td>Регистрация участников. Запись на рабочие площадки</td>\r\n  <td>Городская юношеская библиотека (фойе)</td>\r\n </tr>\r\n <tr>\r\n  <td>09.30-10.30</td>\r\n  <td>Награждение победителей конкурса школьников\r\n  образовательных учреждений г.Тюмени приуроченного к конкурсу \r\n  <p><strong>FixAge’2014 под эгидой </strong><strong>FIAP</strong></p>\r\n  <p>Открытие выставки 50 лучших работ конкурса «Дебют»</p></td>\r\n  <td>Городская юношеская библиотека (многофункциональный зал)</td>\r\n </tr>\r\n <tr>\r\n  <td>11.00-12.00</td>\r\n  <td>Секция «Фотография как часть социально-значимых проектов»\r\n  <p>Ответственный: Сергей Фирцев. Презентации:</p>\r\n  <p>Алина Иноземцева, проект «Ксюша», о детях аутистах <br>\r\n  Объединение «Кровь во имя жизни», проект с Гематологическим центром<br>\r\n  Денис Моргунов, проект «Вахта памяти», к 70-летию Победы в ВОВ</p></td>\r\n  <td>Городская юношеская библиотека (лекционный зал) \r\n  \r\n  <p>Перерыв 15минут на кофе-брейк (отдел краеведения)</p></td>\r\n </tr>\r\n <tr>\r\n  <td>12.00-13.00</td>\r\n  <td>Общее организационное собрание участников. Ответы на\r\n  вопросы</td>\r\n  <td>Городская юношеская библиотека (лекционный зал)</td>\r\n </tr>\r\n <tr>\r\n  <td>13.00</td>\r\n  <td><strong>Индивидуальные  консультации с мастерами*</strong></td>\r\n  <td></td>\r\n </tr>\r\n <tr>\r\n  <td><strong>21.02.2015</strong>\r\n  <p>09.30-11.00</p></td>\r\n  <td>\r\n  <p>Регистрация. Портфолио-ревю</p></td>\r\n  <td>Городская юношеская библиотека (отдел краеведения,\r\n  многофункциональный зал)</td>\r\n </tr>\r\n <tr>\r\n  <td>11.30-12.45</td>\r\n  <td>Просмотр Фильмов о фото-деле и фотоискусстве</td>\r\n  <td>Городская юношеская библиотека (лекционный зал)</td>\r\n </tr>\r\n <tr>\r\n  <td>13.00-14.30.</td>\r\n  <td>Перерыв на обед</td>\r\n  <td></td>\r\n </tr>\r\n <tr>\r\n  <td>14.30-16.45</td>\r\n  <td>Николай Сульженко, Тюмень. Премьера лекции «Визуальные инструменты фотографа»</td>\r\n  <td>Городская юношеская библиотека (лекционный зал)\r\n  <p>Перерыв 10 минут на кофе-брейк (отдел краеведения)</p></td>\r\n </tr>\r\n <tr>\r\n  <td>17.00-18.45</td>\r\n  <td>Александр Алпаткин, Курган. Лекция  «Репортажная фотография» </td>\r\n  <td>Городская юношеская библиотека (лекционный зал)\r\n  <p>Перерыв 10 минут на кофе-брейк (отдел краеведения)</p></td>\r\n </tr>\r\n <tr>\r\n  <td><strong>22.02.2015</strong>\r\n  <p>10.00-12.30</p></td>\r\n  <td>Никита Куратов, Тюмень. Лекция-демонстрация\r\n  «Альтернативные способы печати. Цианотипия»</td>\r\n  <td>Городская юношеская библиотека (многофункциональный зал)\r\n  <p>Перерыв 10 минут  на\r\n  кофе-брейк (отдел краеведения)</p></td>\r\n </tr>\r\n <tr>\r\n  <td>12.45-14.15</td>\r\n  <td>Владимир Огнев, Тюмень. Лекция «Спортивная фотография»</td>\r\n  <td>Городская юношеская библиотека (лекционный зал)</td>\r\n </tr>\r\n</tbody></table><p><strong></strong></p><p><strong>Закрытие. Творческий\r\nвечер ТДФ по итогам Форума в арт-кафе «Артизан» (время уточнить у\r\nорганизаторов)</strong></p><p><strong></strong></p><p>*В рамках индивидуальных консультаций в программе\r\nучаствуют  Сергей Шаповал, Игорь Ковалёв,\r\nОлег Орлов, Николай Сульженко и другие.</p><p><strong><em>Контакты Оргкомитета:&nbsp;</em></strong></p><p><strong><em>&nbsp;+7 (3452)\r\n99 87 55  </em></strong><strong><em><a href="mailto:fotoexpo72@mail.ru">fotoexpo72@mail.ru</a>;&nbsp;</em></strong></p><p><strong><em> +7-932-320-39-53 Оксана Климерова,\r\nруководитель штаба Форума</em></strong></p>', NULL, 6, '<p>Форум молодых фотографов открывается в день награждения победителей 1 Международного конкурса в Тюмени под Эгидой FIAP, 20 февраля 2015 года.</p>', '2015-02-17 07:05:04', '2015-02-18 08:47:58', 'Novelty', 3, 'programma-1go-otkrytogo-foruma-molodyh-fotografov-tyumenskoy-oblasti-photocampus-in-tyumen-fixage-2015'),
(32, '28 февраля, состоится очередное заседание клуба ФотоРегион', '<p><img src="/system/redactor_assets/pictures/79/sPjs9ZIvFc8.jpg" style="width: 217px;"></p><p>Приглашаем всех не равнодушных к фотографии творческих людей, настоящих любителей фотографии, к вступлению в наш фотоклуб! Если вы ранее состояли в клубе ФотоРегион, то ваше вступление можно упростить, если вы придете на следующее заседание (в эту субботу). Простите, если кого то лично не пригласили. Считайте это письмо - личным приглашением, с глубоким уважением и открытым сердцем!</p><p>Повестка дня</p><p>собрания членов фотоклуба «ФотоРегион» 28.02.2015 г.</p><p>1. Подведение итогов Форума молодых фотографов: общий взгляд, проблемные моменты, пожелания, идеи. Выступает С.В. Фирцев, И.Б. Ковалев, Н. Р. Сульженко, иные желающие.</p><p>2. Рассмотрение вопроса о принятии в члены фотоклуба лиц, не прошедших прием на прошлом заседании фотоклуба (отсутствующих/не изъявивших желание). Выступает А.А. Рябцев, иные желающие.</p><p>3. Рассмотрение вопроса о размере и порядке уплаты членских взносов членов фотоклуба «ФотоРегион». Выступают члены правления фотоклуба с предложением, иные желающие.</p><p>4. Рассмотрение вопроса о системе определения победителей в конкурсах, проводимых фотоклубом или с участием фотоклуба. Выступает Н.Р. Сульженко.</p><p>5. Информационное представление (фоторассказ) «О фотографе» фотографом (членом фотоклуба). Выступает И.Б. Ковалев. После обсуждения определение следующего презентатора.</p><p>6. Защита кандидатов в члены фотоклуба (представление 10 фотографий или иных способов защиты). Выступает Алексей Бовыкин, иные желающие.</p><p>7. Просмотр фотографий присутствующих на собрании.</p><p>8. Разное, определение вопросов повестки дня следующего собрания.</p>', NULL, 6, '<p>Ждем вас в Научной библиотеке, по адресу Орджоникидзе, 59. Начало в 15:00. Вход свободный.</p>', '2015-02-26 21:48:44', '2015-02-26 21:48:44', 'Novelty', 4, '28-fevralya-sostoitsya-ocherednoe-zasedanie-kluba-fotoregion'),
(33, 'Приглашаем на открытие фотовыставки Алины Иноземцевой "Ино"', '<p><img src="/system/redactor_assets/pictures/82/Aut-sm-no.jpg"></p><p>&nbsp;2 апреля - всемирный день распространения информации о проблемах аутизма (введен ООН с 2007 года). К этой дате приурочена эта фотовыставка.</p><p>К сожалению прекрасную выставку "Ино" из жизни детей-аутистов в этот раз показать вам не получится. Увы, мы не нашли понимания у администрации ТЦ нашей выставочной площадки. Это произошло впервые. что нам был высказан такой категоричный отказ. Приносим свои извинения за преждевременный анонс.</p><p>"Аутизм – нарушение развития, не дружественное фотокамере. Да что там, камере: людям с аутизмом вообще трудно дается взаимодействие с окружающими. И именно нам, этим окружающим, под силу стать хотя бы чуть-чуть ближе, доказать силу земного притяжения, вспомнить, наконец, пресловутую истину – человеку нужен человек. Фотовыставка «Ино» – одна из таких попыток услышать, почувствовать, понять. В выставку вошли фотографии, снятые Алиной за год работы с детьми с аутизмом."</p><p>Эту выставку мы покажем вам на просторах нашего виртуального пространства.</p>', NULL, 6, '<p>Анонсируем в свет, пока виртуально, выставку-рассказ о жизни детей-аутистов.</p>', '2015-03-03 12:20:52', '2015-03-06 17:03:48', 'Novelty', 4, 'priglashaem-na-otkrytie-fotovystavki-aliny-inozemtsevoy-aut'),
(34, 'Фотоклуб по субботам. Анонс на март 2015.', '<p><img src="/system/redactor_assets/pictures/83/sPjs9ZIvFc8.jpg" style="width: 389px;"></p><p>14 марта сего года, в 15:00 состоится очередной фотоклуб.</p><p><br>После длительной паузы смотрим фотографии у всех фотоклубовцев. В этот раз - минимум политики, максимум фотографии!</p><p><br>-------------------------------------------------------------------------------------------------------------------------------------<br><br>28 марта, в 15:00<br>В цикле лекций фотоклуба. Лекция Владимира Глухова: "Знак - Символ - Образ" как фактор композиции.<br><br>------------------------------------------------------------------------------------------------------------------------------------<br><br>На все мероприятия фотоклуба - вход свободный.<br><br>Место проведения:<br>ТОНБ имени Д.И.Менделеева<br>Орджоникидзе, 59, Тюмень</p>', NULL, 6, '<p>14 марта и 28 марта ждем всех на собрание фотоклуба.</p>', '2015-03-12 19:50:55', '2015-03-12 19:52:15', 'Novelty', 4, 'fotoklub-po-subbotam-anons-na-mart-2015'),
(35, 'ТДФ объявляет благодарность!', '<p><img src="/system/redactor_assets/pictures/84/TDF-znak.jpg"></p><p>Уважаемые коллеги!</p><p>Прошедший конкурс, а также итоговая выставка I Международного Фотоконкурса\r\nFixAge’2014 под эгидой FIAP не\r\nмогли в полной мере состояться без помощи многих наших коллег. Оргкомитет и\r\nжюри выражает им искреннюю признательность. Среди них</p><p>Анущенко Павел</p><p>Цвиккер Людмила&nbsp;</p><p>Бобкова Ольга</p><p>Гололобова Настя</p><p>Завидонова Ольга</p><p>Засекин Александр</p><p>Изосимов Дмитрий</p><p>Казанцева Наталья </p><p>Куратов Никита</p><p>Тарасов Александр</p><p>Шаров Вадим</p><p>Нестеренко Виталий</p><p>Оргкомитет выражает признательность нашему коллеге Сергею\r\nРусанову, а также отдельное спасибо Сергею Майорову – представителю FIAP по России.</p>', NULL, 6, '<p>Оргкомитет и жюри&nbsp;I Международного Фотоконкурса FixAge’2014 под эгидой FIAP&nbsp;выражает искреннюю признательность нашим коллегам и друзьям!</p>', '2015-03-12 19:56:23', '2015-03-13 15:24:44', 'Novelty', 3, 'tdf-ob-yavlyaet-blagodarnost'),
(36, 'Виртуальная выставка "Ветераны", приуроченная к 70-летию Победы.', '<p><img src="/system/redactor_assets/pictures/86/Aphisha-sm-6.jpg" style="width: 318px;"></p><p>Скоро здесь появится описание фотовыставки.</p>', NULL, 6, '<p>Это электранная версия фотовыствки "Ветераны" проходившей в мае 2015 года в ТРЦ Премьер. Здесь расширяет границы ее, добавлены рассказы о ветеранах.</p>', '2015-05-12 17:11:20', '2015-05-30 05:09:17', 'Article', 4, 'virtualnaya-vystavka-veterany-priurochennaya-k-70-letiyu-pobedy'),
(37, 'XIV межрегиональный конкурс репортажной фотографии "Памяти Александра Ефремова"', '<p><img src="/system/redactor_assets/pictures/87/efremov-255557757_200144354_o.jpg" style="width: 319px;"></p><p>Уважаемые коллеги! Приглашаем вас принять участие в XIV межрегиональном конкурсе репортажной фотографии "Памяти Александра Ефремова" Участие бесплатное! Призовой фонд 200 000 рублей! Работы принимаются до 30 июня на сайте конкурса: <a href="http://www.aefremov.com">www.aefremov.com</a></p><p>Для авторов проживающих в Тюменской области учреждены специальные номинации : "Человек труда" - фото о любой созидательной профессии и "Победители" - посвещена 70-летию Победы в ВОВ! Также можно принять участие в трех открытых для всех номинациях: "Федеральный репортаж", "ЭКО-мир" и "Световая энергия" !</p><p>Также все желающие участники фотоконкурса могут принять участие в образовательном семинаре председателя жюри конкурса 2015 Сергея Максимишина (г.Санкт-Петербург) в г.Тобольске 26-29 июля 2015 года. Стоимость участия 6000 рублей наличный расчет, 7000 рублей безналичный расчет.</p><p><em>Сергей Русанов.</em></p>', NULL, 6, '<p>Приглашаем вас принять участие в XIV межрегиональном конкурсе репортажной фотографии "Памяти Александра Ефремова"</p>', '2015-05-19 10:49:20', '2015-05-30 05:08:16', 'Novelty', 5, 'xiv-mezhregionalnyy-konkurs-reportazhnoy-fotografii-pamyati-aleksandra-efremova'),
(38, 'Приглашаем на фотовыставку Ольги Каменской "Причуды и загадки северных морей"', '<p><img src="/system/redactor_assets/pictures/88/afisha-prichudy-north-see_o.jpg" style="width: 704px;"></p>', NULL, 6, '<p>9 октября 2015 года в 18:00 открытие фотовыставки в Тюменском Драматическом театре. Творческая встреча с Ольгой Каменской состоится 10 октября в 15:00 в Областной научной библиотеке (ул. Орджоникидзе, 59)</p>', '2015-10-07 19:11:58', '2015-10-07 19:11:58', 'Novelty', 4, 'priglashaem-na-fotovystavku-olgi-kamenskoy-prichudy-i-zagadki-severnyh-morey'),
(39, 'Приглашаем Вас на открытие международных выставок Innervision (1 сезон) и Founart (Вивиан дель Рио). ', '<p>Выставка объединяет работы более 60-ти авторов, как известных мастеров, так и талантливых начинающих авторов из Азербайджана, Белоруссии, Великобритании, Казахстана, Польши, России, США, Узбекистана и Украины, работающих в жанре уличной фотографии. Основная идея экспозиции – поиск «второго дна», дополнительных смыслов, которые в некоторых работах считывается явно, а в каких-то – только на уровне ощущений.</p><p>Среди участников такие известные фотографы, как Сергей Максимишин, Александр Петросян, Вивиан дель Рио, Сергей Рогожкин, Георгий Пойлов, Артём Житенёв, Анзор Бухарский, Эмиль Гатауллин, Андрей Чепакин и многие другие.&nbsp;В том числе и работа нашего земляка Сергея Киселёва.</p><p>Так как удалось собрать довольно сильный состав авторов, выставка получила положительные отзывы в фотографической среде.</p><p>На открытии присутствует основатель и куратор выставки Андрей Тульнов (Москва) и участник выставки Сергей Киселёв.<br>В программе также презентация и премьера минифильма "История одной фотографии". В фильме истории своих снимков рассказывают такие мастера как Миша Бурлацкий, Владимир Вяткин, Влад Сохин, Андрей Чежин, Артем Чернов, Юрий Молодковец, Сергей Максимишин.</p><p>Открытие в 18-00 6 ноября, Тюменский драматический театр, малый зал, Республики 128.</p><p><img src="/system/redactor_assets/pictures/90/innervision.jpg" style="width: 511px;"></p>', NULL, 6, '<p>Открытие в 18-00 6 ноября, Тюменский драматический театр, малый зал, Республики 128.</p>', '2015-11-02 17:46:15', '2015-11-02 17:46:15', 'Novelty', 4, 'priglashaem-vas-na-otkrytie-mezhdunarodnyh-vystavok-innervision-1-sezon-i-founart-vivian-del-rio');
INSERT INTO `posts` (`id`, `title`, `content`, `published`, `user_id`, `digest`, `created_at`, `updated_at`, `type`, `age_policy_id`, `slug`) VALUES
(40, 'Прими участие в издании 1го тома "Истории Тюменской фотографии"', '<p>\r\n	Прежде всего выражаем надежду Вас, что именно Вы, уважаемый читатель, примите участие в нашем общем благом начинании. Просим помощи, а уж вам решать как вы сможете нам помочь. В первую очередь будем Вам благодарны за перепосты и ссылки на наши материалы. Конечно есть нужда и в финансовой поддержке проекта, но это по возможности, ведь даже малая сумма помощи уже приблизит наше общее дело к успешной реализации проекта.</p><iframe frameborder="0" width="728" height="90" src="https://widgets.planeta.ru/widgets/affiliate-campaign-widget.html?name=CAMPAIGN_728X90&campaign-id=28458&affiliate-id=0&background=WHITE&font-color=BLACK&share-id=111769"></iframe><p><img src="/system/redactor_assets/pictures/91/p.jpg"></p><p>на снимке выше <em>- Одна из первых фотографий снятых в Тюмени.</em></p><p><em>Молебен на Александровской площади по случаю избавления от опасности жизни государя императора. 4 апреля 1867 года</em></p><p><em><br></em></p><p><em><br></em></p><p><strong>Здравствуйте!</strong></p><p><strong>Кто мы</strong></p><p>Мы – это Тюменский Дом Фотографии.</p><p>Дом фотографии основан в 2012 году. За 3 года организовал около 40 фотовыставок, в том числе 8 международных, 4 выставки вывозил в другие регионы РФ. В экспозициях были представлены работы фотографов из Голландии, Германии, Сербии, Чехии, Чили, Испании, Турции, Болгарии, России и др. Наиболее значимые мероприятия:</p><p><em><strong>I Международная декада фотографии, 2013</strong></em></p><p><em><strong>Международный фотоконкурс FixAge''2014 под эгидой FIAP</strong></em></p><p><em><strong>I открытый форум молодых фотографов Тюменской области, 2015</strong></em></p><p>В настоящий момент продолжает выставочную деятельность и приступил к созданию Тюменского музея фотографии. Кроме этого, активно ведет образовательную деятельность (есть своя фотошкола, преподаватели ведут факультативное преподавание уроков фотографии в образовательных учреждениях города Тюмени). </p><p><em> В ноябре 2015 стал соучредителем первого в Тюмени творческого кластера  «арт-лофт Комбинат». Подробно здесь</em> <a href="https://planeta.ru/api/util/away.html?to=http%3A%2F%2Fwww.fabrikclub.ru%2F"><em>www.fabrikclub.ru</em></a></p><p><strong>Этой книгой Тюменский Дом Фотографии начинает серию из III томов «История Тюменской фотографии». Она охватит всю историю развития фотодела и фотоискусства в Тюменском крае с 60-х годов XIX века до наших дней.</strong></p><p><strong>О книге</strong></p><p>Книга написана молодым, но уже известным тюменским краеведом Львом Боярским. Она посвящена 430-летию города Тюмени и 150-летию открытия в городе первой фотомастерской. Здесь дана наиболее полная картина того, как в нашем городе в конце XIX – начале XX века развивалось фотодело, подробно рассказано о том, как сложились судьбы первых фотографов Тюмени. За время, прошедшее со времени выхода книги В.Е. Копылова «Былое светописи: у истоков фотографии в Тобольской губернии» (2004), в краеведческой литературе появилось много биографических сведений о первых тюменских фотографах. Например, в последние годы мы узнали немало о фотомастере Шустере – прежде всего благодаря титанической работе И.Е. Варкина, раввина синагоги и неутомимого исследователя.</p><p>Наша книга написана по открытым источникам, её цель – объединить разрозненную информацию, сделать её удобной для работы краеведов, специалистов по истории фотографии. Но также интересной широкому кргу читателей. В ней содержится большое количество иллюстративного материала, <strong>многие архивные снимки публикуются впервые.</strong></p><p><strong><br></strong></p><p><strong><br></strong></p><p><img src="/system/redactor_assets/pictures/92/original.jpg" style="width: 588px;"></p><p><strong>ИСТОРИЯ ТЮМЕНСКОЙ ФОТОГРАФИИ</strong></p><p><strong>ТОМ I</strong></p><p><strong>ПИОНЕРЫ ТЮМЕНСКОЙ ФОТОГРАФИИ </strong></p><p><strong>СТАНОВЛЕНИЕ ФОТОГРАФИЧЕСКОГО ДЕЛА В ТЮМЕНИ В</strong> <strong>XIX</strong><strong>- НАЧ. ХХ ВВ.</strong></p><p>СОДЕРЖАНИЕ</p><p>ОТ АВТОРА (И НЕ ТОЛЬКО)</p><p>ГЛАВА 1. ТЮМЕНСКИЕ СТРАНИЦЫ В ИСТОРИИ ФОТОГРАФИИ</p><p>ГЛАВА 2. ПЕРВЫЙ ФОТОГРАФ ТЮМЕНИ – КОНСТАНТИН ВЫСОЦКИЙ</p><p>ГЛАВА 3. ФОТОГРАФИЧЕСКИЕ ДИНАСТИИ</p><p>ГЛАВА 4. ТЮМЕНСКИЙ СВЕТОПИСЕЦ ТАРАС ОГИБЕНИН</p><p>ГЛАВА 5.ЗАГАДКА А. ШУСТЕРА</p><p>ГЛАВА 6. ФОТОГРАФЫ И ВЛАДЕЛЬЦЫ ФОТОЗАВЕДЕНИЙ (ОТ А ДО Я)</p><p>ГЛАВА 7. ОТКРЫТКИ И ИХ ЗАКАЗЧИКИ</p><p>ГЛАВА 8. ФОТОТОРГОВЛЯ</p><p>ЗАКЛЮЧЕНИЕ</p><p><em>Приложение</em></p><p><em>Список фотографических заведений в Тюмени в 1888-1914 гг.</em></p><p><em>Именной указатель</em></p><p><em>Библиография</em></p><p><em>Принятые сокращения</em></p><p><strong>На что собираем средства</strong></p><p>Книга уже написана, сейчас ее отдали по всем правилам вычитывать редакторам и корректорам. А вот работы над фотоматериалами предстоит много. Конечно все снимки нуждаются в профессиональной обработке, но до 20% нужна даже не ретушь, а реставрация. И без профессионального вмешательства не обойтись. А это дорого. Но необходимо.</p><p><img src="/system/redactor_assets/pictures/93/original__1_.jpg" style="width: 587px;"></p><p>Оригинал-макет книги и верстка – процессы понятные и мы нашли способ сделать их за минимальные средства; коллеги дизайнеры помогут. Но вот собственно печать в типографии – основная статья расходов.</p><p><strong>Формат 170х240, твердый переплет, 220 страниц, 200 иллюстраций, 500 экземпляров в подарочной обложке. Тираж 2000 экземпляров.</strong></p><p><strong><br></strong></p><p><strong><br></strong></p><p><img src="/system/redactor_assets/pictures/94/original__2_.jpg" style="width: 605px;"></p><p><em><strong>Средства, вырученные от продажи книг, будут использованы в работе над проектом создания Музея фотографии.</strong></em></p><p><strong>Об авторе</strong></p><p>Лев Боярский как уже было сказано, молодой, но достаточно известный краевед в Тюмени. В настоящий момент он является сотрудником архива Тюменского областного музейного комплекса им. И.Я Словцова. Автор множества публикаций в региональных СМИ. Эта книга также не первая.</p><p>На основе музейных и архивных материалов Лев Боярский и соавторы издали <a href="https://planeta.ru/api/util/away.html?to=http%3A%2F%2Fprofilib.com%2Favtor%2Flev-boyarskiy.php">сборник «Очерки старой Тюмени»,</a> в который включены воспоминания «наивных историографов» - Николая Захваткина, Аркадия Иванова, Николая Калугина, Станислава Карнацевича и Алексея Улыбина. Очерки опубликованы в 2011 году в тюменском издательстве «П.П.Ш.» на средства подписчиков.</p><p>К сфере интересов Лёвы, как называют его друзья, относится такое набирающее популярность в Тюмени направление, как краеведческие прогулки. <strong>«Бесцельные блуждания»,</strong> как называются эти маршруты, не найти в путеводителях. Сейчас их 7, среди них «Тюмень привокзальная», «Тюмень прибрежная», «Тюмень Крапивинская и др. Вот как Лев сам говорит об этом:</p><p>«Идея устраивать групповые прогулки пришла, когда я изучал московский опыт. В Москве есть Общество вольных прогулок. На меня сильно повлиял <strong>Александр Курбатов</strong>, он ходит такими маршрутами, что его спутникам предстаёт совершенно иная Москва. Я ничего специально не рассказываю, но могу дать комментарии — вот в этом доме был вытрезвитель, тут была богадельня. Людям это интересно, потому что к зданию они привыкли, а что там было и кто там жил, не знают. Но эта информативная часть — не главная, главное — это ощущение, на старых улочках люди что-то переживают. Мне кажется, это и есть какое-то перенесение во времени, в иную реальность, в прошлое или в страну своих фантазий…. У меня есть подсказчики, например Марина Эмильевна Косполова, которая говорит, что в том или ином месте есть такая интересная точка» <em><a href="https://planeta.ru/api/util/away.html?to=http%3A%2F%2Fwww.vsluh.ru%2Fnews%2Fculture%2F269043">по материалам Вслух.ру</a></em></p><p><img src="/system/redactor_assets/pictures/95/original__3_.jpg" style="width: 179px;"></p><p>Фото Владимира Иванова</p><p>Въедливый и скрупулезный исследователь, романтичный путешественник. А еще очень скромный в общении человек. Безусловно талантливый, с хорошим слогом, его интересно слушать и читать. А вот сам не любит фотографироваться, поэтому сложно было найти его портрет). Но, на то мы и фотографы… </p><p><strong>Дорогие друзья!</strong></p><p><strong>Поддерживая наш проект, вы не просто помогаете издать книгу,</strong></p><p><strong>Вы делаете свой вклад в историю!</strong></p>', NULL, 6, '<p>\r\n	Всем миром собираем средства на издание первого тома крайне важной для искусства и истории книги&nbsp;"Истории Тюменской фотографии". Надеемся на ваш посильный вклад в это благое дело.&nbsp;\r\n</p>\r\n<p><br><br></p>\r\n\r\n<iframe frameborder="0" width="728" height="90" src="https://widgets.planeta.ru/widgets/affiliate-campaign-widget.html?name=CAMPAIGN_728X90&campaign-id=28458&affiliate-id=0&background=WHITE&font-color=BLACK&share-id=111769"></iframe>', '2015-12-25 07:32:17', '2015-12-27 20:18:04', 'Novelty', 4, 'primi-uchastie-v-izdanii-1go-toma-istorii-tyumenskoy-fotografii'),
(41, 'Очередное заседание фотоклуба "ФОТОРЕГИОН" (05.02.2016)', '<p><img src="/system/redactor_assets/pictures/96/klub-photo_o-tsvikker.jpg" style="height: 506px; width: 762px;"></p><p><br></p><p>Очередное заседание фотоклуба "ФОТОРЕГИОН" состоится 05 марта, в субботу, в 15-00 часов в Тюменской областной научной библиотеке им. Д.И. Менделеева.</p><p>Адрес библиотеки: ул. Орджоникидзе, 59.  </p><p><br></p><p>(фото Людмилы Цвиккер)<br></p>', NULL, 227, '<p>05 марта, в субботу, в 15-00 часов</p>', '2016-03-02 13:22:26', '2016-03-02 16:40:46', 'Novelty', 3, 'ocherednoe-zasedanie-fotokluba-fotoregion'),
(42, 'XV межрегиональный конкурс репортажной фотографии «Памяти Александра Ефремова»', '<h2>Открыт прием работ XV межрегионального конкурса репортажной фотографии «Памяти Александра Ефремова»!</h2><p><img src="http://aefremov.com/wp-content/themes/atahualpa371/images/header/red2.jpg"></p><p>Прием работ до 15 июня 2016 года!</p><p>Объявление результатов конкурса в день рождения Александра Ефремова на его родине в городе Тобольске на церемонии открытия фотовыставки участников конкурса 29 июля в музее Дворец Наместника, а также на сайте конкурса.</p><p><strong>Общие положения и правила:</strong>.</p><p><strong>1.1</strong> В Конкурсе могут принимать участие:<br>— любой профессиональный фотограф или фриланс-фотограф, работающий для средств массовой информации на постоянной или временной основе;<br>— фотограф любого гражданства и национальности, но обязательно снимающий в России или непосредственно в Тюменской области;<br><strong>1.2</strong> Участие в Конкурсе бесплатное;<br><strong>1.3</strong> Каждый участник может представить на Конкурс в каждую номинацию не более трех серий (репортажей) или трех одиночных фотографий. Одна серия должна состоять из не более чем из 12 фотографий. Каждая серия приравнивается к одной одиночной фотографии.<br><strong>1.4</strong> Заполняя электронную анкету и отправляя фотографии на Конкурс, фотограф (участник) тем самым подтверждает свое согласие с условиями настоящего Положения;</p><p><strong>2.1</strong> Номинации: «<strong>Федеральный Репортаж</strong>», <strong>«ЭКОмир: природа, человек, гармония</strong><strong>,</strong><strong> природа» </strong>территориальных ограничений не имеют.</p><p>Номинации: <strong>«Человек труда», «Региональный репортаж-Сибирская семья»</strong> ограничены приемом работ только от авторов, проживающих в Тюменской области.</p><p><strong>2.2</strong> Основными номинациями Конкурса являются:</p><p>— «<strong>Федеральный Репортаж</strong>»: свободная тема. Фоторепортаж, фотоистория, серия или одиночные фотографии, сделанные в любой точке мира;</p><p>— <strong>«ЭКОмир: человек, гармония,природа». </strong>Свободная тема, открытая номинация для всех участников конкурса, отражающая наиболее привлекательные и экологически позитивные места природы, условия активного отдыха и человеческой жизни деятельности в России и за ее пределами. Учреждена партнером конкурса: группой компаний «СИБУР», в память тобольского фотохудожника <strong>Юрия Попова,</strong> бильд-редактора газеты «Тобольская правда».</p><p>— «<strong>Человек труда</strong>» — (отражающая созидательный труд любой профессии), номинация для авторов проживающих в Тюменской области. Учреждена Тюменским региональным отделением всероссийской политической партии «Единая Россия».</p><p>— <strong>«Региональный репортаж – Сибирская семья»</strong>, номинация для авторов проживающих в Тюменской области. Учреждена депутатской фракцией «Единая Россия» в Тюменской областной Думе.</p><p>2.3 Одиночные фотографии должны быть сняты в период с июня прошлого года по июнь настоящего года. Фоторепортажи, фотоистории должны быть закончены или впервые опубликованы в тот же период времени.<br>2.4 Постановочные фотографии, монтаж фотографий, а также фотографии, фальсифицированные электронным или другими способами, к Конкурсу не принимаются;<br>2.5 Жюри в праве отказать фотографу в участии в Конкурсе, но только при условии публичного объяснения причин отказа или дисквалификации;<br>2.6 Председатель жюри этого года Наталья Ударцева (г. Москва) объявляет итоги и награждает победителей 29 июля 2016 года в Тобольске во время открытия итоговой фотовыставки участников Конкурса.</p><p>2.7 По решению Оргкомитета могут быть учреждены специальные призы Конкурса.</p><p>3.1 Авторские права на фотографии принадлежат авторам;<br>3.2 Оргкомитет Конкурса гарантирует соблюдение авторских прав при публикации фотографий присланных на Конкурс, в масс-медиа или на выставках в целях популяризации Конкурса без выплаты авторского вознаграждения;<br>3.3 Отпечатанные фотографии и высокого разрешения, вошедшие в итоговую фотовыставку Конкурса, переходят в собственность Оргкомитета Конкурса для дальнейшего использования в выставочных проектах и в других некоммерческих целях.</p><p>4.1 Отбор фотографий на Конкурс и итоговую фотовыставку осуществляется в два этапа.<br>4.2 Фотографии в цифровом виде должны быть отправлены через модуль загрузки на сайте конкурса для предварительного просмотра и голосования жюри до (deadline) 15 июня 2016 года 23 часов 59 мин среднего Западно-Сибирского региона (+2 часа Московского времени) только в цифровом виде. Файлы фотографий должны соответствовать следующим требованиям:<br>— формат файла — JPG, сжатие не менее 7;<br>— ширина — не менее 800 пикселей;<br>— размер одной фотографии — не более 400 Kb;<br>— резолюция (DPI) 72;<br>— черно-белые фотографии в GrayScale, цветные в RGB;<br>— название файлов могут быть на любом языке, но только латинскими буквами. Для серии фотографий название также должно содержать порядковую нумерацию;<br>— В File Info (Информация об изображении) должно быть обязательно указано: Автор (Author) и Описание (Description) на английском или русском языках, но только латинскими буквами. Обязательным является условие принадлежности авторских прав — автору.<br>— Для отправки серии фотографий Вам будет предложено заполнить одну из форм в соответствии с выбранной вами номинацией (<a href="http://aefremov.com/?page_id=28">см. Анкета участника</a>);<br>4.3 На втором этапе — для окончательного рассмотрения жюри и участию в выставке Конкурса Вам будет предложено отправить фотографии с большим разрешением. Эти условия гарантируют Ваши права, ограничивают возможности тиражирования фотографий и значительно облегчают работу Оргкомитета и Жюри.</p><p>29 июля 2016 года в день рождения Александра Ефремова, председатель жюри Конкурса опубликует свое решение о составе победителей на сайте конкурса, процедура награждения победителей и открытие итоговой фотовыставки участников состоится 29 июля 2016 года в Тобольске (музей Дворец Наместника). В рамках конкурса в Тобольске состоится обучающий семинар участников конкурса под руководством членов жюри конкурса.</p>', NULL, 227, '<p>Открыт прием работ XV межрегионального конкурса репортажной фотографии «Памяти Александра Ефремова»!</p>', '2016-03-09 16:25:32', '2016-03-11 17:00:11', 'Novelty', 5, 'xv-mezhregionalnyy-konkurs-reportazhnoy-fotografii-pamyati-aleksandra-efremova'),
(43, 'График очередных собраний фотоклуба до летних каникул 2016.', '<p>Плановые собрания фотоклуба «Фоторегион» в ТОНБ по следующему графику:</p><table>    <tbody><tr> <td> <p>№</p> </td> <td> <p><b>Дата</b></p> </td> <td> <p><b>План мероприятий на собрании фотоклуба.</b></p> </td> </tr> <tr> <td> <p>1</p> </td> <td> <p>19.03.2016</p> </td> <td> <p>Кураторский проект.</p><p>«Неизвестные имена» - доклад о новых именах фотографов.</p><p>«Контрольные отпечатки» - воркшоп по отбору фотографий.</p><p>«История одного кадра» - представление участника клуба.</p><p>Просмотр работ участников фотоклуба.</p> </td> </tr> <tr> <td> <p>2</p> </td> <td> <p>02.04.2016</p> </td> <td> <p>Кураторский проект.</p><p>«Неизвестные имена» - доклад о новых именах фотографов.</p><p>«Контрольные отпечатки» - воркшоп по отбору фотографий.</p><p>«История одного кадра» - представление участника клуба.</p><p><a name="__DdeLink__215_443052125"></a> Просмотр работ участников фотоклуба.</p><p>Организационные вопросы</p> </td> </tr> <tr> <td> <p>3</p> </td> <td> <p>16.04.2016</p> </td> <td> <p>Кураторский проект.</p><p>«Неизвестные имена» - доклад о новых именах фотографов.</p><p>«Контрольные отпечатки» - воркшоп по отбору фотографий.</p><p>«История одного кадра» - представление участника клуба.</p><p>Просмотр работ участников фотоклуба.</p><p>Организационные вопросы</p> </td> </tr> <tr> <td> <p>4</p> </td> <td> <p>30.04.2016</p> </td> <td> <p>Кураторский проект.</p><p>«Неизвестные имена» - доклад о новых именах фотографов.</p><p>«Контрольные отпечатки» - воркшоп по отбору фотографий.</p><p>«История одного кадра» - представление участника клуба.</p><p>Просмотр работ участников фотоклуба.</p><p>Организационные вопросы</p> </td> </tr> <tr> <td> <p>5</p> </td> <td> <p>14.05.2016</p> </td> <td> <p>Кураторский проект.</p><p>«Неизвестные имена» - доклад о новых именах фотографов.</p><p>«Контрольные отпечатки» - воркшоп по отбору фотографий.</p><p>«История одного кадра» - представление участника клуба.</p><p>Просмотр работ участников фотоклуба.</p><p>Организационные вопросы</p> </td> </tr> <tr> <td> <p>6</p> </td> <td> <p>28.05.2016</p> </td> <td> <p>Кураторский проект.</p><p>«Неизвестные имена» - доклад о новых именах фотографов.</p><p>«Контрольные отпечатки» - воркшоп по отбору фотографий.</p><p>«История одного кадра» - представление участника клуба.</p><p>Просмотр работ участников фотоклуба.</p><p>Организационные вопросы</p> </td> </tr> <tr> <td> <p>7</p> </td> <td> <p>11.06.2016</p> </td> <td> <p>Кураторский проект.</p><p>«Неизвестные имена» - доклад о новых именах фотографов.</p><p>«Контрольные отпечатки» - воркшоп по отбору фотографий.</p><p>«История одного кадра» - представление участника клуба.</p><p>Просмотр работ участников фотоклуба.</p><p>Организационные вопросы</p> </td> </tr></tbody></table>', NULL, 6, '<p>Собрания будут проходить по следующим датам:</p><p>19.93.2016; 02.04.2016; 16.04.2016; 30.04.2016; 14.05.2016; 28.05.2016; 11.06.2016<br></p>', '2016-03-15 07:24:33', '2016-03-15 09:34:32', 'Novelty', 4, 'plan-ocherednyh-sobraniy-fotokluba-do-letnih-kanikul-2016'),
(44, 'Инструкция по регистрации и участию в блиц-конкурсе "ФотоФиниш"', '<p><img src="/system/redactor_assets/pictures/97/tEsucKvocs0-FF-Nat-G.jpg" style="height: 401px; width: 602px;"><br></p><p><em>фото Наташи Горшковой ( <a href="http://vk.com/id71302142" target="_blank">спортивный фотограф</a> )</em><br></p><p><strong><br></strong></p><p><strong>Мы рады приветствовать Вас на страницах нашего сайта!</strong></p><p><strong>Прежде, чем регистрироваться, обязательно прочитайте: "</strong><a href="http://domfoto72.ru/ru/competitions/fotofinish-50-i-1-4" target="_blank">Положение о блиц-конкурсе "ФотоФиниш</a>" (далее - "Положение"), где прописаны основные правила проведения "ФотоФиниша" и правила участия в этом конкурсе).<br></p><p>Ниже приведены простые инструкции для участия в блиц-конкурсе "<strong>ФотоФиниш",</strong> проводимого тюменским Фотоклубом "<strong>ФотоРегион"</strong>.<br></p><p><strong>Благодарим Вас за интерес к нашему конкурсу!</strong> <br>Надеемся на то, что участие в нём даст Вам заряд для дальнейшего развития Вашего мастерства и откроет новые уровни Вашего вдохновения!<br><br>Фотоконкурс под эгидой "ФотоФиниш" проводится на нашем сайте в "условно закрытом" режиме. Связано это с тем, что заявки конкурсантов будут рассматриваться и одобряться или же отклоняться. Для одобрения заявки необходимо выполнить все условия для участия в конкурсе (опубликованные в "Положении"), обязательно зарегистрироваться на нашем сайте, заполнить все важные поля в разделе "<strong>Личные данные</strong>".<br><br>Для регистрации на нашем сайте в верхнем меню выберите пункт «<strong>Регистрация</strong>». </p><p><img src="http://domfoto72.ru/system/redactor_assets/pictures/26/Sign-up-RU.jpg"></p><p>В открывшемся окне заполните все поля и согласитесь с правилами сайта.</p><p><img src="http://domfoto72.ru/system/redactor_assets/pictures/27/Sign-up-form-RU.jpg"></p><p><br>После этого Вам на электронную почту будет выслано письмо с активацией Вашей учетной записи на сайте. Пожалуйста, откройте это письмо (возможно, оно попадет в почте в разделе «Спам») и перейдите по указанной там ссылке для активации. Если Вы прошли полностью регистрацию, но письма не получили, то пожалуйста, напишите нам об этом на адрес: <a href="mailto:support@domfoto72.ru">support@domfoto72.ru</a>.<br><br>После активации Вашего аккаунта авторизуйтесь на сайте, зайдя в пункт «<strong>Войти</strong>» верхнего меню сайта. Для входа введите в указанные поля Ваш электронный адрес и пароль.</p><p><img src="http://domfoto72.ru/system/redactor_assets/pictures/28/Sign-in-RU.jpg"></p><p><br>После авторизации зайдите в свой профиль, нажав на соответствующий пункт верхнего меню. В профиле выберите раздел «<strong>Личные данные</strong>» и заполните там все пустые поля формы. Сохраните.</p><p>Для размещения заявки на конкурс перейдите в раздел «<strong>Конкурсы</strong>» в верхнем меню. <br></p><p>Среди конкурсов в таблице найдите текущий конкурс "<strong>ФотоФиниш"</strong>. </p><p>В конце строки с конкурсом Вы найдете иконку в виде конвертика  — нажмите его (см. рисунок). </p><p><img src="/system/redactor_assets/pictures/99/tab-konkurs-ff.jpg"></p><p>Нажав на эту иконку, Вы инициируете подачу заявки на конкурс и одновременно подтвердите свое согласие с правилами сайта, с условиями и "Положением". </p><p>В таблице конкурсов в графе <strong>«Участие», </strong>в строке конкурса, появится значок с вопросительным знаком. </p><p><img src="http://domfoto72.ru/system/redactor_assets/pictures/37/Request-status-Awaiting-RU.jpg"></p><p>Ответ на рассмотрение заявки на закрытый конкурс придет к Вам в виде письма как на внутренний ящик сайта в Вашем профиле, так и на Ваш электронный ящик. Ответ будет содержать сообщение либо о положительном рассмотрении заявки, либо об отрицательном с указанием причины. Получив сообщение о положительном рассмотрении, Вы можете начать размещение фотоизображений на конкурс. </p><p>Если вам отказано в регистрации, прочтите причину, и, по возможности, постарайтесь ее исправить. Вместо значка с вопросительным знаком появится значок «проезд запрещен». Свяжитесь через тикеты или по электронной почте с администрацией конкурса для апелляции. Причиной отказа могут быть следующие моменты: не корректные личные данные, не заполнены поля анкеты страна и город проживания, заявка так же отклоняется если она размещена после 15:00 по тюменскому времени 27 марта. В любом случае причина отказа будет указана.</p><p><img src="http://domfoto72.ru/system/redactor_assets/pictures/38/Request-status-Stop-RU.jpg"></p><p>После одобрения Вашей заявки вместо иконки с конвертом появится иконка с изображением фотографии. Значок с вопросительным знаком исчезнет из строки конкурса и до размещения фотографий, поле в графе <strong>«Участие»</strong> будет оставаться пустым. </p><p><img src="http://domfoto72.ru/system/redactor_assets/pictures/39/Request-status-Ok-RU.jpg"></p><p>После одобрения Вашей заявки Вы приходите с камерой на старт "Фотофиниша" в указанные дату и время, согласно объявлению.<br></p><p><strong>Загружать фотографии на конкурс можно будет только в день "ФотоФиниша" и днём позже. Фотографии можно разместить только те, которые участвовали в экспозиции на финише конкурса.</strong><br></p><p>В день проведения "ФотоФиниша" (или днем позже) Вы должны перейти в свой профиль (правый пункт верхнего меню навигации сайта - см. рис. ниже), выбрать пункт "Фотографии" слева из вертикального меню профиля и нажать на кнопку "новая фотография".</p><p><img src="http://domfoto72.ru/system/redactor_assets/pictures/29/profile-RU.jpg"><br></p><p>Добавьте нужно Вам количество фотоизображений, следуя подсказкам формы, которая появляется после нажатия кнопки «<strong>Новая фотография</strong>». Таким образом, Вы загрузите на сайт все изображения, которые собираетесь отправить на наш конкурс. Размер изображений указан в "Положении". Пожалуйста, в точности соблюдайте требования конкурса.<br></p><p><img src="http://domfoto72.ru/system/redactor_assets/pictures/39/Request-status-Ok-RU.jpg"><br></p><p>После того, как Вы загрузите фотографии для конкурса, можете переходить к публикации их в самом конкурсе.<br></p><p>Нажав на иконку с изображением фотографии (см. рисунок выше), Вы попадете на страницу загрузки фотографий (см. рисунок ниже).<br></p><p><img src="/system/redactor_assets/pictures/100/Add-photo-ff-bt.jpg"></p><p>В следующем окне выберите номинацию (она в списке одна, см. рисунок ниже), в которую Вы будете загружать фотографии, и нажмите ссылку "Выберите фотографии". <br></p><img src="/system/redactor_assets/pictures/101/Add-photo-ff-nom.jpg"><p><br></p><p>Фотографии для размещения в конкурсе могут быть выбраны только из Вашего портфолио, поэтому, <strong>обязательно предварительно загрузите их в свое портфолио</strong>. Откроется еще одно окно со списком Ваших фотографий, загруженных в портфолио (см рисунок).<br></p><p><img src="http://domfoto72.ru/system/redactor_assets/pictures/47/choose-photos-clixk-RU.jpg"></p><p>Кликая на фотографии из списка, Вы тем самым выбираете их в данную номинацию. Они, соответственно, будут появляться на странице под списком. </p><p>Закончив выбор фотографий, нажмите сперва кнопку "<strong>Сохранить</strong>", верхнее окошко тут же закроется, следом необходимо нажать на кнопку "<strong>С</strong><strong>охранить выбор</strong>" для окончательного размещения фотографий в номинацию. (см. рис.)</p>', NULL, 6, '<p>Простые инструкции для участия в блиц-конкурсе "ФотоФишниш".</p>', '2016-03-21 05:01:16', '2016-03-25 05:12:57', 'Article', 3, 'instruktsiya-po-registratsii-i-uchastiyu-v-blits-konkurse-fotofinish'),
(45, 'Открыт сезон на ФотоФиниш! 27 марта в 10 часов утра стартует ФотоФиниш № 50 и 1/3', '<p>Долгожданная новость: возобновляет жизнь проект периодических блиц-конкурсов под маркой "ФотоФиниш".<br>Фотоклуб "ФотоРегион" организует новый сезон конкурсов, начиная с нетрадиционного номера. Хотя по счету номер должен быть "51", однако, будет "50 и 1/3".<br>Мероприятия "Фотофиниша" проходили с 2006 года. С 2013 года мероприятия планово уже не проводились. И вот спустя три года, мы надеемся, что это станет уже опять периодическим плановым событием в фото-жизни города.<br>Итак, в ближайшее воскресение, 27 марта, в 10 часов утра, у здания ТЦ "Галерея -Вояж" стартует "ФотоФиниш". Приглашаем всех неравнодушных к фотоискусству людей, имеющих фотокамеры, принять участие в этом мероприятии!<br>Кратко правила конкурса следующие: желающие регистрируются для участия сперва на нашем сайте ( <a href="http://domfoto72.ru/" data-vdir-href="https://mail.yandex.ru/re.jsx?uid=91216424&amp;h=a,xxVWgOzqXYQusoGiC4P-MQ&amp;l=aHR0cDovL2RvbWZvdG83Mi5ydS8" data-orig-href="http://domfoto72.ru/" class="daria-goto-anchor" target="_blank">http://domfoto72.ru/</a> ), а затем, придя на старт конкурса. Объявляется тема, выбранная случайным образом организаторами. После чего все участники расходятся по городу в поисках кадров на заданную тему. К 16 часам участники должны предоставить уже отпечатанные кадры (в количестве до 3-х штук) в объявленное на старте место финиша. Далее идет живое обсуждение работ. Во временных правилах народное голосование за работы будет проходить позже, когда авторы разместят в соответствующую рубрику на нашем сайте свои конкурсные фотографии. Собственно, ставить оценки каждой фотографии смогут все участники. Так же свою оценку работам даст худсовет Фотоклуба.<br>Подробнее правила и инструкции по регистрации будут размещены на нашем сайте уже завтра, 22 марта 2016 года. ( <a href="http://domfoto72.ru/" data-vdir-href="https://mail.yandex.ru/re.jsx?uid=91216424&amp;h=a,xxVWgOzqXYQusoGiC4P-MQ&amp;l=aHR0cDovL2RvbWZvdG83Mi5ydS8" data-orig-href="http://domfoto72.ru/" class="daria-goto-anchor" target="_blank">http://domfoto72.ru/</a> )</p><p>Телефон организаторов:  +7 (9222) 615141</p><p><a href="http://domfoto72.ru/ru/competitions/fotofinish-50-i-1-4" target="_blank">Положение о блиц-конкурсе ФотоФиниш  50 и 1/3</a><br></p><p>Следите за новостями здесь и в группах Фотоклуба в социальных сетях:</p><p><a href="https://www.facebook.com/groups/photoregion/" target="_blank">В Фейсбуке</a> | <a href="http://vk.com/fotoregion" target="_blank">В Контакте</a> | <a href="https://vk.com/club2022691" target="_blank">Группа ФотоФиниша в Контакте</a><br></p><p><br></p><p><img src="/system/redactor_assets/pictures/98/1262953923_ff-10-natasha.jpg"></p>', NULL, 6, '<p>В ближайшее воскресение, 27 марта, в 10 часов утра, у здания ТЦ "Галерея -Вояж" стартует "ФотоФиниш". Приглашаем всех неравнодушных к фотоискусству людей, имеющих фотокамеры, принять участие в этом мероприятии!</p>', '2016-03-21 07:15:17', '2016-03-24 08:56:59', 'Novelty', 3, 'otkryt-sezon-na-fotofinish-27-marta-v-10-chasov-utra-startuet-fotofinish-50-i-1-3');
INSERT INTO `posts` (`id`, `title`, `content`, `published`, `user_id`, `digest`, `created_at`, `updated_at`, `type`, `age_policy_id`, `slug`) VALUES
(46, 'Инструкция по голосованию на конкурсе ФотоФиниш', '<p><strong>Благодарим Вас за интерес к нашему конкурсу!</strong> <br>Надеемся на то, что участие в нём даст Вам заряд для дальнейшего развития Вашего мастерства и откроет новые уровни Вашего вдохновения!<br><br>Каждый участник ФотоФиниша, согласно правил, принимает участие в голосовании (жюри) и выставляет на своё усмотрение баллы каждой фотографии, участвовавшей в конкурсе. Естественно, проголосовать можно только за те работы, которые авторы разместили соответствующий раздел сайта. В данном случае в раздел блиц-конкурса ФотоФиниш.</p><p>Для того что бы поставить оценки фотографиям, вам необходимо зайти на сайт под своим именем и паролем.</p><p><img src="/system/redactor_assets/pictures/102/Jury-competition-accept.jpg" style="height: 518px; width: 734px;"></p><p>Затем Заходим в свой профиль (первый пункт в рисунке выше).</p><p>Нажимаем пункт "Жюри" слева внизу меню (пункт 2 рисунка выше)</p><p>Нажимаем пункт "ФотоФиниш..." (под цифрой 3 на рисунке выше).</p><p>Попадаем на страницу голосования за работы. </p><p>В системе голосования - 10и бальная система оценок с точностью до пол-балла. Оценка выставляется "звёздами". Нужно нажать нужное количество "звезд" напротив карточки, (пункт 1 рисунка ниже) и таким образом зафиксируется ваша оценка данной работе.</p><p><img src="/system/redactor_assets/pictures/103/Jury-competition-rate.jpg" style="height: 843px; width: 801px;"></p><p>Если вы не правильно оценили, то можете нажать снова на "звёзды" или же нажать на знак чуть выше "звезд" (смотри на рисунке выше под цифрой 2).</p><p>По правилам конкурса вы ставите оценки каждой работе. Все они не влазят на одну страницу, поэтому когда на одной странице работы все вы оценили - переходите на следующую, с помощи страниц *смотри на рисунке выше под цифрой 4).</p><p>Если вы хотите быстро найти работы которым вы еще не поставили оценки, то вам поможет фильтр (смотри рисунок выше под цифрой 3).</p><p>Видео показывающее процесс выставления оценок:</p><p><br></p>\r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/t8m5gqjb21o" frameborder="0" allowfullscreen=""></iframe><p><br></p><p>По всем сложным вопросам обращайтесь по телефону +79829183344</p>', 0, 6, '<p>Полное описание системы голосования блиц-конкурса ФотоФиниш.</p>', '2016-03-28 12:31:15', '2016-10-24 19:11:42', 'Article', 4, 'instruktsiya-po-golosovaniyu-na-konkurse-fotofinish'),
(47, 'Подведены итоги голосования.  ФотоФиниш 50 и 1/3', '<p>Свершилось! Подведены итоги голосования.</p><p> На удивление, Распределение 1го, 2го и 3го места совпало в народном голосовании и голосовании членов худсовета клуба.</p><p>Итак, Вот победители корнкурса ФотоФиниш 50 и 1/3:</p><p>1 место - Нохрина Екатерина</p><p>2 место - Величко Анна</p><p>3 место - Славий Лариса</p><p><br>Подробнее смотрите на нашем сайте:<a href="http://domfoto72.ru/ru/competitions/fotofinish-50-i-1-4/results/20">http://domfoto72.ru/ru/competitions/fotofinish-50-...</a> <br>Сравнить оценки общего голосования и худсовета можно здесь:<a href="http://domfoto72.ru/ru/competitions/fotofinish-50-i-1-4/best">http://domfoto72.ru/ru/competitions/fotofinish-50-...</a></p>', NULL, 6, '<p>Распределение 1го, 2го и 3го места совпало в народном голосовании и голосовании членов худсовета клуба.</p>', '2016-03-30 04:50:11', '2016-03-30 04:50:11', 'Novelty', 3, 'podvedeny-itogi-golosovaniya-fotofinish-50-i-1-3'),
(48, 'Фотовыставка регионального отделения Союза фотохудожников России (Тюменская область)', '<p><strong>Приглашаем Вас на открытие фотовыставки членов Союза фотохудожников России (регионального отделения по Тюменской области)!</strong></p><p>Начало выставки: 13 апреля в 18-00 часов. </p><p>Адрес: г. Тюмень, ул. Республики, д. 129, малый зал Тюменского драматического театра. </p><p>Вход в малый зал - слева от центрального входа.</p>', NULL, 227, '<p>13 апреля 2016 года в Тюмени открылась фотовыставка регионального отделения Союза фотохудожников России.</p>', '2016-04-13 14:36:52', '2016-04-13 14:36:52', 'Novelty', 4, 'fotovystavka-regionalnogo-otdeleniya-soyuza-fotohudozhnikov-rossii-tyumenskaya-oblast'),
(49, 'Открытый городской конкурс фоторабот к 430-летию Тюмени', '<p><img src="/system/redactor_assets/pictures/106/starina-tyumen.jpg"></p>МАУК «Централизованная городская библиотечная система» при участии РОО «Тюменский дом фотографии» и поддержке РО "Союз фотохудожников Тюменской области", клуба любителей фотографии «ФотоРегион" приглашает жителей Тюмени в возрасте от 18 лет и старше к участию в открытом городском конкурсе фоторабот <b>«Тюмень: город, события, люди» (далее – Конкурс). </b><strong>ПОЛОЖЕНИЕ</strong><p><strong>об открытом городском конкурсе фоторабот «Тюмень: город, события, люди»</strong><strong><i data-redactor-tag="i"></i></strong></p><p><b>1.</b><b>Общие положения</b></p><p>1.1.Настоящее Положение определяет порядок организации и проведения открытого городского конкурса фоторабот «Тюмень: город, события, люди» (далее по тексту - Конкурс).</p><p>1.2.Учредитель Конкурса - Департамент культуры Администрации города Тюмени.</p><p>1.3.Организатор Конкурса – Муниципальное автономное учреждение культуры города Тюмени «Централизованная городская библиотечная система» (далее – Организатор) при участии РОО «Тюменский дом фотографии» и поддержке Региональной организации Союза фотохудожников Тюменской области, клуба любителей фотографии «ФотоРегион». </p><p>1.4.Конкурс проводится в рамках городских праздничных мероприятий, посвященных 430-летию города Тюмени.</p><p>1.5.Финансирование Конкурса осуществляется за счет бюджетных средств, выделенных учредителем Организатору на организацию и проведение общегородских мероприятий в рамках муниципального задания на 2016 год. В качестве дополнительных источников финансирования Конкурса могут выступать средства, полученные от пожертвований юридических и физических лиц.</p><p><b>2.</b><b>Цели и задачи Конкурса</b></p><p>2.1.Целью Конкурса является формирование позитивного имиджа города Тюмени, культивирование у горожан бережного и созидательного отношения к своей «малой родине» посредством вовлечения их в процесс создания и восприятия фотографического искусства.</p><p>2.2.Задачи Конкурса:</p><p>2.2.1.привлечение жителей Тюмени к участию в юбилейных мероприятиях города;</p><p>2.2.2.создание условий для самореализации талантов и способностей жителей города в фотографическом искусстве;</p><p>2.2.3.создание коллекции материалов фотографического искусства с целью ее дальнейшего использования как памятного исторического документа; </p><p>2.2.4.выявление и поощрение талантливых фотографов, любителей и профессионалов.</p><p><b>3.</b><b>Участники Конкурса</b></p><p>3.1.К участию в Конкурсе приглашаются жители города Тюмени в возрасте от 18 лет и старше.</p><p><b>4.</b><b>Требования к конкурсным работам</b></p><p>4.1.В Конкурсе могут участвовать профессиональные фотографы и фотографы - любители.</p><p>4.2.Конкурс проводится в трех номинациях:</p><p>- черно-белая фотография; цифровая фотография (номинация А);</p><p>- цветная фотография; цифровая фотография (номинация В);</p><p>- диптих-ретроспектива; черно-белая и цветная фотография (номинация С).</p><p>4.3.Участник Конкурса может представить свои работы одновременно в нескольких или во всех номинациях, но не более четырех работ в каждой.</p><p>4.4.Запрещается представлять одинаковые работы для участия в разных номинациях.</p><p>4.5.Серии фоторабот к участию в Конкурсе не принимаются.</p><p>4.6.Содержание фоторабот должно соответствовать следующим темам: «Тюмень: вехи истории», «Тюмень в событиях и лицах», «Тюмень – город новостроек», «Трудовые будни моего города», «Тюмень - город спортивный и творческий», «Юность Тюмени», «Город для детей», «Тюмень: неожиданный ракурс». </p><p>4.7.Представленные на Конкурс работы могут быть сделаны в любой временной период.</p><p>4.8.Фотоработы, присланные на Конкурс, могут быть отклонены от участия в нем в случаях, если работы: </p><p> - не соответствуют тематике Конкурса; </p><p> - имеют низкое художественное или техническое качество;</p><p>- противоречат нормам российского законодательства, содержат призывы к экстремизму, насилию, межнациональному раздору, пропаганду алкоголя и наркотиков;</p><p>- работы с нанесёнными логотипами, копирайтами, надписями.</p><p>4.9.Ответственность за достоверность авторства конкурсной работы несет участник Конкурса. Организатор не несет ответственности за претензии третьих лиц.</p><p>4.10.Присланные на Конкурс работы и их оформление должны соответствовать следующим требованиям: формат публикуемых файлов JPG, качество 11 или 12; ширина по большой стороне кадра: 800 - 1000 пикселей; название файлов прописывается латинскими буквами на любом языке. В названии файла должно быть указано: имя автора, название работы, номинация (в общей сложности до 47 символов, пробелы заменять подчеркиванием). Например, для фотоработы «Утро на реке» в номинации «цветная, цифровая фотография»: Ivan_Ivanov_Utro_na_reke_B.jpg.</p><p><b>5.</b><b>Организация и порядок проведения Конкурса</b></p><p>5.1.Для участия в Конкурсе необходимо заполнить Заявку участника (Приложение 1). Заявка на участие в Конкурсе рассматривается как принятие автором всех условий настоящего Положения. К заявке прилагается Согласие на обработку персональных данных (Приложение 2).</p><p>5.2.Заявки, конкурсные фотоработы и согласия участников на обработку персональных данных направляются на электронный адрес: konkurs430@mail.ru. Работы в рамках одной номинации отправляются одним письмом (4 работы в одной номинации).</p><p>5.3.Присланные на Конкурс работы не возвращаются и не рецензируются.</p><p>5.4.Организатор имеет право вносить изменения в настоящее Положение.</p><p><b>6.</b><b>Сроки проведения Конкурса</b></p><p>6.1.Конкурс проводится в период с 25 мая 2016 года по 21 июля 2016 года включительно. </p><p>6.2.Прием заявок на участие в Конкурсе осуществляется с 25 мая по 16 июля 2016 года включительно. Заявки и конкурсные работы, поданные после указанного срока, к рассмотрению не принимаются.</p><p>6.3.Объявление результатов 25 июля 2016 года через медиаканалы, указанные в п.9 настоящего Положения.</p><p><b>7.</b><b>Экспертная комиссия</b></p><p>7.1.Оценка поступивших на Конкурс работ осуществляется Экспертной комиссией (далее по тексту - Комиссия), состав которой утверждается Организатором Конкурса (Приложение 3). </p><p>7.2.Заседание Комиссии считается правомочным, если на нем присутствует не менее 2/3 его членов. Решение Комиссии по итогам оценки конкурсных работ оформляется протоколом.</p><p><b>8.</b><b>Подведение итогов Конкурса</b></p><p>8.1.Конкурс не предусматривает при подведении итогов распределения призовых мест между его участниками. </p><p>8.2.По итогам Конкурса отбирается 40 лучших работ, которые получают в качестве поощрения возможность экспонироваться (с указанием авторства) на городской выставке, приуроченной к 430-летию со дня основания города Тюмени.</p><p>8.3.Лучшие конкурсные фотоработы определяются Комиссией по максимальной сумме баллов в соответствии со следующими критериями оценки:</p><p>- соответствие тематике Конкурса - от 0 до 10 баллов;</p><p>- оригинальность идеи, сюжета - от 0 до 10 баллов; </p><p>- удачное композиционное решение - от 0 до 10 баллов;</p><p>- техника и качество исполнения - от 0 до 10 баллов.</p><p>8.4.При одинаковой сумме набранных баллов лучшие фотоработы определяются открытым голосованием Комиссии.</p><p>8.5.Организатором Конкурса утверждаются специальные дипломы, которые вручаются участникам Конкурса, авторам лучших работ, на церемонии открытия юбилейной фотовыставки. </p><p>8.6.Учредитель Конкурса и иные заинтересованные лица (сторонние учреждения, организации, общественные фонды и т.п.) могут инициировать учреждение поощрительных призов для участников Конкурса (по согласованию с Организатором) за счет собственных средств.</p><p>8.7.Участники Конкурса предоставляют Организатору неисключительное право на публичное использование конкурсных работ в информационных, презентационных, просветительских и прочих целях, связанных с задачами Конкурса. Договор с авторами об использовании Организатором конкурсных работ может быть заключён в течение одного месяца с момента церемонии награждения победителей Конкурса. </p><p><b>9.</b><b>Информационное обеспечение Конкурса</b></p><p>9.1.Информационное освещение Конкурса осуществляется: в региональных СМИ; на сайте Администрации города Тюмени; в Интернет-СМИ; на официальных сайтах МАУК «ЦГБС» (<a href="http://www.citylib-tyumen.ru/">http://www.citylib-tyumen.ru</a>, <a href="http://writer-tyumen.ru/">http://writer-tyumen.ru</a>, <a href="http://www.tgub.ru/">http://www.tgub.ru</a>, <a href="http://www.bschpushkin.ru/">www.bschpushkin.ru</a>), в официальных группах МАУК «ЦГБС» в социальной сети Вконтакте («Больше, чем ты думаешь», «Библио К.О.Т. (Книги. Общение. Творчество)», «Библиотечный центр для молодёжи»).</p><p><b>10.</b><b>Контактная информация</b></p><p>10.1.РОО «Тюменский дом фотографии» - электронная почта: konkurs430@mail.ru</p><p>10.2.МАУК «ЦГБС» – электронная почта: <a href="mailto:oskd.cgbs@mail.ru">oskd.cgbs@mail.ru</a>,<br></p> <i><br> </i> <p><i>Приложение 1</i></p><p><b>Заявка участника </b></p><p><b>открытого городского конкурса фоторабот «Тюмень: город, события, люди» </b></p> <table> <tbody><tr> <td> <p>Фамилия, имя, отчество участника</p> </td> <td>  </td> </tr> <tr> <td> <p>Дата рождения</p> </td> <td>  </td> </tr> <tr> <td> <p>Почтовый индекс,</p><p>домашний адрес </p><p>(<i>печатными буквами)</i></p> </td> <td>  </td> </tr> <tr> <td> <p>Телефон дом./сотовый, </p><p>адрес электронной почты</p> </td> <td>  </td> </tr> <tr> <td> <p>Участие в фотоконкурсах за последние 3 года</p><p> <i>(российские, региональные, областные, городские, и пр. конкурсы)</i></p> </td> <td>  </td> </tr> <tr> <td> <p>Принадлежность к профессиональному или любительскому объединению, коллективу<i></i></p> </td> <td>  </td> </tr> </tbody></table> <p>Я, ______________________________________ гарантирую достоверность Ф.И.О.</p><p>авторства поданных мной на Конкурс фоторабот и правильность изложенной в заявке информации ________________________.</p><p> (подпись)</p><p>Дата подача заявки: «___»__________ 201__ г.</p> <i><p><i><br></i></p><p><i>Приложение 2</i></p><p><b>Согласие на обработку персональных данных участника </b></p><p><b>открытого городского конкурса фоторабот «Тюмень: город, события, люди» </b></p><p>Я _____________________________________________________________________________________,</p><p><sup>(Ф.И.О. субъекта полностью)</sup></p><p>зарегистрированный(ая) по адресу: ________________________________________________________,</p> <table> <tbody><tr> <td colspan="4"> <p>вид документа, удостоверяющего личность:</p> </td> <td colspan="3">  </td> <td></td> </tr> <tr> <td> <p>серия:</p> </td> <td>  </td> <td> <p> №</p> </td> <td colspan="2">  </td> <td> <p>выдан</p> </td> <td>  </td> <td> <p>,</p> </td> </tr> <tr> <td>  </td> <td>  </td> <td>  </td> <td colspan="2">  </td> <td>  </td> <td> <p><sup>(дата)</sup></p> </td> <td>  </td> </tr> <tr> <td colspan="7"> <p>выдан:</p> </td> <td></td> </tr> <tr> <td colspan="7"> <p><sup>(наименование органа)</sup></p> </td> <td></td> </tr> <tr> <td></td> <td></td> <td></td> <td></td> <td></td> <td></td> <td></td> <td></td> </tr> </tbody></table> <p>в лице законного представителя субъекта персональных данных <i>(заполняется в случае получения согласия от представителя субъекта персональных данных, например, несовершеннолетнего субъекта персональных данных)</i>___________________________________________________________,</p><p><sup>(Ф.И.О. представителя субъекта полностью)</sup></p><p>зарегистрированный(ая) по адресу: _________________________________________________________,</p> <table> <tbody><tr> <td colspan="4"> <p>вид документа, удостоверяющего личность:</p> </td> <td colspan="3">  </td> <td> <p>,</p> </td> </tr> <tr> <td> <p>серия:</p> </td> <td>  </td> <td> <p>№</p> </td> <td colspan="2">  </td> <td> <p>выдан</p> </td> <td>  </td> <td> <p>,</p> </td> </tr> <tr> <td>  </td> <td>  </td> <td>  </td> <td colspan="2">  </td> <td>  </td> <td> <p><sup>(дата)</sup></p> </td> <td>  </td> </tr> <tr> <td colspan="7"> <p>выдан:</p> </td> <td></td> </tr> <tr> <td colspan="7"> <p><sup>(наименование органа)</sup></p> </td> <td></td> </tr> <tr> <td></td> <td></td> <td></td> <td></td> <td></td> <td></td> <td></td> <td></td> </tr> </tbody></table> <p>действующий от имени субъекта персональных данных на основании___________________________</p><p>_______________________________________________________________________________________,</p><p><sup>(реквизиты доверенности или иного документа, подтверждающего полномочия представителя)</sup></p><p>свободно, своей волей и в своем интересе даю согласие уполномоченным должностным лицам Муниципального автономного учреждения культуры города Тюмени «Централизованная городская библиотечная система» (далее – оператор) на обработку (любое действие (операцию) или совокупность действий (операций), совершаемых с использованием средств автоматизации или без использования таких средств с персональными данными, включая сбор, запись, систематизацию, накопление, хранение, уточнение (обновление, изменение), извлечение, использование, передачу (распространение, предоставление, доступ, обезличивание, блокирование, удаление, уничтожение) следующих персональных данных:</p><p>- фамилию, имя, отчество, паспортные данные, дата рождения, место учебы (работы), домашний адрес, контактный телефон, адрес электронной почты, фотографии.</p><p>Вышеуказанные персональные данные предоставляю для обработки в целях организации и проведения открытого городского конкурса фоторабот «Тюмень: город, события, люди».<b> </b></p><p>Я ознакомлен(а), что:</p><p>1) согласие на обработку персональных данных действует с даты подписания настоящего согласия на период проведения конкурса и в течение трех лет со дня его завершения.</p><p>По достижению целей обработки персональные данные уничтожаются.</p><p>2) согласие на обработку персональных данных может быть отозвано на основании письменного заявления в произвольной форме;</p><p>3) в случае отзыва согласия на обработку персональных данных оператор прекратит обработку таких персональных данных в течение 30 (тридцати) рабочих дней.</p><p>Дата начала обработки персональных данных: «____»____________________20___ г.</p><p> __________________/_________________________</p><p> Подпись ФИО полностью</p> <br>  <p><i><br></i></p><p><i>Приложение 3</i></p><p><b>Экспертная комиссия</b></p><p><b> открытого городского конкурса фоторабот «Тюмень: город, события, люди» </b></p><p><u>Председатель экспертной комиссии</u></p><p><b>Фирцев Сергей Валерьевич,</b> директор РОО «Тюменский дом фотографии», член Союза фотохудожников, член Правления Тюменского областного отделения Русского географического общества</p><p><u>Члены экспертной комиссии</u>:</p><p><b>Сульженко Николай Рудольфович</b>, председатель правления клуба любителей фотографии «ФотоРегион».</p><p><b>Молонок Светлана Егоровна</b>, директор Муниципального автономного учреждения культуры города Тюмени «Централизованная городская библиотечная система».</p><p><b>Дыба Валерий Петрович</b>, член Союза фотохудожников, член художественного совета Региональной организации Союза фотохудожников Тюменской области </p><p><b>Михайлов Иван Сергеевич,</b> ведущий инженер отдела по охране памятников истории и культуры департамента культуры Администрации города Тюмени</p><p><u>Секретарь экспертной комиссии</u>:</p><p><b>Маковец Ольга Владимировна</b>, заведующая редакционно-издательских отделом Центральной городской библиотеки</p></i>', NULL, 227, '<p>МАУК «Централизованная городская библиотечная система» при участии РОО «Тюменский дом фотографии» и поддержке РО "Союз фотохудожников Тюменской области", клуба любителей фотографии «ФотоРегион" приглашает жителей Тюмени в возрасте от 18 лет и старше к участию в Открытом городском конкурсе фоторабот <b>«Тюмень: город, события, люди» (далее – Конкурс). </b>Прием заявок на участие в Конкурсе осуществляется по 16 июля 2016 года включительно. Подробнее читайте в Положении о конкурсе.<strong></strong></p>', '2016-06-18 15:12:25', '2016-06-18 15:51:32', 'Novelty', 3, 'otkrytyy-gorodskoy-konkurs-k-430-letiyu-tyumeni'),
(50, 'Фотоклуб по субботам. 8 октября 2016 года', '<p>8 октября 2016 года в 15:00 у нас встреча на очередном фотоклубе! <br></p><p>Обсуждение (дебаты) по философскому вопросу - "Что есть такое фотография?" Ведущие дебат - Сергей Шаповал и Николай Сульженко.<br>Гость фотоклуба - известный московский фотограф Вивиан Дель Рио.<br><br>Просмотр фотографий участников.<br>Контрольные отпечатки.<br><br>г. Тюмень, ул. Орджоникидзе, 59. (Тюменская областная научная библиотека им. Д.И. Менделеева)</p>', NULL, 6, '<p>Очередная встреча фотолюбителй участников фотоклуба "ФотоРегион".</p><p>8 октября 2016 года в 15:00<br></p>', '2016-10-07 10:01:08', '2016-10-07 10:01:08', 'Novelty', 5, 'fotoklub-po-subbotam-8-oktyabrya-2016-goda'),
(51, 'Внимание! 29 октября в 10 часов утра стартует "ФотоФиниш №-51-х3" ', '<p>И опять хотим порадовать любителей фотографии. продолжается цикл периодических блиц-конкурсов под маркой "ФотоФиниш".</p><p>Фотоклуб "ФотоРегион" организует на этот раз проект конкурсов сразу в трёх городах! Отсюда в номере конкурса появилась "х3".</p><p><br>Напоминаем, мероприятия "Фотофиниша" проходили с 2006 года, однако с 2013 года мероприятия планово уже не проводились. И вот спустя три года, весной этого года, 27 марта, был проведен полноценный "ФотоФиниш №50 и 1/3". Сейчас - октябрь, и мы представляем вам следующий шаг этого конкурса - теперь он уже шагнул за границы нашего города. Для нас это новый уровень, надеемся держаться теперь его.</p><p><br>Итак, в ближайшую субботу, 29 октября, в 10 часов утра, в трёх городах одновременно стартует "ФотоФиниш". Приглашаем всех неравнодушных к фотоискусству людей, имеющих фотокамеры, принять участие в этом мероприятии!<br><br></p><p>Кратко, правила конкурса следующие: желающие регистрируются для участия сперва на нашем сайте ( <a href="http://domfoto72.ru/" data-vdir-href="https://mail.yandex.ru/re.jsx?uid=91216424&amp;h=a,xxVWgOzqXYQusoGiC4P-MQ&amp;l=aHR0cDovL2RvbWZvdG83Mi5ydS8" data-orig-href="http://domfoto72.ru/" class="daria-goto-anchor" target="_blank">http://domfoto72.ru/</a> ), а затем, придя на старт конкурса. Объявляется тема, выбранная случайным образом организаторами. После чего все участники расходятся по городу в поисках кадров на заданную тему. К 16 часам участники должны предоставить уже отпечатанные кадры (в количестве до 3-х штук) в объявленное на старте место финиша. Далее идет живое обсуждение работ. В новых правилах народное голосование за работы будет проходить позже, когда авторы разместят в соответствующую рубрику на нашем сайте свои конкурсные фотографии. Собственно, ставить оценки каждой фотографии смогут все участники. Так же свою оценку работам даст худсовет Фотоклуба.<br><br></p><p>Подробнее правила и инструкции по регистрации будут размещены на нашем сайте (смотрите ниже ссылки).</p><p>Телефон куратора:  +79044912880</p><p><a href="http://domfoto72.ru/ru/competitions/fotofinish-51-h3">Положение о блиц-конкурсе "ФотоФиниш № 51 х3"</a></p><p>Следите за новостями здесь и в группах Фотоклуба в социальных сетях:</p><p><a href="https://www.facebook.com/groups/photoregion/" target="_blank">В Фейсбуке</a> | <a href="http://vk.com/fotoregion" target="_blank">В Контакте</a> | <a href="https://vk.com/club2022691" target="_blank">Группа ФотоФиниша в Контакте</a></p><p><img src="/system/redactor_assets/pictures/107/IMG_9165.jpg" style="height: 418px; width: 614px;"></p>', NULL, 6, '<p>Сразу в трёх городах стартует блиц-конкурс фотографии "<strong>ФотоФиниш №-51</strong><strong>-х3</strong>".</p><p>Клуб "ФотоРегион" проведёт мероприятие в Тюмени, Кургане и Тобольске одновременно.</p>', '2016-10-23 21:32:36', '2016-10-24 19:08:24', 'Novelty', 4, 'vnimanie-29-oktyabrya-v-10-chasov-utra-startuet-fotofinish-51-h3'),
(52, 'Внимание! Ведутся работы! Регистрация скоро будет доступна.', '<p><strong>Ведутся срочные ремонтные работы сайта. Временно регистрация пользователей не работает. Скоро всё будет доступно. Приносим свои извинения!</strong></p><p><strong><br></strong></p><p><img src="/system/redactor_assets/pictures/108/underconstruction-1.jpg" style="height: 339px; width: 355px;"></p>', NULL, 6, '<p><strong>Ведутся срочные ремонтные работы сайта. Временно регистрация пользователей не работает. Скоро всё будет доступно. Приносим свои извинения!</strong></p>', '2016-10-24 18:52:34', '2016-10-24 18:52:34', 'Novelty', 3, 'vnimanie-vedutsya-raboty-registratsiya-skoro-budet-dostupna'),
(53, 'Объединённая фотовыставка "Монументальность момента" ', '<p>Уважаемые фотографы и любители фотографии и визуального искусства! Приглашаем вас на открытие объединённой фотовыставки "Монументальность момента". </p><p>Фотоработы предоставлены тюменским фотоклубом «Фоторегион» и молодежной фотостудией «Истоки» ГАУ ДО ТО ДТиС «Пионер»</p><p>Открытие фотовыставки в четверг, 27 октября 2016 года в 17:00, в музее-усадьбе Колокольниковых (Тюмень. ул. Республики д. 20.)</p><p>Будем рады видеть вас!</p><p><img src="/system/redactor_assets/pictures/109/afisha-monumentalnost-momenta.jpg" style="height: 564px; width: 376px;"></p><p>Список участников:</p><p>Александр Засекин <br>Александра Кутергина <br>Анастасия Гололобова <br>Вадим Шаров <span class="text_exposed_show"><br>Дмитрий Изосимов <br>Лариса Славий <br>Людмила Дунькова <br>Людмила Цвиккер <br>Мария Федорова <br>Надежда Поплавская <br>Никита Куратов <br>Николай Сульженко <br>Олег Орлов <br>Ольга Завидонова <br>Павел Анущенко <br>Сергей Шаповал <br>Татьяна Жукова <br>Тимофей Герасимов <br>Юлия Сульженко</span></p>', NULL, 6, '<p>Фотоработы предоставлены тюменским фотоклубом «Фоторегион» и молодежной фотостудией «Истоки» ГАУ ДО ТО ДТиС «Пионер»</p><p>Открытие фотовыставки в четверг, 27 октября 2016 года в 17:00, в музее-усадьбе Колокольниковых (Тюмень. ул. Республики д. 20.)</p>', '2016-10-24 19:05:54', '2016-10-24 19:05:54', 'Novelty', 3, 'ob-edinyonnaya-fotovystavka-monumentalnost-momenta'),
(54, 'Поздравляем победителей Фотофиниша №51 х3 "Во власти скорости"', '<p><strong>29 октября 2016</strong> года проходил блиц-конкурс <strong>ФотоФиниш № 51 х3</strong>.<br>Это было знаковое событие, ведь этот конкурс впервые проходил сразу в трёх городах: Тюмень, Курган и Тобольск!  <a href="http://domfoto72.ru/ru/novelties/vnimanie-29-oktyabrya-v-10-chasov-utra-startuet-fotofinish-51-h3" target="_blank">Подробнее читайте здесь</a></p><p><img src="/system/redactor_assets/pictures/110/14884452_1191982597514326_4280497542600819078_o.jpg" style="height: 314px; width: 449px;"></p><p><strong>Результаты</strong> ФотоФиниша №51 х3 "Во власти скорости": <a href="http://domfoto72.ru/ru/competitions/fotofinish-51-h3/results/21" target="_blank">ссылка на результаты</a>. Напомню. Первое место выбирается по максимальному баллу, худсовета, 2е и 3е место по максимальным баллам голосования участников фотофиниша. Так уж в этот раз совпало, что первое место которое выбрал худсовет совпало с 1м местом народного голосования.</p><p>Итак, <br>1е место <strong>Егор Гутенко</strong>!<br>2е место <strong>Юлия Сульженко</strong><br>3е место <strong>Жагорина Анна</strong></p><p>Поздравляю победителей! Их ждёт торжественное вручение грамот на ближайшем собрании фотоклуба "ФотоРегион" 5 ноября!</p><p><a href="http://domfoto72.ru/ru/competitions/fotofinish-51-h3/best?page=1" target="_blank">Здесь рейтинг оценок фотографий от худсовета</a><br></p><p>1е место:</p><p><img src="/system/redactor_assets/pictures/111/normal_IMG_5725_web.jpg"><br></p><p><br></p><p>2е место:</p><p><img src="/system/redactor_assets/pictures/112/normal_IMG_0790-rez.jpg"></p><p><br></p><p>3е место:</p><p><img src="/system/redactor_assets/pictures/113/normal_DSCF9827-2.jpg"></p>', NULL, 6, '<p>1 ноября стали известны результаты голосования по блиц-конкурсу "Фотофиниш № 51 х3".</p>', '2016-10-31 20:09:56', '2016-11-02 10:41:10', 'Novelty', 3, 'pozdravlyaem-pobediteley-fotofinisha-51-h3-vo-vlasti-skorosti'),
(55, 'Открытие фотовыствки "Будни архангельской деревеньки" Александра Степаненко', '<p><span></span></p><p><img src="/system/redactor_assets/pictures/116/Arhangelsk-derevnia-Aleksandr-Stepanenko-2.jpg" style="height: 487px; width: 487px;"></p><br><p>Автор выставки, мурманский фотограф Александр Степаненко, на протяжении многих лет наблюдал жизнь немногочисленных обитателей деревни Малые Озерки Плесецкого района Архангельской области. В результате серия репортажных фотографий сложилась в трогательный и трагический документальный образ умирающей российской деревни. <br></p><p><br>Малые Озерки — деревня в Плесецком районе Архангельской области, в 85 км к северу от космодрома Плесецк. Рядом с деревней - посёлок городского типа Обозерский.<br><br>Александр Степаненко снимает в Малых Озерках уже 30 лет.</p><p>Выставка проходит по адресу: Червишевский тракт, 15/1, Городская юношеская библиотека. <br></p><p>Открытие будет 6 ноября (воскресение) в 11 часов.</p><p><img src="/system/redactor_assets/pictures/117/Arhangelsk-derevnia-Aleksandr-Stepanenko.jpg"></p><br>', NULL, 6, '<p>Выставка проходит по адресу: Червишевский тракт, 15/1, Городская юношеская библиотека. </p><p>Открытие будет 6 ноября (воскресение) в 11 часов.</p>', '2016-11-02 10:32:03', '2016-11-02 10:32:03', 'Novelty', 5, 'otkrytie-fotovystvki-budni-arhangelskoy-derevenki-aleksandra-stepanenko');
INSERT INTO `posts` (`id`, `title`, `content`, `published`, `user_id`, `digest`, `created_at`, `updated_at`, `type`, `age_policy_id`, `slug`) VALUES
(56, '​МЕЖДУНАРОДНЫЙ ФОТОКОНКУРС "ВЗГЛЯД ИНОСТРАНЦА"​', '<p>Приглашаем принять участие всех любителей фотографии в международном фотоконкурсе "ВЗГЛЯД ИНОСТРАНЦА"<br> <br> Международный конкурс «Взгляд иностранца» уже в седьмой раз предлагает любителям и мастерам фотоискусства продемонстрировать собственный взгляд на важнейшие события окружающего нас мира. Девиз 2016 года «Кино - это правда»<br> (У каждого свой фильм). <br> <br> Работы будут оцениваться по 8 номинациям: <br> «Человек с киноаппаратом»<br> «Новая волна»<br> «КиноДок»<br> «Улица на экране»<br> «Сибирь. Я люблю тебя»<br> «Через Запад на Восток»<br> «Личный архив»<br> «Народное голосование»<br> <br> Принимаются фотографии ДО 1 ДЕКАБРЯ 2016 ГОДА в формате jpeg с разрешением 300 dpi и размером файла до 5 Мб. Снимки загружаются без каких-либо надписей, нанесенных после съемки, или на официальном сайте фотоконкурса <a href="http://foreignview.prlib.ru/" target="_blank">foreignview.prlib.ru</a><span class="apple-converted-space">. </span><br> <br> Согласно условиям конкурса, рассматриваются фотографии, сделанные гражданами вне пределов своего государства (например, работы, снятые россиянами за рубежом, и снимки иностранцев, сделанные во время посещений России). <br> <br> Подведение итогов состоится в январе 2017 года, победители конкурса получат дипломы и будут приглашены в Президентскую библиотеку, г. Санкт-Петербург. Участвуй в конкурсе- стань частью истории!</p><p>По всем возникающим вопросам можно обращаться по телефону +7(3452)56-52-80 в Тюменский филиал Президентской библиотеки.</p><p>УСПЕХОВ ВАМ, ВДОХНОВЕНИЯ И ТВОРЧЕСКИХ ПОБЕД!</p><p><img src="/system/redactor_assets/pictures/118/AFIShA.jpg" style="height: 708px; width: 455px;"></p>', NULL, 6, '<p>Приглашаем принять участие всех любителей фотографии в международном фотоконкурсе "ВЗГЛЯД ИНОСТРАНЦА"</p>', '2016-11-12 16:17:02', '2016-11-12 16:17:02', 'Novelty', 4, 'mezhdunarodnyy-fotokonkurs-vzglyad-inostrantsa');
