INSERT INTO `site_rules` (`id`, `created_at`, `updated_at`, `rules`, `rules_digest`, `locale`) VALUES
(1, '2014-08-20 03:32:50', '2017-05-29 11:02:58', '<h3><strong>Полная версия правил и условий использования сайта Тюменского дома фотографии.</strong></h3><p>Настоящие правила регламентируют условия использования данного ресурса, а так же требования к пользователям, их права и обязанности, возникающие при регистрации на ресурсах сайта Тюменского дома фотографии  domfoto72.ru(далее Сайта).</p><p><strong>1) Соглашение об обработке персональных данных.</strong></p><p style="margin-left: 20px;">Данное соглашение об обработке персональных данных разработано в соответствии с законодательством Российской Федерации.</p><p style="margin-left: 20px;">Все лица заполнившие сведения составляющие персональные данные на данном сайте domfoto72.ru, а также разместившие иную информацию обозначенными действиями подтверждают свое согласие на обработку персональных данных и их передачу оператору обработки персональных данных.</p><p style="margin-left: 20px;">Под персональными данными Гражданина понимается подписные формы и любая биографическая информация:общая информация (Ф.И.О посетителя); год, число и месяц рождения; e-mail, любая информация из социальных сетей, серия номер любого индивидуального документа. Посетители сайта направляют свои персональные данные оператору в целях получения какой-либо необходимой посетителю информации, принадлежащей сайту domfoto72.ru. </p><p style="margin-left: 20px;">Гражданин, принимая настоящее Соглашение, выражают свою заинтересованность и полное согласие, что обработка их персональных данных может включать в себя следующие действия: сбор, систематизацию, накопление, хранение, уточнение (обновление, изменение), использование, уничтожение.</p><p style="margin-left: 20px;">Гражданин гарантирует: информация, им предоставленная, является полной, точной и достоверной; при предоставлении информации не нарушается действующее законодательство Российской Федерации, законные права и интересы третьих лиц; вся предоставленная информация заполнена Гражданина в отношении себя лично</p><p><strong>2) О Сайте.</strong></p><p>Сайт domfoto72.ru (далее Сайт) является оффициальным сайтом общественной органицации Тюменского дома фотографии и тюменского фотоклуба "ФотоРегион". Основой сайта являются аккаунты фотографов, (и соответственно фотографии) участников фотоклуба, ТДФ. Так же мы приветствуем участие фотографов из других городов, регионов и стран. На площадке нашего сайта проходят виртуальные выставки фоторабот участников фотоклуба, наших гостей и известных мастеров фотографии. Так же в рамках проекта Сайта предусмотрена площадка для проведения фотоконкурсов как собственного патранажа, так и фотоконкурсов подж эгидой FIAP. Так же на Сайте размещены новости ТДФ, и статьи на сопутствующие фотографии и деятельности ТДФ темы.</p><p>На Сайте реализована возможность свободной регистрации любых желающих фотографов (любителей и профессионалов). Регистрируясь на Сайте, вы подтверждаете что вы увлечены фотографией являясь при этом профессиональным фотографом или фотолюбителем. Регистрация людей не увлекающихся фотографией будет отклонена Администрацией сайта при выявлении таковой. Так же не допустима регистрация с иными, не связанными с фотографией целями (реклама, не связанное с фотографией общение и прочее).</p><p>Зарегистрировавшимся фотографам мы предлагаем разместить на наших страницах свое портфолио, участие в проводимых ТДФ фотоконкурсах, размещение фотографий для ревью, общение с коллегами на фотографические темы, подписку на новости и другие события ТДФ, комментировать фотоработы других участников, помечать понравившиеся вам на конкурсах фотографии, заводить творческие контакты.</p><p>Фотографии, участвующие в конкурсах, из портфолио авторов - не могут быть удалены автором, в связи с политикой сайта. Автор, разместивший свои фотографии на сайт, использовав их на одном из проводимых на Сайте конкурсов, соглашается с тем, что его фотографии могут и будут храниться на сайте в течении срока его (Сайта) работы. Т.е. автор соглашаются, что его фотоработы, участвующие в конкурсах, могут храниться на сайте 15 лет и далее, пока будет поддерживаться функциональность Сайта.</p><p><strong>3) Регистрация на Сайте.</strong></p><p>Для полноценного участия в ресурсах Сайта и его мероприятиях необходима регистрация. Заполняя форму регистрации, вы соглашаетесь со всеми условиями и правилами, установленными для пользователей Сайта. Вы не оспариваете ни одного пункта правил Сайта и полностью с ними согласны. </p>', '<p><strong>Правила сайта Тюменского дома фотографии</strong></p><p>Заполняя форму регистрации, я соглашаюсь со всеми условиями и правилами, установленными для пользователей нашего сайта (Тюменского дома фотографии). Я не оспариваю ни одного пункта правил сайта и полностью с ними согласен. </p><p><a href="http://domfoto72.ru/about/rules?locale=ru">Читать полную версию правил сайта</a></p>', 'en'),
