INSERT INTO `users` (`id`, `email`, `encrypted_password`, `reset_password_token`, `reset_password_sent_at`, `remember_created_at`, `sign_in_count`, `current_sign_in_at`, `last_sign_in_at`, `current_sign_in_ip`, `last_sign_in_ip`, `created_at`, `updated_at`, `name`, `confirmation_token`, `confirmed_at`, `confirmation_sent_at`, `unconfirmed_email`, `avatar`, `last_name`, `zip`, `adress`, `zip_code`, `city`, `country`, `phone`, `about`, `login`, `slug`, `birth_date`, `photos_count`, `blocked`) VALUES
(1, 'vith77@gmail.com', '$2a$10$8TDQIhtbXeB56ippPdtuG.oOlOyC9WO9BnBhef.AWZB3dXgWMkjY.', '78b446ee72dcb4e9399c8d2db1bf61b3a6f7bc3540deee2737dc52a0afb55f64', '2016-10-25 12:01:25', '2016-03-29 17:08:36', 222, '2016-10-30 08:00:26', '2016-10-29 18:48:51', '5.141.234.24', '92.255.165.65', '2014-04-17 14:07:11', '2016-10-30 08:00:26', 'Виталий', NULL, '2014-04-17 14:09:34', '2014-04-17 14:07:11', NULL, '31685_102586116454180_3599589_n.jpg', 'Нестеренко', NULL, 'не дом и не улица', '625000', 'Тюмень', 'RU', '+79224734936', '<p>\r\n	   Тут много букв</p>', 'vith', 'vith', '1977-11-14', 6, NULL),
(6, 'nyksu@yandex.ru', '$2a$10$ZsG9/uYvFNsK/05HwrQhye/cLQb8zDRjnA5pqpi8/Wdnb9BM0puWu', NULL, NULL, NULL, 828, '2017-05-29 12:17:08', '2017-05-29 09:33:20', '31.163.127.104', '188.186.88.83', '2014-04-18 09:56:40', '2017-05-29 12:17:08', 'Николай (Nikolay)', NULL, '2014-04-18 09:56:57', '2014-04-18 09:56:40', NULL, '183464_102893556458150_6176308_a.jpg', 'Сульженко (Sulzhenko)', NULL, 'ул. Ставропольская, д. 11А, кв. 76', '625062', 'Тюмень', 'RU', '+79222615141', '<p>\r\n	 <span style="background-color: initial;">Родился в г. Тюмени в 1973 году. </span></p><p>\r\n	 <br>\r\n	 Фотокамеру взял в руки впервые в 1984 году, и с тех пор так или иначе фотографировал, постепенно постигая теорию и навыки фотопроцесса. <br>\r\n	 Переломным моментом в моей творческой деятельности явилось создание фотосайта "ФотоРегион" в конце июля 2004 года. С этого момента я кардинально поменял взгляд на фотографию и всерьез ей увлекся.</p><p>\r\n	С сотоварищами и коллегами получилось собрать коллектив единомышленников и создать фотоклуб с тем же наименованием, что и сайт - "ФотоРегион".</p><p>\r\n	Вместе организовывали неоднократно семинары и мастер-классы с известными фотографами, устраивали фотовыставки и фотоконкурсы. Что позволяло заметно расти в творческом потенциале.</p><p>\r\n	С сентября 2009 года я стал официально преподавать фотографию в фотошколе "Первый кадр", что дало дополнительное осознание сути фотографии.</p><p>\r\n	С ноября 2010 года открыл свою фото-школу в рамках проекта "Гильдия фотографов".</p><p>\r\n	Неоднократно участвовал в фотовыставках, фотоконкурсах, неоднократно приглашался в жюри для оценок фоторабот. Самым значимым для меня достижением в фото-творчестве, конечно же, считаю получение золотой медали за первое место в международном фотоконкурсе портрета (Словения 2008 год) под эгидой международной ассоциации фотографов FIAP.</p>', 'Nyk', 'nyk', '1973-10-29', 39, NULL),
(7, 'julagella@yandex.ru', '$2a$10$K0nqvhkMaxHbOGs0VUdo5e2PcPdnk.ZNM8nFsTCfZlL3nv1g1czP.', NULL, NULL, '2016-10-25 05:29:31', 29, '2016-11-01 17:29:49', '2016-10-31 17:20:11', '92.255.165.65', '92.255.165.65', '2014-06-29 04:13:26', '2016-11-01 17:29:49', 'Юлия', '', '2014-12-29 04:46:00', '2014-12-29 04:13:00', '', 'IMG_0112-web.jpg', 'Сульженко', '', 'Stavropolskaya str., 11a, 76', '625062', 'Tyumen', '', '+79058251947', '', 'Photogella', 'photogella', '1978-11-25', 16, NULL),
