(76, 'romka011090@gmail.com', '$2a$10$HXEEN6UIgHAZ9qm4Oh6APezpQp.RhPgS9wdogATZH3L4//HOiNYjK', 'kLhasir4EXzJaSxi8Ezh', NULL, NULL, 3, '2014-12-16 06:47:47', '2014-12-16 03:05:15', '178.236.210.118', '178.236.210.118', '2014-10-29 08:25:54', '2014-12-16 06:47:47', 'Роман', 'a17d63c0b0850ff14bc69d8a5c738726cf4b7a3b56927fe711f304e39a5c38c3', '2014-11-04 07:00:03', '2014-10-29 08:25:55', NULL, NULL, 'Волков', NULL, 'Елизарова', '625000', 'Тюмень', 'RU', '', '<p>Мне 24 года и моя жизнь сейчас наполнена множеством самых различных увлечений. Одним из главных моих увлечений является фотография. Фотографией я занимаюсь не так давно, около 2х лет. Тем не менее на данный момент это является неотъемлемой частью моей жизни. Создание фотографии - это целый творческий процесс. Мне важно, чтобы снимок был живым, наполнен смыслом, идеей. В процессе фотосъемки я всегда стараюсь создать максимально дружественную атмосферу, будто мы знакомы уже очень давно, чтобы человек перед камерой мог расслабиться, почувствовать себя свободно и непринужденно.</p>', 'RomanVolkov', 'romanvolkov', '1990-10-01', 8, NULL),
