(156, 'surgutpres@yandex.ru', '$2a$10$8NUpcjaDWFNt5U68A4B.ruq0zTJMmuMoQT/xOdwJom9a6srcOa2sy', NULL, NULL, '2014-12-19 16:18:18', 20, '2015-02-17 04:53:20', '2015-02-12 18:35:08', '194.169.247.1', '95.172.99.95', '2014-12-19 16:15:24', '2015-02-17 04:53:20', 'Александр', 'ac2f4fe7c89a32fc450d8925f93a90d28b16e8e8f8a5dfa0205942d30e3713e8', '2014-12-19 16:17:59', '2014-12-19 16:15:35', NULL, 'n9dcUX6Z5kE.jpg', 'Андриенко', NULL, 'ul. Energetikov, 5 - 203', '628412', 'Surgut', 'RU', '+79222626671', '<p>Фотографией увлекаюсь с тех самых пор, когда отец подарил мне фотоаппарат "Смена 8м". Хоть сейчас и век цифровых технологий, но я очень трепетно отношусь к плёнке. До сих пор в моем холодильнике у неё есть своё место )</p><p>Вырос и живу в небольшом сибирском городе Сургуте. Выпускник Тобольской Духовной Семинарии и Сургутского государственного университета.</p><p>Работаю специалистом по связям с общественностью в Администрации города. Фотографирую для журнала "Югра", газет "Сургутские ведомости", "Сургутская трибуна".</p><p>Член союза журналистов России, член фотоклуба "Отражение".</p>', 'Андриенко', 'andrienko', '1981-07-10', 4, NULL),
(157, 'aharab@bk.ru', '$2a$10$vNTQF4dxgiZtBSGznjBe.eh8ZGvcCot4RWf3HvaNiIq1SnIeTtN.W', 'svBsHzxTrXz5H-3xjhjL', NULL, '2015-01-15 21:45:56', 4, '2015-01-15 21:45:56', '2014-12-25 16:40:38', '178.70.130.59', '178.70.139.113', '2014-12-19 17:09:45', '2015-01-15 21:45:56', 'Andrey', '9242fba42d5509a9f99ba3fd5b888ccd0a89796f6faffd3daac79eb3f243e268', '2014-12-19 17:24:41', '2014-12-19 17:09:51', NULL, NULL, 'Kharabarin', NULL, NULL, NULL, NULL, 'RU', NULL, NULL, 'aharab', 'aharab', '1963-01-11', NULL, NULL),
