(159, 'solas@list.ru', '$2a$10$pedtO4rsTq7PM1tT11g47OHZAafKJlooY3ZHBfQavHQfJ5QyPiNYm', NULL, NULL, NULL, 9, '2015-02-01 21:21:03', '2015-01-25 10:35:01', '178.66.175.227', '178.66.141.203', '2014-12-20 19:09:59', '2015-02-01 21:21:03', 'Михаил', '6b2efbd3cc07ac713a738e56e18501e37cfdbb9c65f0d559bdc53d12f68fa721', '2014-12-20 19:20:48', '2014-12-20 19:10:12', NULL, NULL, 'Бочкарев', NULL, 'ул.Зверинская 33, кв.32', '197198', 'Санкт-Петербург', 'RU', '89817003974', '<p>Родился в г.Ханты-Мансийске. Фотографирую с 1994г, занимался в фотостудии Станции Юных Техников в г.Ханты-Мансийске под руководством Пьянкина Б.Г., в фотостудии "Истоки" г.Тюмени под руководством Орлова О.М. В 2013г победитель фотоконкурса «Наша родина – Россия, наш Дом – Югра», российского фотоконкурса National Geographic Russia «Настроение города»; приз главного редактора газеты "Тюменская область сегодня" в фотоконкурсе "Сибирь - земля счастливых людей"; фотоконкурсов "Вино и критика" Городского центра фотографии г.Чикаго.&nbsp;В 2014г призер фотоконкурсов журнала Фото & Видео "Ночной город" (1е место), "Ситуация" (2е место), "Черно-белая фотография" (3е место). Финалист конкурса Best Of Russia 2014.&nbsp;</p>', 'Solas', 'solas', '1982-04-11', 4, NULL),
(160, 'kniz-natalya@yandex.ru', '$2a$10$6BmUOPwLB/u3p1tnKgG7oe.Yus91NHnJQSI3c1ItnPcaE5n8XZHOC', '9bc234a5bb18eadea7acc9a262917a8a1b345b7285aa463e4b032d560813e81d', '2015-01-15 18:53:33', '2014-12-20 20:49:00', 1, '2014-12-20 20:49:00', '2014-12-20 20:49:00', '188.254.126.244', '188.254.126.244', '2014-12-20 20:47:31', '2015-01-15 18:53:33', 'Наталия', '63dd0866324049b540e00b96b1cc5cb261f5cf0e8786a66f5dde1302ac975fae', '2014-12-20 20:48:32', '2014-12-20 20:47:31', NULL, NULL, 'Книжникова', NULL, NULL, NULL, NULL, 'RU', NULL, NULL, 'soul', 'soul', '1952-05-03', NULL, NULL),
(161, 'linabeliaeva@yandex.ru', '$2a$10$kbj8NSSvnInfoSQJX.O1aeNQlZG5TIur7OAcOqzGSEtKUjrFa7znu', 'PeEw39svxFCA4yUxztqe', NULL, NULL, 1, '2014-12-21 09:11:32', '2014-12-21 09:11:32', '83.149.35.221', '83.149.35.221', '2014-12-21 08:09:48', '2014-12-21 09:56:12', 'Алина', '3f6507e600a12842e7faa8d34665d2c0205c83f0841cef052fff16ab3a78fded', '2014-12-21 09:04:19', '2014-12-21 08:09:55', NULL, '_.jpg', 'Киселёва', NULL, 'Magnitogorsk, Chelyabinskay oblast, pereylok Sovetskiy 6-2', '455036', 'Magnitogorsk', 'RU', '89193089429', '<p>Родилась в Магнитогорске в 1986 г. Образование высшее, окончила &nbsp;факультет изобразительного искусства и дизайна, МаГУ. &nbsp;&nbsp;Художник, фотограф.&nbsp;&nbsp;Участник всероссийских и международных конкурсов.&nbsp;</p>', 'Northwind ', 'northwind', '1986-11-26', 4, NULL),
(162, 'george.stolyarov@gmail.com', '$2a$10$nLkTdYVWKSVs2TNZu4C7Y.Lrq428kJkFBsTAh2McTZtGFdQ8uySym', NULL, NULL, NULL, 9, '2015-01-12 15:37:00', '2015-01-12 15:32:00', '80.91.24.241', '80.91.24.241', '2014-12-21 09:18:17', '2015-01-13 03:25:53', 'Георгий', '077093f57691f154709e32c6b50586e692320f99bb99854f17db12c7d436d7f4', '2015-01-22 10:04:00', '2015-01-21 09:18:00', '', NULL, 'Столяров', '03107', 'Kalinausko str. 16-18', '03107', 'Vilnius', 'LV', '', 'AFIAP', 'george.stolyarov', 'george-stolyarov', '2015-01-11', 9, NULL),
(163, 'fotofil1@yandex.ru', '$2a$10$Ax.QBcXwx4Idbc0gWKhmJOpfMqnmRqVsEw5QBh3mf4GKoY1K4jRum', NULL, NULL, '2015-01-22 03:49:27', 14, '2015-02-04 03:57:04', '2015-02-04 03:54:56', '178.46.158.120', '178.46.158.120', '2014-12-21 15:31:16', '2015-02-04 03:57:04', 'Vadim', 'fc33238bfaa0036974357365ae4e87d02005c7692f28d23a8dfe7e025e3abd7e', '2014-12-21 15:32:28', '2014-12-21 15:31:19', NULL, NULL, 'Pershin', NULL, 'Тюменская область', '626152', 'Tobolsk', 'RU', '89324758299', '<p>Фотографирую с 80х, работал фотографом с&nbsp; 90 года...</p>', 'Fotofil', 'fotofil', '1968-10-03', 5, NULL),
(164, 'brs1983@yandex.ru', '$2a$10$MbL4dFUqP7LCDP/tmxvBVeTnSBQZhfF9CRVTASwBTYrYDwm7tdzu6', NULL, NULL, '2014-12-21 15:52:20', 3, '2015-07-05 13:31:58', '2014-12-22 20:36:35', '83.220.236.6', '62.63.86.214', '2014-12-21 15:51:11', '2015-07-05 13:36:45', 'Roman', 'c80461c951374695f82ce2832c5b1fd0aceb8d08aef6059f056623963a27ffe5', '2014-12-21 15:51:45', '2014-12-21 15:51:12', NULL, '_________1.jpg', 'Bochagin', NULL, 'Россия, Московская область, Ногинский район, город Черноголовка, улица Первая 23-21', '', 'Москва', 'RU', '+7-903-500-68-68', '<p>Бочагин Роман Сергеевич, родился в г. Иваново. </p><p>Член Союза Фотохудожников России. Лауреат и финалист многих фото конкурсов.</p><p><br>\r\nС фотоделом познакомился в детстве, сначала сломав у отца Зенит, а затем\r\n включил свет, когда отец печатал фотографии... А если серьезно, то \r\nфотографией увлёкся и навсегда с 2010 года.\r\n<br>\r\nНачинал с пленочного, да и сейчас на него люблю снимать, особенно Ч/Б. \r\nНо в основном снимаю на цифру… Фотография - это мое хобби и страсть, \r\nставшая моим серьёзным увлечением!\r\n<br>\r\nКамеру всегда ношу с собой, он мой верный друг – помогает мне \r\nсправляться с житейским негативом и наполняет мою Душу исключительно \r\nположительной энергией…\r\n<br>\r\nПервыми снимками и их сюжетами - была Москва, но любимым направлением в \r\nфотографии постепенно стала жанровая и архитектурная фотография. Обожаю в\r\n свободное время бродить по улочкам Москвы и её дворцовым паркам. \r\nБольшинство моих работ представляют собой, на мой взгляд, удачное \r\nсочетание современной фототехники с использованием инструментов \r\nфотообработки, которые позволяют мне передать зрителю свое видение \r\nокружающей нас действительности и бытия с художественным взглядом на \r\nказалось бы обычные сюжеты. Стараюсь, чтобы у каждого моего снимка было \r\nсобственное эмоциональное звучание и содержание.\r\n<br>\r\nВ процессе съемки я стараюсь придать этому содержанию позитивные эмоции, а образу – гармонию.\r\n<br>\r\nКаждый раз, обдумывая новую работу, я мысленно выстраиваю изображение \r\nтаким образом, чтобы через него выразить мое видение композиции, и в \r\nрезультате передать свое восприятие окружающего нас мира...\r\n<br>\r\nВ каждой своей работе, увиденной через объектив фотокамеры, я стараюсь \r\nпередать зрителю и оставить частичку моего сердца все свои эмоции \r\nувиденной Доброты и Любви Творца, которые окружают нас в этом грешном \r\nМире…\r\n<br>\r\nГлавное для меня - творческий процесс, новые работы и вдохновение, \r\nкоторые заставляют меня вовремя нажать на кнопку затвора фотоаппарата!</p>', 'Roman B', 'roman-b', '1983-11-16', 3, NULL),
