(184, 'arhipovska.valia@mail.ru', '$2a$10$yipX468U9hYgCPYKrdsymudjlg9KRlRF6CpWAvTIN0oC7uL/yLB1y', NULL, NULL, '2015-01-03 09:47:28', 25, '2015-01-14 11:21:39', '2015-01-14 06:51:31', '193.106.163.11', '193.106.163.11', '2015-01-03 09:22:41', '2015-02-02 13:06:28', 'Валентина', '303728278924f78e333453174bb7254152037dcf670371f8c7acb9a1514e341d', '2015-01-05 09:33:45', '2015-01-03 09:22:43', NULL, NULL, 'Архиповская', NULL, 'Калининградская обл.', ' 238520', 'г.Балтийск, ул. Ленина д.62, кв. 144', 'RU', '89622654057', '<p>Фотографическую биографию начала в 1984 году в газете "Нефтеюганский рабочий" г.Нефтеюганска Тюменской &nbsp;обл. &nbsp;Волею судьбы пришлось работать в музее Балтийского флота, в периодической прессе Калининграда и области. Многочисленные персональные выставки местного значения. Член &nbsp;Творческого Союза художников России региональное отделение. Отмечена бронзовой и серебряной медалями.</p>', 'Архипова', 'arhipova', '1951-08-11', 13, NULL),
