(210, 'vasyamas@list.ru', '$2a$10$zZJGAQgZPNO24RMbeE2ocuuF8gC3Nzq7OJ99dNyVpTFe2jMbRC04e', NULL, NULL, NULL, 9, '2015-02-04 07:35:40', '2015-01-15 18:51:09', '92.255.165.65', '92.255.165.65', '2015-01-15 08:26:01', '2015-02-04 07:35:40', 'Василий', '8883982cade3d187d38ecf62dd9d43005d87793da6a6cfccf2085b45ac800368', '2015-01-15 10:19:13', '2015-01-15 10:18:06', 'vasyamas@gmail.com', 'avatar-tmFoto-3.jpg', 'Маслюков', NULL, 'ул. Академическая, дом 1', '664520', 'Листвянка, Иркутской области', 'RU', '+79834070870', '', 'ua0sn', 'ua0sn', '1946-03-20', 4, NULL),
(211, 'pashukag@mail.ru', '$2a$10$juwiXIASnoGDE/0CuXst/.ntupsc.V9T.h5hPrVlGJ8oEvOirKkxO', NULL, NULL, NULL, 7, '2015-03-27 14:44:17', '2015-01-29 18:19:38', '77.242.98.95', '77.242.100.159', '2015-01-15 12:34:00', '2015-03-27 14:44:17', 'Анатолий', '0df4a7e7b85347410f041b4141f317b24bbf7c3d03505ef088d0863857f64939', '2015-02-05 02:44:05', '2015-01-15 12:34:01', NULL, 'pashuk-a-00.jpg', 'Пашук', NULL, 'Адрес', '625000', 'Тюмень', 'RU', '', '<p>Родился 8 февраля 1941 года в селе Красный Яр, Кондинского района, Ханты-Мансийского округа. После окончания средней школы работал на заводе, матросом в Мурманске, заливщиком в литейном цехе, служил в рядах СА. Закончил Тюменский пединститут по специальности учитель биологии и географии, работал учителем. Публиковаться в местной прессе начал ещё будучи студентом.</p><p>С 1970 года - профессиональный журналист, работал в газетах "Тюменский комсомолец", "Тюменская правда", сотрудничал с журналами "Вокруг света", "Юный натуралист". С 1974 года член Союза Журналистов СССР.</p><p>В 1975 году организовал областной фотоклуб "Тюмень". Участник, а иногда и призёр, многих российских, всесоюзных и зарубежных фотовыставок. Автор книг "Встречи с природой", "Таёжными тропами", "В глухарином краю", фотоальбома "Лоси спешат домой".</p><p>Фотография «Тынзян» побывала в разных странах - от Голландии до Бразилии, и получила золотую медаль FIAP (Международная федерация фотоискусства).</p><p>В настоящее время работаю редактором отдела фотоиллюстраций журнала "Югра", издающегося в Ханты-Мансийске, живу в Тюмени.</p>', 'pshik', 'pshik', '1941-02-08', 3, NULL),
