(349, 'arkadiy8372@gmail.com', '$2a$10$OHCdchCCa.83hsvyRXNNduV/xsK.B5rG.jo7UorYwtabSfsUe1J2W', NULL, NULL, '2016-10-30 11:41:37', 6, '2016-10-30 11:41:37', '2016-10-30 07:00:40', '176.214.236.42', '217.118.83.176', '2016-03-23 09:46:50', '2016-10-30 11:41:37', 'Аркадий', 'MQYXTyJSe7kqeQggDtTT', '2016-03-23 09:47:21', '2016-03-23 09:46:51', NULL, NULL, 'Широкшин', NULL, 'Пермякова', '625016', 'Тюмень', 'RU', '+79097366655', '<p>Родился в РФ, г. Тюмень 1983. Фотокамеру купил без году неделя. хотел бы развить навык фотографирования и понять куда это все выведет!</p>', 'Arkadiy', 'arkadiy', '1983-07-06', 3, NULL),
(350, 'luisa007@mail.ru', '$2a$10$OYWzrpu9c5T/BGo01xBf3uLSN/uFttya6xde5IHSbYBaBWIXFObhq', NULL, NULL, '2016-03-24 19:18:28', 2, '2016-03-28 11:16:03', '2016-03-24 19:18:28', '92.255.165.65', '178.72.68.151', '2016-03-24 19:17:58', '2016-03-28 11:16:03', 'Луиза', 'Rb85bA2FhVDLUv5U8J7k', '2016-03-24 19:18:17', '2016-03-24 19:17:59', NULL, NULL, 'Москвина', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ofelia', 'ofelia', '1979-05-15', NULL, NULL),
(351, '104a48@mail.ru', '$2a$10$xzhoqCuKZQhvnQnbAfOr0u5GSf.SV48WXZZNQKIAoa33x1/KNRVcS', NULL, NULL, '2016-03-25 12:27:15', 2, '2016-11-01 18:37:43', '2016-03-25 12:27:15', '178.72.68.53', '178.72.70.111', '2016-03-25 12:26:00', '2016-11-01 18:37:43', 'Павел', 'ATEoq9EmQGch4aBTNpGL', '2016-03-25 12:27:04', '2016-03-25 12:26:01', NULL, NULL, 'Моргун', NULL, 'Тюмень, Ленина 71-26', '625000', 'Тюмень', 'RU', '', '', 'pablo', 'pablo', '1973-02-20', 3, NULL),
(352, 'e2@bk.ru', '$2a$10$aglk6FlqhoWgrMqP2JgEde3PIaPwUfs3sqDartaahJbXDW2xHr2Oi', NULL, NULL, '2016-05-31 18:00:00', 3, '2016-05-31 18:29:09', '2016-05-31 18:18:09', '195.211.237.11', '92.255.165.65', '2016-03-25 13:47:50', '2016-06-01 06:29:23', 'Эдуард', 'K7LEZJGtg4V-xxmvVvtn', '2016-06-30 18:00:00', '2016-06-25 13:47:00', '', NULL, 'Кутыгин', '', '', '', 'Шадринск', 'RU', '+79125266745', '<p>Родился в России, г. Шадринске Курганской области 5.04.1967.</p><p>Образование:Шадринская художественная школа, средняя школа № 9, Санкт-Петербургский технический университет «физика полупроводников и полимеров».</p><p> В настоящее время предприниматель. Женат, дети. <br> Фотограф-любитель. Фотографией занимался периодами: школа, студенчество. Особенно активно фотографирует последние 15 лет в эпоху расцвета цифровой фотографии. <br> Вдохновение черпает в красотах родной природы, в красотах экзотических стран, окружающих его людях. </p><p>Основные направления творчества: природный пейзаж, жанр, жанровые и социальные портреты. <br> <br> </p><p>Активно путешествует по стране и за рубежом. </p><p>Проживает в г. Шадринск, Курганская область. </p><p>Член Союза фотохудожников России с 2011 года. </p><p>Член Российского географического общества с 2014 года.</p><p><b>Техника, используемая в настоящее время:</b></p><p>Камера - Nikon D800</p><p>Объектив - AF-S NIKKOR 14-24mm f/2.8G ED</p><p>Объектив - Nikon AF-S VR Zoom-Nikkor 70-300mm f/4.5-5.6G IF-ED</p><p>Объектив - Nikon 24-70mm f/2.8G ED AF-S Nikkor</p><p>Объектив - Nikon AF-S 50 mm f/1.4G Nikkor</p><p>Sigma AF 15mm f/2.8 EX DG DIAGONAL FISHEYE Nikon F</p><p>Tamron SP AF 150-600mm f/5-6.3 Di VC USD</p><p>Штатив</p><p>Вспышка <a href="http://www.intel-foto.ru/catalog/00001686/00001690/9787/">Nikon Speedlight SB-900</a></p><p><b>Ранее используемые объективы и камеры:</b></p><p> Nikon D 700</p><p>Nikon AF 24-85 mm f/2.8-4 D IF</p><p>Nikon AF-S 17-35 mm f/2.8D IF-ED</p><p>Nikon 85mm f/1.4D AF Nikkor</p><p>Участник фото выставок и конкурсов: </p><p><b>2016</b></p><p>-Шадринск. 04.2016. Персональная выставка «Алтай. Хмурая осень». 60 фотографий.</p><p>-Курган. 02.2016. Персональная фотовыставка «Два мира», 140 фотографий.</p><p>-Москва, 01.2016. «The best of Russia – 2015». Один из победителей в категории «Природа»</p><p><b>2015</b></p><p>-Шадринск, 11.2015. Персональная фотовыставка «Другой мир. Мангистау» 62 работы.</p><p>-Шадринск. 11.2015. «Город как книга» участник выставки.</p><p>- Москва. Один из победителей конкурса National geographic Россия «Мир на ладони» 2015.</p><p>http://www.nat-geo.ru/photo/contest/103841-mir-na-ladoni/winners/</p><p>-Катайск, 07.2015. Персональная фотовыставка, «Времена года, времена жизни», 82 фотографии.</p><p>-Курган, 05.2015. «Победной весне посвящается», 5 фотографий.</p><p>-Москва, 01.2015, участник фестиваля «Первозданная Россия-2», проект «Зауралье» 6 фотографий. </p><p>-Москва, 01.2015, один из победителей конкурса «Best of Russia-2014» в категории «Люди, события».</p><p>-Курган, 01.2015, <a href="http://vk.com/moe_zauralie">Фотовыставка «Мое Зауралье»</a>, категория «природа», 4 фотографии.</p><p>-Курган, 08.2015, участник фестиваля «Первозданная Россия-2», проект «Зауралье» 6 фотографий.</p><p>-Шадринск, 09.2015, фотовыставка «Другой мир. Мангистау», 62 фотографии.</p><p>-«Фотофест 2015», 09.2015,г. Челябинск, серий 5 фотографий «Мангистау. Другой мир».</p><p><b>2014</b></p><p>-Курган, 10.2014 в рамках фотовыставки членов СФР РФ «Отражения» 25 работ.</p><p>-Норильск, 10.2014, лауреат международного конкурса «Полярная перспектива», 1 работа.</p><p>-Шадринск 09.2014, победитель областного фотоконкурса «В объективе мудрость»</p><p>-Ташкент, 09.2014, «7-я Ташкентская международная Фотобиеннале», 8 работ. 2 место за серию «Два острова, Параллели». </p><p>-Шадринск, 04.2014, персональная выставка "Два острова. Портреты". 50 работ.</p><p>-Курган, 04.2014, персональная выставка "Времена года. Времена жизни", 70 работ</p><p>-Шадринск, 01.2014, персональная выставка"Времена года" , 46 работ. </p><p><b>2013</b></p><p>-Москва, 2012, конкурс, выставка, "Best of Russia. 2012", финалист , альбом, 1 фотография в категории" Люди", альбом.<br> -Москва, 2012, конкурс "Золотая черепаха-7", финалист в категории "Пейзаж", 1 фото, альбом и выставка.</p><p>-Москва, 2013 конкурс "Святое и ценное в России", финалист, 1 работа.</p><p>-Гватемала, г. Антигуа, 2013 фотовыставка избранных работ избранные работы фотоконкурса «Святое и ценное».</p><p>-Курган, 2013, "Имеет место быть", выставка членов СФР РФ, участник 10 фотографий.</p><p>-Курган, выставка православной фотографии, посвященная 20-ти летнему юбилею Курагнской и Шадринской епархии, участник.</p><p>-Шадринск, 2013,персональная выставка "Из дальних странствий", 52 работы.</p><p><b>2012</b></p><p>-Самара, 2012, конкурс "Самарский взгляд". Специальный диплом в категории "пейзаж", 3 фотографии на итоговой выставке.</p><p>-Шадринск, 2012, персональная выставка, "Россия - мой отчий дом", персональная 54 работы. <br> -Шадринск , 2012, персональная выставка, "К 350-ти летию Шадринска" персональная, 52 работы. <br> -Воронеж, конкурс, выставка, "Фотум Арт", 2 место в категориипейзаж, альбом, приз. <br> -Астрахань, 2012, конкурс, выставка, "Россия -отчий дом" 3 фотографии на выставке, финалист. <br> -г. Курган, 2012, выставка, "НАШЕ фото", к 15-ти летию Курганского филиалаСФР, 20 фотографий. Участник. <br> -г. Москва, 2012, конкурс, выставка, "Семейные ценности, 2012" , 5 фотографий. Участник. Альбом <br> -г. Курган, 2012, выставка, "Природа и Люди", 26 фотографий.Один из 2-х авторов.<br> -г. Москва, 2012, конкурс, выставка, фотографий дикой природы "Золотая черепаха-6", 1 фотография. Финалист в категории "Пейзаж". <br> -г. Москва, 2012, конкурс, выставка, "Вера в России. 2012", 1 фотография. Финалист.<br> <b>2011-2008<br> </b>-г. Москва, 2011, конкурс, выставка, "Русский пейзаж 2011", 09.2011, две фотографии . Финалист.<br> -г. Курган 2011, выставка "Фото ассорти", 8 фотографий. Участник.<br> -г. Курган, 2011, выставка, "Имеет место быть" региональная выставка членов СФР, 8 фотографий. Участник.<br> -г. Шадринск, 2011, выставка, "Взгляд путешественника-4", 2011, персональная. <br> -г. Шадринск,2010, выставка, "Взгляд путешественника-3", 2010, персональная.<br> -г. Шадринск, 2009, выставка, "Взгляд путешественника-2", 2009,персональная.<br> -г. Шадринск, 2008, выставка, "Взгляд путешественника-1", 2008, персональная.<br> <br> <br> </p><p>Значительно больше фотографий можно посмотреть в интернете на сайтах: <br> <a href="http://vk.com/kutygin_eduard">http://vk.com/kutygin_eduard</a>"В Контакте"</p><p><a href="http://www.ok.ru/profile/122659303789">http://www.ok.ru/profile/122659303789</a>"Одноклассники"</p><p><a href="https://www.facebook.com/profile.php?id=100001924607831&amp;sk=photos">https://www.facebook.com/profile.php?id=100001924607831&amp;sk=photos</a>"Facebook"</p><p><a href="http://club.foto.ru/gallery/photos/author.php?author_id=41564">http://club.foto.ru/gallery/photos/author.php?author_id=41564</a></p><p><a href="http://kutygin.35photo.ru/">http://kutygin.35photo.ru/</a></p><p>Печать фотографий осуществлена форматом А3, А3+ на материалах Epson, пигментные чернила Epson, так же в фотоцентре "Светопись" г. Екатеринбург, фотолаборатория фирмы Норицу.</p><p>Контакты: г. Шадринск, тел. 912-526-67-45. e2@bk.ru<br> <br> </p>', 'eduard_z45', 'eduard_z45', '1967-04-05', 3, NULL),
